INSERT INTO public.cur_currency VALUES (134, 'L', 'Leu', 'Lei', 'Moldovan leu', '1993-11-23', NULL, NULL, NULL, 'The name of the currency originates from a Romanian word which means "lion". It replaced the temporary cupon currency at a rate of 1 leu = 1000 cupon.');
INSERT INTO public.cur_currency VALUES (13, '₳', 'Austral', 'Australes', 'Argentine austral', '1985-06-15', '1991-12-31', 16, 10000, 'The austral replaced the peso argentino at a rate of 1 austral = 1000 pesos argentinos in 1985.');
INSERT INTO public.cur_currency VALUES (62, 'M', 'Mark', 'Mark', 'East German mark', '1948-06-21', '1990-07-01', NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (44, 'Br', 'Ruble', 'Rubles', 'Belarusian ruble', '1992-05', '1999-12-31', 46, 1000, 'From the collapse of the Soviet Union until May 1992, the Soviet ruble circulated in Belarus. New Russian banknotes also circulated in Belarus, but they were replaced by notes issued by the National Bank of the Republic of Belarus in May 1992. The first Belarusian ruble replaced the Soviet currency at the rate of 1 Belarusian ruble = 10 Soviet rubles.');
INSERT INTO public.cur_currency VALUES (63, 'DM', 'Mark', 'Mark', 'German mark', '1948', '2002-02-28', 74, 1.95583, NULL);
INSERT INTO public.cur_currency VALUES (159, 'ƒ', 'Guilder', 'Guilders', 'Dutch guilder', '1810', '2002-02-28', 74, 2.20371, NULL);
INSERT INTO public.cur_currency VALUES (28, 'лв.', 'Lev', 'Leva', 'Bulgarian lev', '1999-07-05', NULL, NULL, NULL, 'On 5 July 1999 the lev was redenominated at 1000:1 with 1 new lev equal to 1 Deutsche Mark.');
INSERT INTO public.cur_currency VALUES (310, 'сум', 'Soʻm', 'Soʻm', 'Uzbekistani soʻm', '1994-07-01', NULL, NULL, NULL, 'A second som was introduced at a rate of 1 new soʻm = 1000 old soʻm in 1994');
