INSERT INTO public.cur_currency VALUES (72, 'Pta', 'Peseta', 'Pesetas', 'Spanish peseta', '1869', '2002-02-28', 74, 166.386, 'The name of the currency comes from "pesseta", a Catalan diminutive of the Catalan word peça (meaning piece or fraction) or the Spanish Peso. The word peseta has been known as early as 1737 to colloquially refer to the coin worth 2 reales provincial or ​1⁄5 of a peso.
INSERT INTO public.cur_currency VALUES (238, NULL, 'Dinar', 'Dinars', 'South Yemeni dinar', '1965', '1996-06-11', NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (137, 'den', 'Denar', 'Denari', 'Macedonian denar', '1993-05-01', NULL, NULL, NULL, 'In May 1993, the currency was reformed. A new denar was introduced, with one new denar being equal to 100 old denari');
INSERT INTO public.cur_currency VALUES (23, 'KM', 'Convertible Mark', 'Convertible Marks', 'Bosnia and Herzegovina convertible mark', '1998-06-22', NULL, NULL, NULL, 'The convertible mark was established by the 1995 Dayton Agreement. It replaced the Bosnia and Herzegovina dinar, Croatian kuna and Republika Srpska dinar as the single currency of Bosnia and Herzegovina in 1998. Mark refers to the German mark, the currency to which it was pegged at par.');
INSERT INTO public.cur_currency VALUES (240, 'din', 'Dinar', 'Dinara', 'Yugoslav hard dinar', '1966-01-01', '1989-12-31', 243, 10000, 'This was the first revaluation of the Yugoslav Dinar, at a ratio of 100 to 1.');
INSERT INTO public.cur_currency VALUES (133, 'F', 'Franc', 'Francs', 'Monégasque franc', '1960', '1995-03-31', 78, NULL, NULL);
INSERT INTO public.cur_currency VALUES (9, 'Kz', 'Kwanza', 'Kwanzas', 'Angolan kwanza', '1999-12-01', NULL, NULL, NULL, 'The currency derives its name from the Kwanza River.
INSERT INTO public.cur_currency VALUES (22, NULL, 'Dinar', 'Dinara', '(First) Bosnia and Herzegovina dinar', '1992-07-01', '1994', 298, 10000, 'The first Bosnian dinar was issued in July, 1992, replacing the 1990 version of Yugoslav dinar at the rate of 1 Bosnia dinar = 10 Yugoslav "1990 dinara". Consequently, the Bosnian dinar was at par with the 1992 version of the Yugoslav dinar when it was introduced.');
INSERT INTO public.cur_currency VALUES (179, '₽', 'Ruble', 'Rubles', 'Russian ruble', '1998-01-01', NULL, NULL, NULL, 'This redenomination was an administrative step that reduced the unwieldiness of the old ruble but occurred on the brink of the 1998 Russian financial crisis. The ruble lost 70% of its value against the US dollar in the six months following this financial crisis.');
INSERT INTO public.cur_currency VALUES (196, '$', 'Dollar', 'Dollars', 'Surinamese dollar', '2004-01-01', NULL, NULL, NULL, 'The dollar replaced the Surinamese guilder on 1 January 2004, with one dollar equal to 1,000 guilders. Initially, only coins were available, with banknotes delayed until mid-February, reportedly due to a problem at the printer, the Canadian Bank Note Company.
INSERT INTO public.cur_currency VALUES (33, 'Bs', 'Boliviano', 'Bolivianos', 'Bolivian boliviano', '1987-01-01', NULL, NULL, NULL, 'Following many years of rampant inflation, the bolivian peso was replaced in 1987 by a new boliviano at a rate of one million to one.');
INSERT INTO public.cur_currency VALUES (132, NULL, 'Franc', 'Francs', 'Moroccan franc', '1921', '1974', 131, 100, NULL);
INSERT INTO public.cur_currency VALUES (85, NULL, 'Syli', 'Sylis', 'Guinean syli', '1971', '1985', 86, 1, 'The syli was the currency of Guinea between 1971 and 1985. The word syli means "elephant". The syli was replaced by the Guinean franc in 1985 at par.');
INSERT INTO public.cur_currency VALUES (144, 'UM', 'Ouguiya', 'Ouguiya', 'Mauritanian ouguiya', '2018-01-01', NULL, NULL, NULL, 'The current ouguiya was introduced in 2018, replacing the old ouguiya at a rate of 1 new ouguiya = 10 old ouguiya,');
