INSERT INTO public.cur_currency VALUES (200, 'Db', 'Dobra', 'Dobras', 'São Tomé and Príncipe dobra', '2018-01-01', NULL, NULL, NULL, 'Due to inflation, on 1 January 2018 the dobra was redenominated at a rate of 1000 to 1.');
INSERT INTO public.cur_currency VALUES (131, NULL, 'Dirham', 'Dirhams', 'Moroccan dirham', '1960-10-16', NULL, NULL, NULL, NULL);
