INSERT INTO public.cur_currency VALUES (103, '₹', 'Rupee', 'Rupee', 'Indian rupee', '-340', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (149, 'K', 'Kwacha', 'Kwacha', 'Malawian kwacha', '1971', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (125, '$', 'Dollar', 'Dollars', 'Liberian dollar', '1943', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (42, 'Nu', 'Ngultrum', 'Ngultrum', 'Bhutanese ngultrum', '1974', NULL, NULL, NULL, 'The term derives from the Dzongkha ngul, "silver" and trum, a Hindi loanword meaning "money".
INSERT INTO public.cur_currency VALUES (54, '₡', 'Colón', 'Cólones', 'Costa Rican colón', '1896', NULL, NULL, NULL, 'The colón was named after Christopher Columbus, known as Cristóbal Colón in Spanish. It was introduced in 1896, replacing the Costa Rican peso at par.');
INSERT INTO public.cur_currency VALUES (45, 'Br', 'Ruble', 'Rubles', 'Belarusian ruble', '2016-07-01', NULL, NULL, NULL, 'In July 2016, a new ruble was introduced, at a rate of 1 BYN = 10,000 BYR. Old and new rubles circulated in parallel from 1 July to 31 December 2016. Belarus also issued coins for general circulation for the first time.');
INSERT INTO public.cur_currency VALUES (223, 'N$', 'Nuevo Peso', 'Nuevos Pesos', 'Uruguayan nuevo peso', '1975-07-01', '1993-03-01', 225, 1000, 'The nuevo peso replaced the peso on 1 July 1975 at 1 new to 1,000 old');
