INSERT INTO public.cur_currency VALUES (74, '€', 'Euro', 'Euro', 'European euro', '1999-01-01', NULL, NULL, NULL, 'The name "Euro" was officially adopted on 16 December 1995 in Madrid. The euro was introduced to the financial markets as an accounting currency on 1 January 1999, replacing the former European Currency Unit (ECU) at a ratio of 1:1. Physical euro coins and banknotes entered into circulation on 1 January 2002, as the official currency of the Euro Zone original members, and by March 2002 it had completely replaced the former currencies.<br/>Central bank: <a href="http://www.ecb.europa.eu" target="_blank">European Central Bank</a><br/><a href="https://en.wikipedia.org/wiki/Template:Historical_currencies_of_the_European_Union" target="_blank">Conversion Rates</a> to the former national currencies.');
INSERT INTO public.cur_currency VALUES (252, '$', 'Dollar', 'Dollars', 'Zimbabwean dollar', '1980-04-18', '2006-07-31', 254, 1000, '1st Zimbabwean dollar. It replaced the Rhodesian dollar at par.');
INSERT INTO public.cur_currency VALUES (253, '$', 'Dollar', 'Dollars', 'Zimbabwean dollar', '2009-02-03', '2009-04-12', NULL, NULL, '4th Zimbabwean dollar. On 12 April 2009, the suspension of the local currency "for at least a year" was announce, effectively terminating the fourth dollar.');
INSERT INTO public.cur_currency VALUES (254, '$', 'Dollar', 'Dollars', 'Zimbabwean dollar', '2006-08-01', '2008-07-31', 255, 1e+10, '2nd Zimbabwean dollar');
INSERT INTO public.cur_currency VALUES (255, '$', 'Dollar', 'Dollars', 'Zimbabwean dollar', '2008-08-01', '2009-02-02', 253, 1e+12, '3rd Zimbabwean dollar');
INSERT INTO public.cur_currency VALUES (249, 'NZ', 'New Zaire', 'New Zaires', 'Zairean new zaire', '1993', '1997', 49, 100000, 'The New Zaire was replaced by the Congolese franc again on 1 July 1998, shortly after the Republic of Zaire became the Democratic Republic of the Congo once more, on 16 May 1997.');
INSERT INTO public.cur_currency VALUES (242, 'din', 'Dinar', 'Dinara', 'Yugoslav dinar', '1994-01-24', '2003-07-02', 55, 1, 'Introduced as "novi dinar" to replace the previous dinar.  This was not a revaluation of the dinar. Instead, the novi dinar was pegged at par to the Deutsche Mark.
INSERT INTO public.cur_currency VALUES (49, 'FC', 'Franc', 'Francs', 'Congolese franc', '1997', NULL, NULL, NULL, 'The franc was re-established in 1997, replacing the new zaïre at a rate of 1 franc = 100,000 new zaïres');
INSERT INTO public.cur_currency VALUES (191, NULL, 'Tolar', 'Tolarjev', 'Slovenian tolar', '1991-10-08', '2007-01-01', 74, 239.64, 'The name tolar comes from Thaler, and is cognate with dollar. The tolar was introduced on 8 October 1991. It replaced the 1990 (Convertible) version of Yugoslav dinar at parity.
INSERT INTO public.cur_currency VALUES (213, '₺', 'Lira', 'Lira', 'Turkish lira', '1923', '2005-12-31', 214, 1e+06, 'The Turkish lira replaced the Ottoman lira, whch remained in circulation until the end of 1927.');
INSERT INTO public.cur_currency VALUES (207, 'SM', 'Somoni', 'Somoni', 'Tajikistani somoni', '2000-10-30', NULL, NULL, NULL, 'The currency is named after the father of the Tajik nation, Ismail Samani (also spelled Ismoil Somoni)');
INSERT INTO public.cur_currency VALUES (209, 'T', 'Manat', 'Manat', 'Turkmenistan new manat', '2009-01-01', NULL, NULL, NULL, 'On 1 January 2009, the new manat was introduced at the rate of 5000 old manat to 1 new manat.');
INSERT INTO public.cur_currency VALUES (220, 'USh', 'Shilling', 'Shilling', 'Ugandan shilling', '1966', '1987', 221, 100, 'The first Ugandan shilling replaced the East African shilling in 1966 at par.');
INSERT INTO public.cur_currency VALUES (185, '£Sd', 'Dinar', 'Dinars', 'Sudanese dinar', '1992-06-08', '2007-07-01', 186, 100, 'The dinar replaced the first Sudanese pound on June 8, 1992, at a rate of 1 dinar = 10 pounds.');
INSERT INTO public.cur_currency VALUES (197, 'ƒ', 'Guilder', 'Guilders', 'Surinamese guilder', '1826', '2004-01-01', 196, 1000, 'The Surinamese guilder was initially at par with the Dutch guilder. The forst banknotes were introduced in 1826 by Algemene Nederlandsche Maatschappij (General Netherlands Company)');
INSERT INTO public.cur_currency VALUES (24, '$', 'Dollar', 'Dollars', 'Barbadian dollar', '1973', NULL, NULL, NULL, 'The present dollar was created after the establishment of the Central Bank of Barbados (CBB), which was founded in May, 1972. The Barbados dollar replaced the East Caribbean dollar at par in 1973. Since 5 July 1975, the Barbados dollar has been pegged to the US dollar at US$1 = Bds$2.');
INSERT INTO public.cur_currency VALUES (3, 'د.إ', 'Dirham', 'Dirhams', 'United Arab Emirates dirham', '1973-05-19', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (212, NULL, 'Escudo', NULL, NULL, '1959', '1976', NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (32, '$', 'Dollar', 'Dollars', 'Brunei dollar', '1967', NULL, NULL, NULL, 'The Brunei dollar replaced the Malaya and British Borneo dollar in 1967 after the formation of Malaysia and the independence of Singapore. Until 23 June 1973, the Malaysian ringgit was exchangeable at par with the Singapore dollar and Brunei dollar.');
INSERT INTO public.cur_currency VALUES (65, NULL, 'Krone', 'Krone', 'Danish krone', '1875', NULL, NULL, NULL, NULL);
