INSERT INTO public.cur_currency VALUES (225, '$', 'Peso', 'Pesos', 'Uruguayan peso', '1993-03-01', NULL, NULL, NULL, 'Due to inflation the peso uruguayo replaced the nuevo peso on March 1, 1993, at a rate of 1 new for 1000 old pesos.');
INSERT INTO public.cur_currency VALUES (222, '$', 'Dollar', 'Dollars', 'United States dollar', '1792', NULL, NULL, NULL, NULL);
