INSERT INTO public.cur_currency VALUES (205, '฿', 'Baht', NULL, 'Thai baht', '1851', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (230, 'Bs.S', 'Bolívar soberano', 'Bolivares', 'Venezuelan bolívar soberano', '2018-08-20', NULL, NULL, NULL, 'Due to hyperinflation, the bolívar soberano replaced the bolívar fuerte after a transition period.');
INSERT INTO public.cur_currency VALUES (211, 'T$', 'Pa''anga', 'Pa''anga', 'Tongan paʻanga', '1967-04-03', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (194, '₤', 'Lira', 'Lire', 'Sammarinese lira', '1864', '1992-08-31', 108, NULL, NULL);
INSERT INTO public.cur_currency VALUES (111, '¥', 'Yen', 'Yen', 'Japanese yen', '1871', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (198, 'SS£', 'Pound', 'Pounds', 'South Sudanese pound', '2011-07-18', NULL, NULL, NULL, 'It replaced the Sudanese pound at par, after South Sudan declared independence from Sudan');
INSERT INTO public.cur_currency VALUES (273, 'Pta', 'Peseta', 'Pesetas', 'Equatorial Guinean peseta', '1969', '1975', 87, 1, 'The peseta (peseta guineana) replaced the Spanish peseta at par shortly after gaining independence from Spain the prior year.');
INSERT INTO public.cur_currency VALUES (169, '₱', 'Peso', 'Pesos', 'Philippine peso', '1898', NULL, NULL, NULL, 'It was a continuation of the colonial Spanish denomination, "Peso Fuerte", without "Fuerte" ');
INSERT INTO public.cur_currency VALUES (66, '$', 'Peso', 'Pesos', 'Dominican peso', '1937', NULL, NULL, NULL, 'The peso oro was first introduced as a local coinage in 1937. No paper money was made and US notes continued to circulate as the U.S. dollar was officially the national currency. Only in 1947 were the first peso oro notes issued by the Central Bank.
INSERT INTO public.cur_currency VALUES (279, NULL, 'Silver Escudo', 'Silver Escudos', 'Silver Escudo', '1864', '1868', 72, 0.4, 'The silver escudo was one of the currencies of Spain between 1864 and 1869. Some coins and banknotes were produced up to 1873. It was subdivided into 100 céntimos de escudo. The escudo replaced the real de vellon at a rate of 10 reales de vellon = 1 escudo.');
INSERT INTO public.cur_currency VALUES (280, NULL, 'Real de Vellon', 'Reales de Vellon', 'Real de Vellon', '1600', '1864', 279, 10, 'The Real de Vellón was introduced in 1600 (made of billon, or less than half silver). In 1737 was fixed at ​1⁄20 dollar and equal to 34 maravedíes. Hence 1 Spanish Dollar = 8 Reales = 20 Reales de Vellon = 680 Maravedíes. The Dollar was also called "Real de a 8", "Peso Fuerte" or "Peso Duro". "Peso" was also used as one half of a "Peso Fuerte", equivalent in value to 10 Reales de Vellon (or "1 Real de a 4"). These units were inuse especially for silver coins. Another unit used in parallel was the Escudo or golden Escudo, which was commonly used for the golden coins. It''s value was 16 Reales or 2 Pesos Duros or 40 Reales de Vellon. 
INSERT INTO public.cur_currency VALUES (283, NULL, 'Peso Fuerte', 'Pesos Fuertes', 'Dominican peso fuerte', '1861', '1865', NULL, NULL, 'Issued during the Spanish occupation between the first and the second republic');
INSERT INTO public.cur_currency VALUES (2, NULL, 'Peso', 'Pesos', 'Dominican peso', '1848', '1905', NULL, NULL, 'The U.S. dollar was officially the national currency after the Peso was discontinued');
INSERT INTO public.cur_currency VALUES (284, '$', 'Dollar', 'Dollars', 'Puerto Rican dollar', '1899', '1916', NULL, NULL, 'The Puerto Rican Dollar was initially a continuation of the Spanish Peso. Only in the  last issue in 1909 the word Peso was not shown,');
INSERT INTO public.cur_currency VALUES (285, '$', 'Dollar', 'Dollars', 'RTGS Dollar', '2019-06-01', '2020-03-31', NULL, NULL, 'The RTGS dollar or RTG (zimdollar or zollar) was the only official currency in Zimbabwe from June 2019 until March 2020, when foreign currency was again allowed. The RTGS dollar was introduced on 21 February 2019. The currency was made up of bond coins, bond notes and RTGS balances. The original bond notes had been introduced in 2016 to ease US Dollar cash shortages at the time. They were renamed RTGS dollars in 2019, and in June 2019 became the only legal currency in Zimbabwe, replacing the multi-currency system');
INSERT INTO public.cur_currency VALUES (89, NULL, 'Quetzal', 'Quetzales.', 'Guatemalan quetzal', '1925', NULL, NULL, NULL, 'The currency was named after the national bird of Guatemala, the resplendent quetzal. In ancient Mayan culture, the quetzal bird''s tail feathers were used as currency.
INSERT INTO public.cur_currency VALUES (8, 'ƒ', 'Guilder', 'Guilders', 'Netherlands Antillean guilder', '1892', NULL, NULL, NULL, 'Currency began to be issued specifically for use in the Netherlands Antilles in the name of Curaçao. The first banknotes were introduced in 1892. The name "Netherlands Antilles" (Nederlandse Antillen) was introduced in 1952. In 2010 the Netherland Antilles ceased to exist but Curaçao and Sint Maarten continued issuing the Netherlands Antillean Guilder.');
INSERT INTO public.cur_currency VALUES (250, 'Z', 'Zaïre', 'Zaires', 'Zairean zaire', '1967', '1993', 249, 3e+06, 'The Zaire was introduced in 1967, replacing the Congolese franc, and was replaced by the New Zaire due to high inflation.');
INSERT INTO public.cur_currency VALUES (120, '₸', 'Tenge', 'Tenge', 'Kazakhstani tenge', '1993-11-15', NULL, NULL, NULL, 'On November 12, 1993, the President of Kazakhstan issued a decree "On introducing national currency of Republic of Kazakhstan". The tenge was introduced on 15 November 1993 to replace the Soviet ruble at a rate of 1 tenge = 500 rubles.');
INSERT INTO public.cur_currency VALUES (282, 'din', 'Dinar', 'Dinara', 'Yugoslav dinar', '1919', '1941', 289, 20, 'Until 1918, the dinar was the currency of Serbia. It then became the currency of the Kingdom of Serbs, Croats and Slovenes, circulating alongside the krone in Croatia, Slovenia and Bosnia and Herzegovina, with 1 dinar = 4 kronen. The first banknotes bearing the name of the Kingdom of Serbs, Croats and Slovenes were issued in 1920, until which time Serbian banknotes circulated. In 1929, the name of the country changed to the Kingdom of Yugoslavia and this was reflected on the currency');
INSERT INTO public.cur_currency VALUES (55, 'din', 'Dinar', 'Dinara', 'Serbian dinar', '2003-07-03', NULL, NULL, NULL, 'The Serbian dinar replaced the Yugoslav dinar in 2003, when the Federal Republic of Yugoslavia was transformed into the State Union of Serbia and Montenegro. Between 2003 and 2006, the Serbian dinar used the ISO 4217 code CSD, with CS being the ISO 3166-2 country code for Serbia and Montenegro. When the State Union was dissolved in 2006, the dinar''s ISO 4217 code was changed to the current RSD.');
INSERT INTO public.cur_currency VALUES (86, 'FG', 'Franc', 'Francs', 'Guinean franc', '1985', NULL, NULL, NULL, 'The Guinean franc was reintroduced as Guinea''s currency in 1985, at par with the syli.');
INSERT INTO public.cur_currency VALUES (232, 'VT', 'Vatu', 'Vatu', 'Vanuatu vatu', '1981', NULL, NULL, NULL, 'The vatu was introduced in 1981, one year after independence, to replace the New Hebrides franc at par.');
INSERT INTO public.cur_currency VALUES (107, 'kr', 'Krona', 'Kronur', 'Icelandic krona', '1981-07-01', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (246, 'R', 'Rand', 'Rand', 'South African rand', '1961-02-14', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (241, 'din', 'Dinar', 'Dinara', 'Yugoslav dinar', '1994-01-01', '1994-01-23', 242, 1.3e+07, 'Yugoslavia re-denominated the dinar for at a ratio of 1 billion to 1.
INSERT INTO public.cur_currency VALUES (244, 'din', 'Dinar', 'Dinara', 'Yugoslav dinar', '1993-10-01', '1993-12-31', 241, 1e+09, 'Yugoslavia re-denominated the dinar for the fourth time on 1 October 1993, at a ratio of 1 million to 1. ');
INSERT INTO public.cur_currency VALUES (245, 'din', 'Dinar', 'Dinara', 'Yugoslav reformed dinar', '1992-07-01', '1993-09-30', 244, 1e+06, 'This was the third revaluation of the Yugoslav dinar, at a ratio of 10 to 1.');
INSERT INTO public.cur_currency VALUES (243, 'din', 'Dinar', 'Dinara', 'Yugoslav convertible dinar', '1990-01-01', '1992-06-30', 245, 10, 'The second revaluation of the Yugoslav dinar took place on 1 January 1990, at a ratio of 10,000 to 1. During this period, the constituent republics began to leave the Socialist Federal Republic of Yugoslavia. Four of the six republics declared independence and started issuing their own currencies shortly after. This was the last dinar that bore the coat of arms and the name of the "Socialist Federal Republic of Yugoslavia".');
INSERT INTO public.cur_currency VALUES (281, 'din', 'Dinar', 'Dinara', 'Federation dinar', '1944', '1965', 240, 100, 'In 1944, as Yugoslavia began to be reconstituted, the Yugoslav dinar replaced the Serbian dinar, Independent State of Croatia kuna and other occupation currencies, with the rates of exchanged being 1 Yugoslav dinar = 20 Serbian dinara = 40 kuna.');
INSERT INTO public.cur_currency VALUES (288, NULL, 'Krone', 'Kronen', 'Yugoslav krone', '1919', '1922', 282, 4, 'The krone replaced the Austro-Hungarian krone at par on November 12, 1918. It circulated alongside the Serbian dinar in State of Slovenes, Croats and Serbs with an exchange rate of 1 dinar = 4 kronen in the intermediate time before the adoption of the Yugoslav dinar. The exact date at which the krone ceased to circulate is unclear, with one source indicating that the krone was still in circulation at the end of 1922');
INSERT INTO public.cur_currency VALUES (92, 'HK$', 'Dollar', 'Dollars', 'Hong Kong dollar', '1935', NULL, NULL, NULL, ' In 1863, the Royal Mint in London began issuing special subsidiary coinage for use in Hong Kong within the dollar system. In the 1860s, banknotes of the new British colonial banks, the Hong Kong and Shanghai Banking Corporation and the Chartered Bank of India, Australia and China, denominated in dollars, also began to circulate in both Hong Kong and the wider region.
INSERT INTO public.cur_currency VALUES (287, 'din', 'Dinar', 'Dinara', 'Serbian dinar', '1868', '1920', 282, 1, 'After the last Ottoman garrisons were withdrawn in 1867, Serbia was faced with multiple currencies in circulation. Thus, prince Mihailo Obrenović ordered a national currency be minted. The first bronze coins were introduced in 1868. The first banknotes were issued in 1876. Between 1873 and 1894, the dinar was pegged at par to the French franc. The Kingdom of Serbia also joined the Latin Monetary Union.
INSERT INTO public.cur_currency VALUES (289, 'din', 'Dinar', 'Dinara', 'Serbian dinar', '1941', '1944', 281, 20, 'In 1941, the Yugoslav dinar was replaced, at par, by a second Serbian dinar for use in the German occupied Serbia. The dinar was pegged to the German reichsmark at a rate of 250 dinars = 1 Reichsmark. This dinar circulated until 1944, when the Yugoslav dinar was reintroduced by the Yugoslav Partisans, replacing the Serbian dinar at a rate of 1 Yugoslav dinar = 20 Serbian dinars');
INSERT INTO public.cur_currency VALUES (290, 'Kn', 'Kuna', 'Kuna', 'Independent State of Croatia kuna', '1941-07-26', '1945-07-09', 281, 40, 'The kuna was the currency of the Independent State of Croatia in the period between 1941 and 1945 during World War II. It replaced the Yugoslav dinar at par and was fixed to the German Reichsmark.
INSERT INTO public.cur_currency VALUES (142, 'MOP$', 'Pataca', 'Patacas', 'Macanese pataca', '1952', NULL, NULL, NULL, 'The pataca was introduced in Portuguese Macau and Portuguese Timor in the year 1894, but only as a unit of account. The unit initially corresponded to the Mexican Peso, and it replaced the Portuguese real at a rate of 1 pataca = 450 réis. The name pataca derives from the fact that the Portuguese always referred to the Mexican Peso as the pataca mexicana.
INSERT INTO public.cur_currency VALUES (139, NULL, 'Franc', 'Francs', NULL, '1962', '1984-01-01', 236, NULL, NULL);
INSERT INTO public.cur_currency VALUES (128, NULL, 'Franc', 'Francs', NULL, '1944', '2002-02-28', NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (286, 'F', 'Franc', 'Francs', 'French Franc', '1795', '1960', 78, 100, 'Between 1360 and 1641, the Franc was the name of coins worth 1 livre tournois and it remained in common parlance as a term for this amount of money. It was reintroduced (in decimal form) in 1795. In 1960, due to inflation it was replaced by the new franc (NF)');
INSERT INTO public.cur_currency VALUES (78, 'F', 'Franc', 'Francs', 'French franc', '1960-01-01', '2002-02-28', NULL, NULL, 'In January 1960 the French franc was revalued, with 100 existing francs making one "nouveau franc". The abbreviation "NF" was used until 1963.');
INSERT INTO public.cur_currency VALUES (233, '$', 'Tala', 'Tala', 'Samoan tala', '1967-07-10', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (192, 'Sk', 'Koruna', 'Korun', 'Slovak koruna', '1993-02-08', '2008-12-31', 74, 30.126, 'In 1993, the newly independent Slovakia introduced its own koruna, replacing the Czechoslovak koruna at par. It was the currency of Slovakia between 8 February 1993 and 31 December 2008, and could be used for cash payment until 16 January 2009.');
INSERT INTO public.cur_currency VALUES (214, '₺', 'Lira', 'Lira', 'Turkish lira', '2005-01-01', NULL, NULL, NULL, 'The second Turkish Lira was introduced on 1 January 2005, replacing the previous Turkish lira (which remained valid in circulation until the end of 2005) at a rate of 1 second Turkish lira = 1,000,000 first Turkish lira. 
INSERT INTO public.cur_currency VALUES (26, NULL, 'Franc', 'Francs', 'Belgian Franc', '1832', '2002-02-28', NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (30, NULL, 'Franc', 'Francs', 'Burundian franc', '1964', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (100, 'I£', 'Pound', 'Pounds', 'Israeli pound', '1952-01-09', '1980-02-23', 101, 10, 'The Israeli pound, "lira yisraelit", was the currency of the State of Israel from June 1952 until 23 February 1980, when it was replaced with the shekel on 24 February 1980. From 1955, after the Bank of Israel was established and took over the duty of issuing banknotes, only the Hebrew name was used, along with the symbol "I£". The pegging to the British Pound was abolished on 1 January 1954');
INSERT INTO public.cur_currency VALUES (56, 'Kčs', 'Koruna', 'Korun', 'Czechoslovak koruna', '1953-06-01', '1993-02-08', NULL, NULL, 'The Czechoslovak koruna (crown) was the currency of Czechoslovakia from April 10, 1919, to March 14, 1939, and from November 1, 1945, to February 7, 1993. For a brief time in 1939 and again in 1993, it was also the currency in separate Czech and Slovak republics.
INSERT INTO public.cur_currency VALUES (291, 'Kčs', 'Koruna', 'Korun', 'Czechoslovak koruna', '1919-04-10', '1939-03-14', NULL, NULL, 'The Czechoslovak koruna (crown) was the currency of Czechoslovakia from April 10, 1919, to March 14, 1939. For a brief time in 1939, it was also the currency in separate Czech and Slovak republics. Afterwards, separate currencies for Bohemia and Moravia and Slovakia were introduced, at par with the Czechoslovak koruna. These were the Bohemian and Moravian koruna and the Slovak koruna.
INSERT INTO public.cur_currency VALUES (292, 'Kčs', 'Koruna', 'Korun', 'Czechoslovak koruna', '1944', '1953-05-30', 56, 50, 'After the II World war, officially in November 1, 1945, the Czechoslovak koruna was re-established, replacing the two previous currencies at par.
INSERT INTO public.cur_currency VALUES (61, 'Kč', 'Koruna', 'Korun', 'Czech koruna', '1993', NULL, NULL, NULL, 'The Czech koruna replaced at par the Czechoslovak koruna when it was introduced in 1993 after the dissolution of Czechoslovakia.');
INSERT INTO public.cur_currency VALUES (71, 'Nkf ', 'Nakfa', 'Nakfa', 'Eritrean nakfa', '1997-11-08', NULL, NULL, NULL, 'The nakfa was introduced in 1997 to replace the Ethiopian birr at par. The currency takes its name from the Eritrean town of Nakfa, site of the first major victory of the Eritrean War of Independence');
INSERT INTO public.cur_currency VALUES (298, 'din', 'Dinar', 'Dinara', '(Second) Bosnia and Herzegovina dinar', '1994', '1998-02-04', 23, NULL, 'A second dinar was introduced in 1994, replacing the first at a rate of 1 "new" dinar = 10,000 "old" dinara. Both these dinars were restricted in their circulation to the areas under Bosniak control. The Croat areas used the Croatian dinar and kuna, whilst the Serb areas used the Republika Srpska dinar.
INSERT INTO public.cur_currency VALUES (293, 'din', 'Dinar', 'Dinara', '(First) Republika Srpska dinar', '1992', '1993-09-30', 294, 1e+06, 'The dinar was introduced in 1992 in conjunction with the Yugoslav dinar of that year (YUR), to which it was equal. ');
INSERT INTO public.cur_currency VALUES (294, 'din', 'Dinar', 'Dinara', '(Second) Republika Srpska dinar', '1993-10-01', '1993-12-31', 241, 1e+09, 'The second dinar was introduced on October 1, 1993, replacing the first at a rate of one million to one, matching the revaluation of the Yugoslav dinar (YUO). Following this, the Republika Srpska used Yugoslav currency: first the "1994 dinar" and then "novi dinar"');
INSERT INTO public.cur_currency VALUES (94, 'din', 'Dinar', 'Dinara', 'Croatian dinar', '1991-12-23', '1994-05-30', 95, 1000, 'The Croatian dinar replaced the 1990 version of Yugoslav dinar at par. It was a transitional currency introduced following Croatia''s declaration of independence. During its existence the dinar declined in value by a factor of about 70.');
INSERT INTO public.cur_currency VALUES (295, 'din', 'Dinar', 'Dinara', '(First) Krajina dinar', '1992', '1993-09-30', 296, 1e+06, 'The dinar was introduced in 1992 in conjunction with the Yugoslav dinar of that year (YUR), to which it was equal. ');
INSERT INTO public.cur_currency VALUES (95, 'kn', 'Kuna', 'Kuna', 'Croatian kuna', '1994-05-30', NULL, NULL, NULL, 'The word kuna means "marten" in Croatian, referring to the historical use of marten pelts as units of value in medieval trading. 
INSERT INTO public.cur_currency VALUES (296, 'din', 'Dinar', 'Dinara', '(Second) Krajina dinar', '1993-10-01', '1993-12-31', 297, 1e+09, 'The second dinar was introduced on October 1, 1993, replacing the first at a rate of one million to one, matching the revaluation of the Yugoslav dinar (YUO). ');
INSERT INTO public.cur_currency VALUES (297, 'din', 'Dinar', 'Dinara', '(Third) Krajina dinar', '1994-01-01', '1994-01-23', 242, 1.3e+07, 'The third dinar was introduced on January 1, 1994, replacing the second at a rate of one billion to one, matching the revaluation of the Yugoslav dinar (YUG). Following this, Krajina used the Yugoslav currency (YUM) until Croatia took control of the region.');
INSERT INTO public.cur_currency VALUES (138, 'den', 'Denar', 'Denari', 'Macedonian denar', '1992-04-26', '1993-06-30', 137, 100, 'The name "denar" (like the "dinar") comes from the name of the ancient Roman monetary unit, the denarius
INSERT INTO public.cur_currency VALUES (97, 'Ft', 'Forint', 'Forint', 'Hungarian forint', '1946-08-01', NULL, NULL, NULL, 'The forint''s name comes from the city of Florence, where gold coins called fiorino d''oro were minted from 1252. In Hungary, florentinus (later forint), also a gold-based currency, was used from 1325. Between 1868 and 1892 the forint was the name used in Hungarian for the currency of the Austro-Hungarian Empire.
INSERT INTO public.cur_currency VALUES (299, 'P', 'Pengo', 'Pengo', 'Hungarian pengo', '1927-01-01', '1946-07-31', 97, 4e+29, 'The Hungarian word pengő means ''ringing'', which in turn derives from the verb peng, an onomatopoeic word equivalent to English ''ring''. It was first used from the 15th to the 17th century to refer to silver coins.
INSERT INTO public.cur_currency VALUES (141, '₮', 'Tögrög', 'Tögrög', 'Mongolian tögrög', '1925-12-09', NULL, NULL, NULL, 'The word tögrög (төгрөг) refers to "circle", or a "circular object" (i.e. a coin).
INSERT INTO public.cur_currency VALUES (300, 'AP', 'Adopengo', 'Adopengorol', 'Hungarian adopengo', '1946-01-01', '1946-07-31', 97, 2e+08, 'The adopengo (in English: "tax pengő") was a temporary unit of currency of Hungary introduced to try to stabilise the pengő. On 31 July 1946, both were replaced by the forint. Initially the adópengő was only an accounting unit used by the government and commercial banks with the same value as the pengo; later, bonds and savings certificates denominated in adópengő were also issued for the public, and replaced pengő notes in circulation. By 1 June 1946, the change was 160,000 pengo; on 1 July 1946, it had increased to	7,500,000,000 and the adópengő became the only circulating currency as the pengő''s value had fallen to such an extent that even the 100 million b.-pengő note was effectively worthless; finally on 31 July 1946 the change reached 2,000,000,000,000,000,000,000
(2 sextillion).');
INSERT INTO public.cur_currency VALUES (301, 'K', 'Korona', 'Korona', 'Hungarian korona', '1920', '1926-12-31', 299, 12500, 'The Hungarian korona ("crown") was the replacement currency of the Austro-Hungarian Krone/korona in the newly created post-World War I Hungary. It replaced the Austro-Hungarian counterpart at par.  The overstamping of the banknotes of the Austro-Hungarian Bank started only in 1920. It suffered a serious inflation and was replaced by the pengő on 1 January 1927.');
INSERT INTO public.cur_currency VALUES (167, 'S/', 'Sol', 'Soles', 'Peruvian sol', '1991-07-01', NULL, NULL, NULL, 'The Nuevo Sol replaced the Peruvian inti in 1991 and the name is a return to that of Peru''s historic currency, as the previous incarnation of sol was in use from 1863 to 1985. 
INSERT INTO public.cur_currency VALUES (12, 'Kz', 'Kwanza reajustado', 'Kwanzas reajustados', 'Angolan kwanza reajustado', '1995-07-01', '1999-11-30', 9, 1e+06, 'It replaced the previous kwanza at a rate of 1,000 to 1. Only banknotes were issued.');
INSERT INTO public.cur_currency VALUES (165, NULL, 'Sol de Oro', 'Soles de Oro', 'Peruvian sol de oro', '1863', '1985-02-01', 166, 1000, 'Although sol in this usage is derived from the Latin solidus (English: solid), the word also means "sun" in Spanish.
INSERT INTO public.cur_currency VALUES (10, 'Kz', 'Kwanza', 'Kwanzas', 'Angolan kwanza', '1977-01-08', '1990-09-24', 11, 1, 'Kwanza was introduced following Angolan independence. It replaced the escudo at par.');
INSERT INTO public.cur_currency VALUES (307, NULL, 'Lira', 'Lira', 'Ottoman lira ', '1844', '1923', 213, 1, 'The Ottoman lira was the currency of Ottoman Empire between 1844 and 1923, when it was replaced by the Turkish lira. The Ottoman lira remained in circulation until the end of 1927.
INSERT INTO public.cur_currency VALUES (104, 'د.ع', 'Dinar', 'Dinars', 'Iraqi dinar', '1932', NULL, NULL, NULL, 'The dinar was introduced into circulation in 1932, replacing the Indian rupee, which had been the official currency since the British occupation of the country in World War I, at a rate of 1 dinar = 11 rupees.');
INSERT INTO public.cur_currency VALUES (11, 'Kz', 'Kwanza', 'Kwanzas', 'Angolan kwanza ', '1990-09-25', '1995-06-30', 12, 1000, 'Although it replaced the kwanza at par, Angolans could only exchange 5% of all old notes for new ones. This kwanza suffered from high inflation. The name Novo (New) Kwanza was only used in the first issue of overprinted notes.');
INSERT INTO public.cur_currency VALUES (302, NULL, 'Escudo', 'Escudos', 'Angolan escudo', '1958', '1977', 10, 1, 'In 1953, Portugal began unifying the currencies of its colonies. This process was completed in Angola at the end of 1958, with the reintroduction of the escudo. The escudo was replaced in 1977 by the kwanza at par.');
INSERT INTO public.cur_currency VALUES (303, NULL, 'Angolar', 'Angolares', 'Angolan angolar', '1928', '1958', 302, 1, 'The angolar was introduced in 1928 to replace the escudo. Banknotes were exchanged at a rate of 1 angolar = 1.25 escudos.
INSERT INTO public.cur_currency VALUES (304, NULL, 'Escudo', 'Escudos', 'Angolan escudo', '1914', '1928', 303, 1.25, 'The introduction of the escudo in Portugal''s colonies took place in 1914, three years after it occurred in Portugal. The escudo replaced the real at a rate of 1000 réis = 1 escudo');
INSERT INTO public.cur_currency VALUES (305, NULL, 'Real', 'Reis', 'Angolan real', '1814', '1914', 304, 1000, 'The real was the currency of Portuguese Angola until 1914. It was equal to the Portuguese real. The real was replaced by the escudo in 1914.');
INSERT INTO public.cur_currency VALUES (306, NULL, 'Peso', 'Pesos', 'Guatemalan peso', '1859', '1925', 89, 60, 'The peso replaced the real, with 1 peso = 8 reales. In 1869, the centavo was introduced, worth one hundredth of a peso, but the real continued to be produced until 1912, when Guatemala fully decimalize.');
INSERT INTO public.cur_currency VALUES (4, '؋', 'Afghani', 'Afghani ', 'Afghan afghani', '1925', '2002', 5, 1000, 'The original afghani was introduced in 1925, replacing the Afghan rupee that was used from 1891 and other currencies. The rate of conversion from the rupee is sometimes quoted as 1 afghani = 1 rupee 6 paisas, based on the silver contents of the last rupee coins and the first afghani coins. The afghani initially contained 9 grams of silver');
INSERT INTO public.cur_currency VALUES (46, 'Br', 'Ruble', 'Rubles', 'Belarusian ruble', '2000-01-01', '2016-12-31', 45, 10000, 'A new ruble was introduced in 2000 replacing the first at a rate of 1 BYR = 1,000 BYB. Only banknotes have been issued.');
INSERT INTO public.cur_currency VALUES (5, '؋', 'Afghani', 'Afghani ', 'Afghan afghani', '2002-10-08', NULL, NULL, NULL, 'In 2002, the afghani was redenominated. No subdivisions were issued. It replaced the previous afghani at two distinct rates: issues of the government of former President Rabbani (de jure 1992-2001) were replaced at a rate of 1,000 to the new afghani, whilst the issues of warlord Dostum (1992–1997) in northern Afghanistan were replaced at a rate of 2,000 to the new afghani. 
INSERT INTO public.cur_currency VALUES (105, '﷼', 'Rial', 'Rials', 'Iranian rial', '1932', NULL, NULL, NULL, 'The rial was re-introduced during the decimalisation in 1932, replacing the qiran at par. The rial was initially pegged to the British pound.');
INSERT INTO public.cur_currency VALUES (308, NULL, 'Qiran', 'Qiran', 'Iranian qiran', '1825', '1932', 105, 1, 'The qiran, also qerun or kran, was the currency of Iran between 1825 and 1932. It was subdivided into 20 shahi or 1000 dinar and was worth one tenth of a toman. The qiran is no longer an official denomination but the term still enjoys wide usage among Iranians.');
INSERT INTO public.cur_currency VALUES (309, NULL, 'Dollar', 'Dollars', 'Mongolian dollar', '1921', '1925', 141, NULL, 'The dollar was the currency of Mongolia between 1921 and 1925. Treasury notes were issued in 1921. It was intended to replace the Chinese yuan at par but, according to European travellers of the time, was worthless.');
INSERT INTO public.cur_currency VALUES (180, 'руб', 'Ruble', 'Rubles', 'Russian ruble', '1992', '1997-12-31', 179, 1000, 'Following the breakup of the Soviet Union in 1991, the Soviet ruble remained the currency of the Russian Federation until 1992. A new set of coins was issued in 1992 and a new set of banknotes was issued in the name of Bank of Russia in 1993. In September 1993 the Soviet ruble  was replaced with the Russian ruble at par. In 1998 preceding the financial crisis, the Russian ruble was redenominated with the new code "RUB" and was exchanged at the rate of 1,000 RUR = 1 RUB.');
INSERT INTO public.cur_currency VALUES (201, 'руб', 'Ruble', 'Rubles', 'Soviet ruble', '1961', '1993-09-01', 180, 1, 'The 1961 redenomination introduced 1 new ruble equal to 10 old rubles and restated all wages, prices and financial records into new rubles. It differed from the confiscatory nature of the 1947 reform when banknotes were reduced to 1/10th of its value but wages & prices remained the same. 
INSERT INTO public.cur_currency VALUES (276, 'руб', 'Ruble', 'Rubles', 'Soviet ruble', '1947-12-17', '1961', 201, 10, 'Following World War II, the Soviet government implemented a confiscatory redenomination of its currency (decreed on December 14th, 1947) to reduce the amount of money in circulation. The main purpose of this change was to prevent peasants, who had accumulated cash by selling food at wartime prices, from using this to buy consumer goods as the postwar recovery took hold. Old rubles were revalued at one tenth of their face value. Amounts of 3,000 rubles or less in individual bank accounts were not revalued, while salaries remained the same. Unlike other reforms, this one did not affect coins.');
INSERT INTO public.cur_currency VALUES (311, NULL, 'Ruble', 'Rubles', '(Gold) Soviet ruble', '1924-03-07', '1947-12-17', 276, 10, 'After Joseph Stalin''s consolidation of power following the death of Lenin, he launched a third redenomination in 1924 by introducing the "gold" ruble at a value of 50,000 rubles of the previous issue. Under this reform the ruble was linked to the chervonets ("red gold") which put an end to chronic inflation.');
INSERT INTO public.cur_currency VALUES (312, NULL, 'Ruble', 'Rubles', 'Soviet ruble', '1923-01-01', '1924-03-07', 311, 50000, 'A new redenomination took place in 1923, at a rate of 100 to 1. Again, only paper money was issued. During the lifetime of this currency, the first money of the Soviet Union was issued');
INSERT INTO public.cur_currency VALUES (313, NULL, 'Ruble', 'Rubles', 'Soviet ruble', '1922-01-01', '1923-01-01', 312, 100, 'In 1922, the first of several redenominations took place, at a rate of 1 "new" ruble for 10,000 "old" rubles');
INSERT INTO public.cur_currency VALUES (314, NULL, 'Cupon', 'Cupons', 'Moldovan cupon', '1992', '1993', 134, 1000, 'The cupon was the temporary currency of Moldova between 1992 and 1993. It replaced the Soviet ruble at par and was replaced by the leu at a rate of 1 leu = 1000');
INSERT INTO public.cur_currency VALUES (170, '₨', 'Rupee', 'Rupees', 'Pakistani rupee', '1948', NULL, NULL, NULL, 'The Pakistani Rupee was put into circulation in Pakistan after the dissolution of the British Raj in 1947. Initially, Pakistan used British Indian coins and notes simply over-stamped with "Pakistan". New coins and banknotes were issued in 1948. Like the Indian rupee, it was originally divided into 16 annas, each of 4 pice or 12 pie. The currency was decimalised on 1 January 1961.');
INSERT INTO public.cur_currency VALUES (113, 'C', 'Som', 'Som', 'Kyrgyzstani som', '1993-05-10', NULL, NULL, NULL, 'In the Soviet Union, speakers of Kazakh, Kyrgyz and Uzbek called the ruble the som. The word som means "pure": it implies "pure gold".
INSERT INTO public.cur_currency VALUES (20, NULL, 'Manat', 'Manat', 'Azerbaijani manat', '1992-08-15', '2006-12-31', 21, 5000, 'The word manat is derived from the Latin word "Moneta".
INSERT INTO public.cur_currency VALUES (21, '₼', 'Manat', 'Manat', 'Azerbaijani manat', '2006-01-01', NULL, NULL, NULL, 'On 1 January 2006, a new manat was introduced at a ratio of 1 new manat to 5,000 old manat. The former manat remained valid through 31 December 2006.');
INSERT INTO public.cur_currency VALUES (316, NULL, 'Ruble', 'Rubles', '(Second) Transcaucasian ruble', '1923', '1924', NULL, NULL, 'In 1923 and 1924, the Transcaucasian Soviet Federal Socialist Republic (part of the USSR) issued its own notes. In 1924 the Soviet ruble replaced it as the official currency of the Transcaucasian SFSR (and the three Soviet Socialist Republics that succeeded the Transcaucasian SFSR)');
INSERT INTO public.cur_currency VALUES (317, NULL, 'Ruble', 'Rubles', '(First) Transcaucasian ruble', '1918', '1918', NULL, NULL, 'In 1918, the Comissariat of the short-lived Transcaucasian Democratic Federative Republic issued paper money denominated in rubles.
INSERT INTO public.cur_currency VALUES (315, NULL, 'Ruble', 'Rubles', 'Armenian ruble', '1919', '1923', 316, 1, 'The ruble was the currency of the First Republic of Armenia and the Armenian Soviet Socialist Republic between 1919 and 1923. It replaced the first Transcaucasian ruble at par and was replaced by the second Transcaucasian ruble after Armenia became part of the Transcaucasian Soviet Federal Socialist Republic.');
INSERT INTO public.cur_currency VALUES (7, '֏', 'Dram', 'Dram', 'Armenian dram', '1993-11-22', NULL, NULL, NULL, 'The word "dram" translates into English as "money" and is cognate with the Greek drachma and the Arabic dirham.
INSERT INTO public.cur_currency VALUES (81, 'GH₵', 'Cedi', 'Cedis', 'Ghanaian new cedi', '1967', '2007-07-01', 82, 10000, 'The first cedi was replaced in 1967 by a "new cedi" which was worth 1.2 first cedis. This allowed a decimal conversion with the pound, namely 2 second cedis = 1 pound');
INSERT INTO public.cur_currency VALUES (226, 'сум', 'Soʻm', 'Soʻm', 'Uzbekistani soʻm', '1993-11-15', '1994-07-01', 310, 1000, 'In the Soviet Union, speakers of Kazakh, Kyrgyz and Uzbek called the ruble the som, and this name appeared written on the back of banknotes, among the texts for the value of the bill in all 15 official languages of the Union. The word "so''m" means "pure" in Kyrgyz, Uyghur and Uzbek. It implies "pure gold".
INSERT INTO public.cur_currency VALUES (318, NULL, 'Manat', 'Manat', 'Azerbaijani manat', '1919', '1923', 316, NULL, 'The Azerbaijan Democratic Republic and its successor the Azerbaijani Soviet Socialist Republic issued their own currency between 1919 and 1923. The currency was called the manat (منات) in Azerbaijani and the ruble (рубль) in Russian, with the denominations written in both languages (and sometimes also in French) on the banknotes.
INSERT INTO public.cur_currency VALUES (319, NULL, 'Maneti', 'Maneti', 'Georgian maneti', '1919', '1923', 316, NULL, 'The maneti  was the currency of the Democratic Republic of Georgia and the Georgian Soviet Socialist Republic between 1919 and 1923. It replaced the first Transcaucasian ruble at par. It was replaced by the second Transcaucasian ruble after Georgia became part of the Transcaucasian Soviet Federal Socialist Republic.');
INSERT INTO public.cur_currency VALUES (80, '₾', 'Lari', 'Lari', 'Georgian lari', '1995-10-02', NULL, NULL, NULL, 'The name lari is an old Georgian word denoting a hoard. It replaced the provisional coupon currency.');
INSERT INTO public.cur_currency VALUES (247, 'K', 'Kwacha', 'Kwacha', 'Zambian kwacha', '1968-01-16', '2013-06-01', 248, 1000, 'The name kwacha derives from the Nyanja, Bemba, and Tonga language word for "dawn", alluding to the Zambian nationalist slogan of a "new dawn of freedom".
INSERT INTO public.cur_currency VALUES (248, 'K', 'Kwacha', 'Kwacha', 'Zambian kwacha', '2013-01-01', NULL, NULL, NULL, 'The Bank of Zambia introduced on January 1, 2013 the new redenominated currency which became the legal tender of Zambia. The old and new currencies were allowed to circulate side-by-side for a transition period of six months, until 30 June 2013. During this period, the old currency was denoted by ''K'', whilst the new one was denoted by ''KR''. After the six-month period, the ''KR'' symbol was dropped, and the new currency was referred to by the ''K'' symbol.');
INSERT INTO public.cur_currency VALUES (321, '£', 'Pound', 'Pounds', 'Zambian pound', '1964', '1968-01-15', 247, 0.5, 'The Zambian pound was the currency in Zambia from independence in 1964 until decimalization on January 16, 1968. It replaced  Rhodesia and Nyasaland pound at par.');
INSERT INTO public.cur_currency VALUES (48, '$', 'Dollar', 'Dollars', 'Canadian dollar', '1867', NULL, NULL, NULL, 'In 1857, it was decided to introduce a decimal coinage into the Province of Canada in conjunction with the U.S. dollar unit. Hence, when the new decimal coins were introduced in 1858, the colony''s currency became aligned with the U.S. currency, although the British gold sovereign continued to remain legal tender at the rate of £1 = ​4.86 2⁄3 right up until the 1990s.
INSERT INTO public.cur_currency VALUES (322, NULL, 'Peso', 'Pesos', 'Honduran peso', '1862', '1931', 93, 1, 'The peso replaced the real at a rate of 1 peso = 8 reales. Initially, the peso was subdivided into 8 reales. In 1871, the currency was decimalized, with the peso subdivided into 100 centavos. The peso was replaced in 1931 by the lempira at par.');
INSERT INTO public.cur_currency VALUES (93, 'L', 'Lempira', 'Lempiras', 'Honduran lempira', '1931', NULL, NULL, NULL, 'The lempira was named after the 16th-century cacique Lempira, a ruler of the indigenous Lenca people, who is renowned in Honduran folklore for leading the (ultimately unsuccessful) local native resistance against the Spanish forces.
INSERT INTO public.cur_currency VALUES (323, '₩', 'Won', 'Won', 'North Korean won', '1959', '2009-11-30', 324, 100, 'Won is a cognate of the Chinese yuan and Japanese yen. All three names derive from a Hanja word which means "round shape".
INSERT INTO public.cur_currency VALUES (324, '₩', 'Won', 'Won', 'North Korean won', '2009-12-07', NULL, NULL, NULL, 'Won is a cognate of the Chinese yuan and Japanese yen. All three names derive from a Hanja word which means "round shape".
INSERT INTO public.cur_currency VALUES (16, '$', 'Peso', 'Pesos', 'Argentine peso', '1992-01-01', NULL, NULL, NULL, 'The peso  replaced the austral at a rate of 1 peso = 10,000 australes. It was also referred to as peso convertible since the international exchange rate was fixed by the Central Bank at 1 peso to 1 U.S. dollar and for every peso convertible circulating, there was a US dollar in the Central Bank''s foreign currency reserves.');
INSERT INTO public.cur_currency VALUES (215, 'TT$', 'Dollar', 'Dollars', 'Trinidad and Tobago dollar', '1964', NULL, NULL, NULL, 'In 1964, Trinidad and Tobago introduced its own dollar, 2 years after its independency.');
INSERT INTO public.cur_currency VALUES (14, '$L', 'Peso', 'Pesos', 'Argentine peso ley', '1970-01-01', '1983-05-05', 15, 10000, 'The peso ley replaced the peso moneda nacional at a rate of 100 to 1.
INSERT INTO public.cur_currency VALUES (325, '$m/n', 'Peso', 'Pesos', 'Argentine peso moneda nacional', '1881-11-05', '1970-01-01', 14, 100, 'The peso moneda nacional replaced the Argentine real at a rate of one to eight. It also replaced the peso fuerte at par and the peso moneda corriente at a rate of 25 pesos moneda corriente = 1 peso moneda nacional. ');
INSERT INTO public.cur_currency VALUES (208, 'T', 'Manat', 'Manat', 'Turkmenistan manat', '1993-11-01', '2008-12-31', 209, 5000, 'The manat was introduced on 1 November 1993, replacing the Russian ruble at a rate of 1 manat = 500 rubles.
INSERT INTO public.cur_currency VALUES (15, '$a', 'Peso argentino', 'Pesos Argentinos', 'Argentine peso', '1983-06-06', '1985-06-14', 13, 1000, 'The peso argentino replaced the peso ley at a rate of 1 peso argentino = 10,000 pesos ley');
INSERT INTO public.cur_currency VALUES (117, '₩', 'Won', 'Won', 'South Korean won', '1962', NULL, NULL, NULL, 'Won is a cognate of the Chinese yuan and Japanese yen. All three names derive from a Hanja word which means "round shape".');
INSERT INTO public.cur_currency VALUES (320, ' ', 'Kuponi', 'Kuponi', 'Georgian Kuponi', '1993-04-05', '1995-10-01', 80, 1e+06, 'Georgia replaced the Russian ruble on 5 April 1993, with the provisionaö Kuponi at par. This currency consisted only of banknotes, had no subdivisions and suffered from hyperinflation.');
INSERT INTO public.cur_currency VALUES (326, '$', 'Real', 'Reales', 'Argentine real', '1813', '1881', 325, 8, 'In 1813 Argentina began issuing its own coins. From 1820, paper money was also issued. From 1822, it was subdivided into 10 décimos. The sol was also issued during this period and was equal to the real, whilst the peso was worth 8 reales and the escudo was worth 16 reales.
INSERT INTO public.cur_currency VALUES (129, 'Ls', 'Lats', 'Lats', 'Latvian lats', '1993-03-05', '2014-01-14', 74, 0.702804, 'The lats was reintroduced on 5 March 1993, replacing the Latvian rublis, which continued to circulate and kept validity until and including 30 June 1994 at a rate of 200 rubļu to 1 lats. The lats was replaced on 1 January 2014 by the Euro.
INSERT INTO public.cur_currency VALUES (327, 'Lvr', 'Rublis', 'Rublis', 'Latvian rublis', '1992-05-07', '1993-10-18', 129, 200, 'From 7 May 1992, a temporary currency, the Latvian rublis (LVR), was put into circulation as a legal tender parallel to the existing ruble notes. It was declared equal in value to the Soviet ruble. The Latvian rublis notes were widely known as repšiki, after the then governor of the Central Bank, Einars Repše.
INSERT INTO public.cur_currency VALUES (328, NULL, 'Rublis', 'Rublis', 'Latvian rublis', '1919-02-04', '1922', 329, 50, 'After the proclamation of the Republic of Latvia in 1918, a great variety of different currencies were in circulation: ostrubles, ostmarks, German Papiermark, the so-called Tsar rubles, kopecks, the so-called Duma Money and kerenkas, as well as promissory notes issued by several town municipalities.
INSERT INTO public.cur_currency VALUES (127, 'Lt', 'Litas', 'Litas', 'Lithuanian litas', '1993-06-25', '2015-01-01', 74, 3.4528, 'The litas was first introduced after World War I, when Lithuania declared independence. It was reintroduced on 25 June 1993, following a period of currency exchange from the ruble to the litas with the temporary talonas also in place. The name was modeled after the name of the country (similar to Latvia and its lats).
INSERT INTO public.cur_currency VALUES (330, NULL, 'Talonas', 'Talonas', 'Lithuanian talonas', '1991-08-05', '1993-06-25', 127, 100, 'The talonas was a temporary currency issued in Lithuania between 1991 and 1993. It replaced the Soviet ruble at par and was replaced by the litas at a rate of 100 talonas = 1 litas. The talonas was only issued as paper money.');
INSERT INTO public.cur_currency VALUES (329, NULL, 'Lats', 'Lats', 'Latvian lats', '1922-08-03', '1940', NULL, NULL, 'The lats was first introduced on 3 August 1922, replacing the Latvian rublis at a rate of 1 lats = 50 rubļi. The lats was pegged against the gold standard from its introduction till 1940.
INSERT INTO public.cur_currency VALUES (331, NULL, 'Litas', 'Litas', 'Lithuanian litas', '1922-10-02', '1941', NULL, NULL, 'The first litas was introduced on 2 October 1922, replacing the ostmark and ostruble, both of which had been issued by the occupying German forces during World War I.
INSERT INTO public.cur_currency VALUES (69, 'kr', 'Kroon', 'Krooni', 'Estonian kroon', '1992-06-20', '2011-01-15', 74, 15.64664, 'The kroon was reintroduced as Estonia''s currency on 20 June 1992, replacing the Soviet ruble at a rate of 1 kroon = 10 rubles. Each person was able to change a maximum of 1500 rubles to 150 krooni.
INSERT INTO public.cur_currency VALUES (334, NULL, 'Kroon', 'Krooni', 'Estonian kroon', '1928-09-01', '1940', NULL, NULL, 'The kroon became the currency of Estonia on 1 September 1928 after having been a unit of account since 1924. It replaced the mark at a rate of 100 mark = 1 kroon. It  circulated until the Soviet occupation of 1940. The kroon was exchanged for the Soviet ruble at a rate of 1 ruble = 0.8 kroon.');
INSERT INTO public.cur_currency VALUES (335, NULL, 'Mark', 'Marka', 'Estonian mark', '1918', '1928', 334, 100, 'The Estonian mark was the currency of Estonia between 1918 and 1927. Until 1919 there were also Russian rubles, German ostrubles and Finnish marks in circulation.
INSERT INTO public.cur_currency VALUES (336, 'BWI$', 'BWI Dollar', 'Dollars', 'British West Indies dollar', '1949', '1965', 235, 1, 'The British West Indies dollar (BWI$) was the currency of British Guiana and the Eastern Caribbean territories of the British West Indies from 1949 to 1965, when it was largely replaced by the East Caribbean dollar and the Trinidad and Tobago dollar. It was also one of the currencies used in Jamaica from 1954 to 1964.');
INSERT INTO public.cur_currency VALUES (337, NULL, 'Karbovanets', 'Karbovanets', 'Ukrainian karbovanets', '1942', '1945', NULL, NULL, 'During the Nazi occupation of Ukraine in World War II, the German occupying government issued banknotes denominated in karbovanets. The karbovanets replaced the Soviet ruble at par and was in circulation between 1942 and 1945. It was pegged to the Reichsmark at a rate of 10 karbovantsiv = 1 Reichsmark.');
INSERT INTO public.cur_currency VALUES (338, NULL, 'Karbovanets', 'Karbovanets', 'Ukrainian karbovanets', '1918', '1919', NULL, NULL, 'After the Ukrainian People''s Republic was proclaimed on 20 November 1917, a temporary law about the issue of state banknotes by the UPR was adopted. According to this law: "Bank-notes must be issued in karbovanets". Each karbovanets contains 17.424 parts of pure gold and is divided into two hrivnas or 200 shahs.');
INSERT INTO public.cur_currency VALUES (218, '₴', 'Hryvnia', 'Hryven', 'Ukrainian hryvnia', '1996-09-02', NULL, NULL, NULL, 'The hryvnia, hryvna, or sometimes hryvnya  has been the national currency of Ukraine since 2 September 1996. The hryvnia is subdivided into 100 kopiyok. It is named after a measure of weight used in medieval Kievan Rus.');
INSERT INTO public.cur_currency VALUES (219, NULL, 'Karbovanets', 'Karbovantsiv', 'Ukrainian karbovanets', '1992-01-10', '1996-09-16', 218, 100000, 'On 10 January 1992,[citation needed] the karbovanets replaced rubles at par. The karbovanets, which suffered from hyperinflation, was replaced by the hryvnia in 1996, at a rate of 100,000 karbovantsiv = 1 hryvnia. A 15-day period was in effect from September, 2nd till September, 16th in 1996, during which both the karbovanets and hryvnia were in circulation. After that, the use of the karbovanets as a national currency was discontinued');
INSERT INTO public.cur_currency VALUES (53, '$', 'Peso', 'Pesos', 'Colombian peso', '1810', NULL, NULL, NULL, 'The peso has been the currency of Colombia since 1810. It replaced the real at a rate of 1 peso = 8 reales and was initially subdivided into 8 reales. In 1847, Colombia decimalized and the peso was subdivided into ten reales, each of 10 décimos de reales, later centavos. The real was renamed the decimo in 1853, although the last reales were struck in 1880.');
INSERT INTO public.cur_currency VALUES (51, '$', 'Peso', 'Pesos', 'Chilean peso', '1975-09-29', NULL, NULL, NULL, 'The current peso was introduced on 29 September 1975 by decree 1,123, replacing the escudo at a rate of 1 peso for 1,000 escudos. This peso was subdivided into 100 centavos until 1984.');
INSERT INTO public.cur_currency VALUES (341, NULL, 'Peso', 'Pesos', 'Chilean peso', '1817', '1960-01-01', 340, 1000, 'The first Chilean peso was introduced in 1817, at a value of 8 Spanish colonial reales. Until 1851, the peso was subdivided into 8 reales, with the escudo worth 2 pesos. It was not until 1851 that the real and escudo denominations ceased to be issued and further issues in centavos and décimos (worth 10 centavos) commenced.  From 1925, coins and banknotes were issued denominated in cóndores, worth 10 pesos. The gold standard was suspended in 1932 and the peso''s value fell further. The escudo replaced the peso on 1 January 1960 at a rate 1 escudo = 1000 pesos.');
INSERT INTO public.cur_currency VALUES (340, 'Eº', 'Escudo', 'Escudos', 'Chilean escudo', '1960-01-01', '1975-09-29', 51, 1000, 'The escudo was the currency of Chile between 1960 and 1975, divided into 100 centésimos. It replaced the old peso at a rate of 1 escudo = 1000 pesos and was itself replaced by a new peso, at a rate of 1 peso = 1000 escudos.');
INSERT INTO public.cur_currency VALUES (342, NULL, 'Peso', 'Pesos', 'Costa Rican peso', '1850', '1896', 54, 1, 'The peso was the currency of Costa Rica between 1850 and 1896. It was initially subdivided into 8 reales and circulated alongside the earlier currency, the real, until 1864, when Costa Rica decimalized and the peso was subdivided into 100 centavos. The peso was replaced by the colón at par in 1896.');
INSERT INTO public.cur_currency VALUES (91, '$', 'Dollar', 'Dollars', 'Guyanese dollar', '1839', NULL, NULL, NULL, 'The Guyanese dollar has been the unit of account in Guyana (formerly British Guiana) since 29 January 1839. Originally it was intended as a transitional unit to facilitate the changeover from the Dutch guilder system of currency to the British pound sterling system. From 1839, the Spanish dollar unit operated in British Guiana in conjunction with British sterling coins at a standard conversion rate of one dollar for every four shillings and twopence. In 1951 the British sterling coinage was replaced with a new decimal coinage which was simultaneously introduced through all the British territories in the Eastern Caribbean. When sterling began to depreciate in the early 1970s, a switch to a US dollar peg became increasingly attractive as an anti-inflationary measure and the Eastern Caribbean Currency Authority (of which Guyana was a member) made the switch in October 1975.');
INSERT INTO public.cur_currency VALUES (82, 'GH₵', 'Cedi', 'Cedis', 'Ghanaian cedi', '2007', NULL, NULL, NULL, 'Because of the rampant inflation in the decades before the exchange the second cedi was only worth a small fraction of its original value. The government decided to "cut" four zeros off the currency by the switch to the third cedi. The new currency was not introduced as the third cedi but is instead officially called the Ghanaian Cedi, in contrast to the second cedi that was officially known as the New Cedi. In the second half of 2007 both the second and third cedi were legal tender as the old currency was being gradually withdrawn.  From January 2008 old banknotes could only be exchanged at banks and were no longer legal tender');
INSERT INTO public.cur_currency VALUES (343, '$F', 'Peso fuerte', 'Pesos fuertes', 'Uruguayan peso fuerte', '1856', '1863-01-01', 224, NULL, 'In 1856 the Onza de oro was revalued from 16,000 centésimos to 15,360, and the patacón to 960 centésimos to reflect new monetary legislation. The same standard of weight and fineness was retained, but the denomination was changed to peso fuerte:
INSERT INTO public.cur_currency VALUES (344, NULL, 'Peso', 'Pesos', 'Paraguayan peso', '1856', '1944', 174, 100, 'The peso was the currency of Paraguay between 1856 and 1944. It replaced the real at a rate of 8 reales = 1 peso. Until 1870, the peso was subdivided into 8 reales. Paraguay then decimalized, with 100 centésimos = 1 peso. The name of the subdivision was changed to centavo in 1874.');
INSERT INTO public.cur_currency VALUES (174, '₲', 'Guaraní', 'Guaranies', 'Paraguayan guaraní', '1944', NULL, NULL, NULL, 'The law creating the guaraní was passed on 5 October 1943, and replaced the peso at a rate of 1 guaraní = 100 pesos. Guaraníes were first issued in 1944');
INSERT INTO public.cur_currency VALUES (109, '$', 'Dollar', 'Dollars', 'Jamaican dollar', '1969-09-08', NULL, NULL, NULL, 'On January 30, 1968, the Jamaican House of Representatives voted to decimalize the currency by introducing the dollar, worth 10 shillings, to replace the Jamaican pound. Coins and banknotes went into circulation on September 8, 1969.');
INSERT INTO public.cur_currency VALUES (217, 'TSh', 'Shilling', 'Shilling', 'Tanzanian shilling', '1966-06-14', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (228, 'Bs.', 'Bolívar', 'Bolivares', 'Venezuelan bolívar', '1879-03-31', '2008-01-01', 229, 1000, 'The Bolívar is named after the hero of Latin American independence Simón Bolívar. The bolívar was adopted by the monetary law of 1879, replacing the short-lived venezolano at a rate of five bolívares to one venezolano. Initially, the bolívar was defined on the silver standard, equal to 4.5 g fine silver, following the principles of the Latin Monetary Union. The monetary law of 1887 made the gold bolívar unlimited legal tender, and the gold standard came into full operation in 1910. Venezuela went off gold in 1930.
INSERT INTO public.cur_currency VALUES (229, 'Bs.F', 'Bolívar fuerte', 'Bolivares', 'Venezuelan bolívar fuerte', '2008-01-01', '2018-08-20', 230, 100000, 'The government announced on 7 March 2007 that the bolívar would be revalued at a ratio of 1,000 to 1 on 1 January 2008 and renamed the bolívar fuerte in an effort to facilitate the ease of transaction and accounting.');
INSERT INTO public.cur_currency VALUES (346, NULL, 'Venezolano', 'Venezolanos', 'Venezuelan venezolano', '1872-01-01', '1879-03-31', 228, 0.2, 'The venezolano was the currency of Venezuela between 1872 and 1879. The new venezolano coins were introduced into circulation in June 1874.
INSERT INTO public.cur_currency VALUES (347, NULL, 'Peso', 'Pesos', 'Venezuelan peso', '1811-08-27', '1874-06-18', 346, 1, 'On 27 August 1811, with the United States of Venezuela (Estados Unidos de Venezuela) having declared their independence, the recently established Supreme Congress of Venezuela (Congreso Supremo de Venezuela) establishes the peso with an equivalence of 8 reales to 1 peso');
INSERT INTO public.cur_currency VALUES (433, NULL, 'East African shilling', 'East African shilling', 'East African shilling', '1921', '1969', NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (114, '៛', 'Riel', 'Riels', 'Cambodian riel', '1980-04-01', NULL, NULL, NULL, 'After the Vietnamese invasion in 1978, the riel was re-established as Cambodia''s national currency on April 1, 1980, initially at a value of 4 riels = 1 U.S. dollar.  Because there was no money for it to replace and a severely disrupted economy, the central government gave away the new money to the populace in order to encourage its use.');
INSERT INTO public.cur_currency VALUES (176, 'L', 'Leu', 'Lei', 'Romanian leu', '1952-01-28', '2006-12-31', 177, 10000, 'On 28 January 1952, another new leu was introduced. Unlike the previous revaluation, different rates were employed for different kinds of exchange (cash, bank deposits, debts etc.) and different amounts. These rates ranged from 20 to 400 "old lei" for one "new" leu. Again, no advance warning was given before the reform took place.');
INSERT INTO public.cur_currency VALUES (177, 'L', 'Leu', 'Lei', 'Romanian leu', '2005-07-01', NULL, NULL, NULL, 'On 1 July 2005, the leu was revalued at the rate of 10,000 "old" lei or one "new" leu. The term chosen for the action was "denominare", similar to the English "denomination".  The old ROL currency banknotes remained in circulation until 31 December 2006 (coins remained in circulation only until 31 December 2005).');
INSERT INTO public.cur_currency VALUES (348, 'L', 'Leu', 'Lei', 'Romanian leu', '1947-08-15', '1952-01-28', 176, 400, 'A revaluation ("Great stabilization", marea stabilizare) took place on 15 August 1947, replacing the old leu at a rate of 20,000 old lei = 1 new leu. No advance warning was given and there were limits for the sums to be converted in the new currency: 5 million old lei for farmers and 3 million old lei for workers and pensioners.');
INSERT INTO public.cur_currency VALUES (349, 'L', 'Leu', 'Lei', 'Romanian leu', '1870', '1947-08-15', 348, 20000, 'The name of the currency means "lion", and is derived from the Dutch thaler (leeuwendaalder "lion thaler/dollar")');
INSERT INTO public.cur_currency VALUES (135, 'Ar', 'Ariary', 'Ariary', 'Malagasy ariary', '2005-01-01', NULL, NULL, NULL, 'The name ariary derives from the pre-colonial currency, with ariary (from the Spanish word "real") being the name for a silver dollar.
INSERT INTO public.cur_currency VALUES (136, 'MF', 'Franc', 'Francs', 'Malagasy franc', '1961', '2005-01-01', 135, 5, 'The ariary was introduced in 1961. It was equal to 5 Malagasy francs. Coins and banknotes were issued denominated in both francs and ariary. Officially the CFA franc was replaced by the Malagasy franc on July 1, 1963.');
INSERT INTO public.cur_currency VALUES (90, NULL, 'Peso', 'Pesos', 'Guinea-Bissau peso', '1975', '1997-05-31', 236, 65, 'The peso was the currency of Guinea-Bissau from 1975 to 1997. It replaced the escudo at par. In 1997, in an effort to stop high inflation, Guinea-Bissau adopted the CFA franc, using a conversion rate of 65 pesos to the franc.');
INSERT INTO public.cur_currency VALUES (221, 'USh', 'Shilling', 'Shilling', 'Ugandan shilling', '1987', NULL, NULL, NULL, 'Due to inflation a new shilling was introduced in 1987 worth 100 old shillings.');
INSERT INTO public.cur_currency VALUES (350, 'Sh.', 'Shilling', 'Shilling', 'Somaliland shilling', '1994-10-18', NULL, NULL, NULL, 'The Somaliland shilling was introduced on 18 October 1994 at a rate of one new Somaliland shilling to 100 Somali shillings.
INSERT INTO public.cur_currency VALUES (73, 'ብር', 'Birr', 'Birr', 'Ethiopian birr', '1893-02-09', NULL, NULL, NULL, 'In the 18th and 19th centuries, Maria Theresa thalers served as currency in Ethiopia. The thaler was known locally as the Birr (literally meaning "silver"). The talari (thaler, dollar, birr) became the standard unit on 9 February 1893. The Bank of Abyssinia was established in 1905 by Emperor Menelik; the bank was officially inaugurated by Menelik on 15 February 1906. Bank of Abyssinia put banknotes into circulation in 1915. These notes were denominated birr in Amharic and thaler in English.
INSERT INTO public.cur_currency VALUES (186, '£SD', 'Pound', 'Pounds', 'Sudanese pound', '2007-01-10', NULL, NULL, NULL, 'The pound was re-introduced as part of the  Comprehensive Peace Agreement between the government of the Republic of the Sudan and the Sudan People''s Liberation Movement (South Sudan).
INSERT INTO public.cur_currency VALUES (187, '£SD', 'Pound', 'Pounds', 'Sudanese pound', '1956-0-01', '1992-06-08', 185, 10, 'When Anglo-Egyptian rule in Sudan ceased on January 1, 1956 and Sudan became an independent country, a distinct Sudanese currency (the Sudanese pound) was created, replacing the Egyptian pound at par.');
INSERT INTO public.cur_currency VALUES (57, '$', 'Convertible Peso', 'Convertible Pesos', 'Cuban convertible peso', '1994', '2021', NULL, NULL, 'The convertible peso (sometimes given as CUC$ and informally called a "chavito") is one of two official currencies in Cuba, the other being the Cuban peso. It has been in limited use since 1994, when its value was pegged 1:1 to the United States dollar. On 10 December 2020, it was announced that CUCs will start to be withdrawn from circulation from 1 January 2021.');
INSERT INTO public.cur_currency VALUES (58, '$', 'Peso', 'Pesos', 'Cuban peso', '1902', NULL, NULL, NULL, 'The "peso" was introduced during the Spanish colonial era, in 1857, specifically for use in Cuba. each peso worth 8 reales. From 1869, decimal notes were also issued denominated in centavos, with 100 centavos for each peso. In 1881, the peso was pegged to the US dollar at par. The currency continued to be issued only in paper form until 1915, when the first coins were issued.
INSERT INTO public.cur_currency VALUES (351, NULL, 'Peso', 'Pesos', 'Ecuadorian peso', '1871', '1884-03-22', 68, 1, 'Peso was the name of the 8 real coins circulating in Ecuador since the Spanish colonial period. The peso was formally adopted as the currency of Ecuador in 1871, replacing the real at a rate of 1 peso = 8 reales.');
INSERT INTO public.cur_currency VALUES (434, NULL, 'Saidi rial', 'Saidi rials', 'Omani Saidi rial', '1970-05-07', '1972-11-11', 163, 1, NULL);
INSERT INTO public.cur_currency VALUES (112, 'KSh', 'Shilling', 'Shilling', 'Kenyan shilling', '1966-09-14', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (435, NULL, 'Shilling', 'Shillings', 'East African shilling', '1921', '1969', NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (116, '₩', 'Won', 'Won', 'North Korean won', '1947-12-06', '1959', 323, 100, 'Won is a cognate of the Chinese yuan and Japanese yen. All three names derive from a Hanja word which means "round shape".
INSERT INTO public.cur_currency VALUES (68, 'S/.', 'Sucre', 'Sucres', 'Ecuadorian sucre', '1884-03-22', '2000-02-29', NULL, NULL, 'The Ecuadorian peso was renamed as the Sucre on March 22, 1884, and was then linked to the silver standard. The sucre was named after Latin American political leader Antonio José de Sucre. The currency was replaced by the United States dollar as a result of the 1998–99 financial crisis.');
INSERT INTO public.cur_currency VALUES (35, 'Cr$', 'Cruzeiro', 'Cruzeiros', 'Brazilian cruzeiro', '1967', '1986-02-28', 36, 1000, 'In 1967, Brazil introduced the cruzeiro novo (the word "novo", "new" in Portuguese, only appearing on the provisional issue of banknotes), with 1 cruzeiro novo equal to 1000 "old" cruzeiros.');
INSERT INTO public.cur_currency VALUES (36, 'Cz$', 'Cruzado', 'Cruzados', 'Brazilian cruzado', '1986-02-28', '1989-01-15', 39, 1000, 'The name cruzado was inspired by the name of an old Portuguese silver coin, which had value of 400/480 réis and that circulated in the time in which Brazil was still a colony of Portugal.
INSERT INTO public.cur_currency VALUES (37, 'Cr$', 'Cruzeiro', 'Cruzeiros', 'Brazilian cruzeiro', '1990-03-15', '1993-08-01', 40, 1000, 'In 1990, Brazil switched back to using the name cruzeiro for its currency. The cruzeiro replaced the cruzado novo at par.');
INSERT INTO public.cur_currency VALUES (38, 'R$', 'Real', 'Reais', 'Brazilian real', '1994-07-01', NULL, NULL, NULL, 'The modern real was introduced on 1 July 1994, as part of a broader plan to stabilize the Brazilian economy. The new currency replaced the short-lived cruzeiro real. ');
INSERT INTO public.cur_currency VALUES (39, 'NCz$', 'Cruzado Novo', 'Cruzados Novos', 'Brazilian cruzado novo', '1989-01-15', '1990-03-15', 37, 1, 'The Cruzado Novo was the short-lived currency of Brazil between 15 January 1989 and 15 March 1990. It replaced the cruzado in the rate of 1000 cruzados = 1 cruzado novo');
INSERT INTO public.cur_currency VALUES (40, 'CR$', 'Cruzeiro Real', 'Cruzeiros reais', 'Brazilian cruzeiro real', '1993-08-01', '1994-06-30', 38, 2750, 'The short-lived cruzeiro real replaced the third cruzeiro, with 1000 cruzeiros = 1 cruzeiro real.');
INSERT INTO public.cur_currency VALUES (353, 'Cr$', 'Cruzeiro', 'Cruzeiros', 'Brazilian cruzeiro', '1942', '1967', 35, 1000, 'The name refers to the constellation of the Southern Cross, known in Brazil as Cruzeiro do Sul, or simply Cruzeiro.
INSERT INTO public.cur_currency VALUES (354, 'Rs$', 'Real', 'Reais', 'Brazilian real', '1822', '1942', 353, 1000, 'The Portuguese real was the currency used by the first Portuguese settlers to arrive in the Americas, and the name real was retained when Brazil became independent in 1822.');
INSERT INTO public.cur_currency VALUES (355, 'Bs', 'Boliviano', 'Bolivianos', 'Bolivian boliviano', '1864', '1963-01-01', 34, 1000, 'The first boliviano was introduced in 1864. It was equivalent to eight soles or half a scudo in the former currency. The name bolivar was used for an amount of ten bolivianos.
INSERT INTO public.cur_currency VALUES (75, 'Mk', 'Markka', 'Markkaa', 'Finnish markka', '1860', '2002-02-28', 74, 5.94573, NULL);
INSERT INTO public.cur_currency VALUES (87, NULL, 'Ekwele', 'Bipkwele', 'Equatorial Guinean ekwele', '1975', '1985-12-31', 234, 4, NULL);
INSERT INTO public.cur_currency VALUES (96, 'G', 'Gourde', 'Gourdes', 'Haitian gourde', '1813', '1870', 358, 10, 'The word "gourde" is a French cognate for the Spanish term "gordo", from the "pesos gordos" (also known in English as "hard" pieces of eight) in which colonial-era contracts within the Spanish sphere of influence were often denominated.
INSERT INTO public.cur_currency VALUES (358, 'G', 'Gourde', 'Gourdes', 'Haitian gourde', '1870', '1872', 359, 300, 'In 1870 the gourde was revalued at a rate of ten to one. Only banknotes were issued for this second gourde.');
INSERT INTO public.cur_currency VALUES (359, 'G', 'Gourde', 'Gourdes', 'Haitian gourde', '1872', NULL, NULL, NULL, 'In 1872, the gourde was again revalued, this time at a rate of three hundred to one. In the early years of this third gourde, only banknotes were being issued and the name piastre was sometimes used instead of gourde.');
INSERT INTO public.cur_currency VALUES (41, '$', 'Dollar', 'Dollars', 'Bahamian dollar', '1966', NULL, NULL, NULL, 'The dollar replaced the pound at a rate of 1 dollar = 7 shillings in 1966, 7 years before independence. This rate allowed the establishment of parity with the US dollar, due to the sterling/dollar rate then being fixed at £1 = $2.80. To aid in decimalisation, three-dollar bills and fifteen-cent coins were created, as three dollars was roughly equivalent to one pound, and fifteen cents to a shilling, at the time of transition.');
INSERT INTO public.cur_currency VALUES (47, '$', 'Dollar', 'Dollars', 'Belize dollar', '1885', NULL, NULL, NULL, 'In the middle of the nineteenth century British Honduras operated the British sterling monetary system just like Jamaica and Bermuda. In the wake of the international silver crisis of 1873 the silver peso of neighbouring Guatemala drove the British currency out of circulation. In an attempt to return British Honduras to the gold standard, and influenced by the fact that most imports were coming from New Orleans in the United States, a new currency was introduced into British Honduras based on the US dollar, bringing British Honduras into line with Canada.
INSERT INTO public.cur_currency VALUES (360, NULL, 'Rupee', 'Rupees', 'Japanese government rupee ', '1942', '1945', NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (361, NULL, 'Riel', 'Riels', 'Cambodian riel', '1953', '1975', NULL, NULL, 'In 1953, the Cambodia branch of the Institut d''Émission des États du Cambodge, du Laos et du Vietnam issued notes dual denominated in piastre and riel with the riel being at par with the piastre.
INSERT INTO public.cur_currency VALUES (52, '¥', 'Yuan', 'Yuan', 'Renminbi', '1955-03-01', NULL, NULL, NULL, 'In 1955 the second renminbi was introduced as a revaluation at the rate of 1 new yuan = 10,000 old yuan. For the first time also coins were issued.');
INSERT INTO public.cur_currency VALUES (362, '¥', 'Yuan', 'Yuan', 'Renminbi', '1948-12', '1955-03-01', 52, 10000, 'Renminbi is the name of the currency while yuan is the name of the primary unit of renminbi. This is analogous to the difference between "sterling" and "pound" when discussing the official currency of the United Kingdom, the pound sterling.
INSERT INTO public.cur_currency VALUES (216, 'NT$', 'New Dollar', 'New dollars', 'New Taiwan dollar', '1949-06-15', NULL, NULL, NULL, 'The New Taiwan dollar was first issued by the Bank of Taiwan on 15 June 1949, to replace the Old Taiwan dollar at a ratio of 40,000 to one. The first goal of the New Taiwan dollar was to end the hyperinflation that had plagued Nationalist China due to the Chinese Civil War.
INSERT INTO public.cur_currency VALUES (34, 'b$.', 'Peso Boliviano', 'Pesos Bolivianos', 'Bolivian peso', '1963-01-01', '1987-01-01', 33, 1e+06, 'The currency reform of January 1, 1963 adopted the peso boliviano, equal to 1,000 bolivianos');
INSERT INTO public.cur_currency VALUES (363, NULL, 'Gold yuan', 'Gold yuan', 'Chinese gold yuan', '1948-08', '1948-12', 362, 100000, 'After the defeat of Japan in World War II, and the return of the Kuomintang Central Government, a further reform was instituted in August 1948 in response to hyperinflation. The Gold Yuan Certificate replaced the Fabi at the rate of 1 gold yuan = 3 million yuan fabi (=US$0.25). The gold yuan was nominally set at 0.22217 g of gold. However, the currency was never actually backed by gold and hyperinflation continued..
INSERT INTO public.cur_currency VALUES (365, NULL, 'Dollar', 'Dollars', 'Taiwan dollar', '1946', '1949-06-15', 216, 40000, 'The Old Taiwan dollar was replaced by the New Taiwan dollar issued by the Bank of Taiwan on 15 June 1949, at a ratio of 40,000 to one. The first goal of the New Taiwan dollar was to end the hyperinflation that had plagued Nationalist China due to the Chinese Civil War.
INSERT INTO public.cur_currency VALUES (364, NULL, 'Silver yuan', 'Silver yuan', 'Chinese silver yuan', '1949', '1949', 216, 0.333, 'In 1949, the Kuomintang again announced a reform with the introduction of the Silver Yuan Certificate, returning China to the silver standard. The silver yuan would be exchanged at 1 silver yuan = 100 million gold yuan, and was backed by silver dollars minted by the Central Mint of China.
INSERT INTO public.cur_currency VALUES (366, NULL, 'Yuan', 'Yuan', 'Chinese yuan', '1889', '1948', 363, 3e+06, 'In 1889, the Chinese yuan was introduced at par with the Spanish dollar or Mexican peso or Philippine peso and was subdivided into 10 jiao, 100 fen, and 1000 wen.
INSERT INTO public.cur_currency VALUES (121, '₭', 'Kip', 'Kip', 'Pathet Lao Kip', '1975', '1979-12-16', 122, 100, 'The Pathet Lao kip was introduced sometime before 1976 in the areas which were under the control of the Pathet Lao.
INSERT INTO public.cur_currency VALUES (122, '₭', 'Kip', 'Kip', 'Lao PDR Kip', '1979-12-16', NULL, NULL, NULL, 'On 16 December 1979, the old Pathet Lao “Liberation” kip was replaced by the new Lao kip at a rate of 100 to 1');
INSERT INTO public.cur_currency VALUES (367, '₭', 'Kip', 'Kip', 'Royal Kip', '1955', '1976', 121, 20, 'The term "kip" derives from a Lao word meaning "ingot."
INSERT INTO public.cur_currency VALUES (152, 'RM', 'Ringgit', 'Ringgit', 'Malaysian ringgit', '1967-06-12', NULL, NULL, NULL, 'The word ringgit is an obsolete term for "jagged" in Malay and was originally used to refer to the serrated edges of silver Spanish dollars which circulated widely in the area emanating from the Philippines.
INSERT INTO public.cur_currency VALUES (368, 'F', 'Franc', 'Francs', 'CFP franc', '1945-12', NULL, NULL, NULL, ' The initials CFP originally stood for Colonies Françaises du Pacifique (‘French colonies of the Pacific''). This was later changed to Communauté Financière du Pacifique (''Pacific Financial Community'') and then to its present term, Change Franc Pacifique ("Pacific Franc Exchange"). 
INSERT INTO public.cur_currency VALUES (369, 'Đ.', 'Đồng', 'Đồng', 'South Vietnamese đồng', '1953', '1975-09-22', 370, 500, 'In 1953, the Vietnam branch of the Institut d''Emission des Etats du Cambodge, du Laos et du Vietnam issued notes dual denominated in piastre and đồng. At the same time, the two other branches of the Bank made similar issues with the riel in Cambodia and the kip in Laos. The đồng circulated in those parts of Vietnam not under the control of the Communist forces, which by 1954 coincided with South Vietnam. In 1955, an independent issue of đồng banknotes was produced by the National Bank of Vietnam.
INSERT INTO public.cur_currency VALUES (370, 'Đ.', 'Đồng', 'Đồng', 'Liberation đồng', '1975-09-22', '1978-05-02', 231, 0.8, 'Following the defeat of South Vietnam by North Vietnamese forces, the first đồng was replaced by a new currency, known as the "liberation đồng", at a rate of 1 liberation đồng = 500 first đồng on September 22, 1975. The liberation đồng circulated until May 2, 1978, when the two Vietnamese currencies merged and the liberation đồng was replaced by the new Vietnamese đồng at a rate of 1 new đồng = 0.8 liberation đồng.');
INSERT INTO public.cur_currency VALUES (371, NULL, 'Rial', 'Rial', 'North Yemeni rial', '1963', '1991', 239, 1, NULL);
INSERT INTO public.cur_currency VALUES (372, '£', 'Pound', 'Pounds', 'Biafran pound', '1968', '1970', NULL, NULL, 'The Biafran pound was the currency of the breakaway Republic of Biafra between 1968 and 1970. It was not being recognised as currency by the rest of the world.');
INSERT INTO public.cur_currency VALUES (60, '£', 'Pound', 'Pounds', 'Cypriot pound', '1879', '2006-01-01', 74, 0.585274, NULL);
INSERT INTO public.cur_currency VALUES (156, '₦', 'Naira', 'Naira', 'Nigerian naira', '1973-01-01', NULL, NULL, NULL, 'The naira replaced the Nigerian pound at a rate of 2 naira = 1 pound. The coins of the new currency were the first coins issued by an independent Nigeria, as all circulating coins of the Nigerian pound were all struck by the colonial government of the Federation of Nigeria in 1959, with the name of Queen Elizabeth II on the obverse. Nigeria was the last former British colony to abandon the £ currency system. There was a government plan to redenominate the naira at 1 new naira = 100 old naira in 2008, but the plan was suspended.');
INSERT INTO public.cur_currency VALUES (374, '£', 'Pound', 'Pounds', 'Nigerian pound', '1958', '1973-01-01', 156, 0.5, 'The Nigerian pound was the currency of Nigeria between 1907 and 1973. Until 1958, Nigeria used the British West African pound, after which it issued its own currency. The pound was subdivided into 20 shillings, each of 12 pence. The Nigerian pound, which was at parity with the British pound, was replaced with the introduction in 1973 of the decimal naira at a rate of 1 pound = 2 naira');
INSERT INTO public.cur_currency VALUES (99, '£', 'Pound', 'Pounds', 'Irish pound', '1938', '2002-02-28', 74, 0.787564, NULL);
INSERT INTO public.cur_currency VALUES (145, '₤M', 'Lira', 'Liri', 'Maltese lira', '1972-05-26', '2006-01-01', 74, 0.4293, NULL);
INSERT INTO public.cur_currency VALUES (153, 'MT', 'Metical', 'Meticais', 'Mozambican metical', '1980-06-16', '2006-12-31', 154, 1000, 'The name metical comes from Arabic "mithqāl",[a unit of weight and an alternative name for the gold dinar coin that was used throughout much of Africa until the 19th century.
INSERT INTO public.cur_currency VALUES (154, 'MT', 'Metical', 'Meticais', 'Mozambican metical', '2006-07-01', NULL, NULL, NULL, 'On July 1, 2006, Mozambique redenominated the metical at a rate of 1000:1. The transitional period during which both old and new meticais could be used lasted until December 31, 2006. Old meticais were redeemed by the Bank of Mozambique for a period of six years, until December 31, 2012.');
INSERT INTO public.cur_currency VALUES (375, NULL, 'Escudo', 'Escudos', 'Mozambican escudo', '1914', '1980-06-15', 153, 1, 'The escudo replaced the real at a rate of 1 escudo = 1000 réis. It was equal in value to the Portuguese escudo until 1977. Initially, Mozambique had its own paper money but used Portuguese coins. Only in 1935 were coins issued specifically for use in Mozambique. In 1975, the metica was proposed as a replacement for the escudo, but it was not used. The escudo was replaced by the metical in 1980 at par.');
INSERT INTO public.cur_currency VALUES (400, 'RM', 'Rentenmark', 'Rentenmark', 'German Rentenmark', '1923-11-23', '1948-06-23', 397, 1, 'The Rentenmark was issued on 15 November 1923,  although it did not come into circulation until 1924, to stop the hyperinflation of 1922 and 1923 in Weimar Germany, after the previously used "paper" Mark had become almost worthless. The Reichsmark became the new legal tender on 30 August 1924, equal in value to the Rentenmark. The Rentenbank continued to exist after 1924 and the notes and coins continued to circulate. The last Rentenmark notes were valid until 1948.');
INSERT INTO public.cur_currency VALUES (376, '£', 'Pound', 'Pounds', 'British West African pound', '1912', '1965', NULL, NULL, 'The British West African Pound was the currency of British West Africa, a group of British colonies, protectorates and mandate territories. It was equal to the pound sterling and was similarly subdivided into 20 shillings, each of 12 pence.
INSERT INTO public.cur_currency VALUES (236, 'CFA', 'Franc', 'Francs', 'West African CFA Franc', '1958', NULL, NULL, NULL, 'The CFA franc was introduced to the French colonies in West Africa in 1958, replacing the French West African franc. The West African colonies and territories using the CFA franc were Ivory Coast, Dahomey, French Sudan, Mauritania, Niger, Sénégal, Togo and Upper Volta. The currency continued in use when these colonies gained their independence, except in Mali (formerly French Sudan), which replaced at par the CFA franc with its own franc in 1961.
INSERT INTO public.cur_currency VALUES (377, 'FCFA', 'CFA Franc', 'Francs', 'CFA Franc (French Equatorial Africa & Cameroon)', '1945-12-26', '1960', 378, 1, 'Between 1945 and 1958, CFA stood for Colonies françaises d''Afrique ("French colonies of Africa"); then for Communauté française d''Afrique ("French Community of Africa") between 1958 (establishment of the French Fifth Republic) and the independence of these African countries at the beginning of the 1960s.');
INSERT INTO public.cur_currency VALUES (378, 'FCFA', 'CFA Franc', 'Francs', 'CFA Franc (Equatorial African States & Cameroon)', '1960', '1993', 234, 1, 'After 1960 , CFA is taken to mean Communauté Financière Africaine (African Financial Community)');
INSERT INTO public.cur_currency VALUES (397, 'ℛℳ', 'Reichsmark', 'Reichsmark', 'German reichsmark ', '1924-08-30', '1948-06-23', 63, NULL, 'The Reichsmark was the currency in Germany from 1924 until 20 June 1948 in West Germany, where it was replaced with the Deutsche Mark, and until 23 June 1948 in East Germany when it was replaced by the East German mark. The Mark is an ancient Germanic weight measure, traditionally a half pound, later used for several coins; whereas Reich, that is realm in English, comes from the official name for the German nation state from 1871 to 1945, Deutsches Reich.');
INSERT INTO public.cur_currency VALUES (401, 'ℳ', 'Mark', 'Mark', 'German Papiermark', '1914-08-04', '1923-11-23', 400, 1e+12, 'The Papiermark, officially just Mark, was the German currency from 4 August 1914 when the link between the Goldmark and gold was abandoned, due to the outbreak of World War I. In particular, Papiermarks were the banknotes issued during the hyperinflation in Germany of 1922 and especially 1923. 
INSERT INTO public.cur_currency VALUES (402, 'ℳ', 'Mark', 'Mark', 'German gold mark', '1876-01-01', '1914-08-04', 401, 1, 'The Goldmark, officially just Mark, was the gold standard-based currency of the German Empire from 1873 to 1914. It was relaced by the Papiermark after the gold standard was given up in August 1914, and gold and silver coins ceased to circulate.');
INSERT INTO public.cur_currency VALUES (403, NULL, 'Đồng', 'Đồng', 'Vietnamese  đồng', '1985-09-14', NULL, NULL, NULL, 'In 1985 the đồng was revalued, with the new đồng worth 10 old đồng. This started a cycle of chronic inflation.');
INSERT INTO public.cur_currency VALUES (231, 'Đ.', 'Đồng', 'Đồng', 'Vietnamese  đồng', '1978-05-03', '1985-09-14', 403, 10, 'After Vietnam was reunified, the đồng was also unified, on May 3, 1978. One new đồng equalled one Northern đồng or 0.8 Southern "liberation" đồng.
INSERT INTO public.cur_currency VALUES (384, NULL, 'Marka', 'Marek', 'Polish marka', '1917', '1924', 383, 1.8e+06, 'The marka was the currency of the Kingdom of Poland and of the Republic of Poland between 1917 and 1924. It was equivalent to the German mark.
INSERT INTO public.cur_currency VALUES (436, NULL, 'Peseta', 'Pesetas', 'Sahrawi peseta', '1990', NULL, NULL, NULL, 'The Sahrawi peseta is the currency of the partially recognized Sahrawi Arab Democratic Republic. Banknotes have never been printed.
INSERT INTO public.cur_currency VALUES (234, 'FCFA', 'Franc', 'Francs', 'Central African CFA Franc', '1993', NULL, NULL, NULL, 'The CFA franc was introduced to the French colonies in Equatorial Africa in 1945, replacing the French Equatorial African franc. The CFA franc was created on 26 December 1945, along with the CFP franc. The reason for their creation was the weakness of the French franc immediately after World War II.
INSERT INTO public.cur_currency VALUES (379, NULL, 'Franc', 'Francs', 'French West African franc', '1903', '1958', 236, 1, 'The franc was the currency of French West Africa. The French franc circulated from 1903 until it was replaced by the West African States franc (CFA Franc) at par.');
INSERT INTO public.cur_currency VALUES (380, 'FG', 'Franc', 'Francs', 'Guinean franc', '1959', '1971', 85, 10, 'The first Guinean franc was introduced in 1959 to replace the CFA franc at par. In 1971, the franc was replaced by syli at a rate of 1 syli = 10 francs.');
INSERT INTO public.cur_currency VALUES (143, 'UM', 'Ouguiya', 'Ouguiya', 'Mauritanian ouguiya', '1973-06-29', '2018-01-01', 144, 10, 'The ouguiya was introduced in 1973, replacing the CFA franc at a rate of 1  ouguiya = 5 francs. The name ouguiya is the Hassaniya Arabic pronunciation of uqiyyah, meaning "ounce".');
INSERT INTO public.cur_currency VALUES (157, 'C$', 'Córdoba', 'Córdobas', 'Nicaraguan córdoba', '1988-02-15', '1990-10-31', 158, 5e+06, 'On February 15, 1988, the 2nd córdoba was introduced. It was equal to 1,000 1st córdobas. On April 30, 1991 the third córdoba, was introduced, worth 5,000,000 2nd córdobas.');
INSERT INTO public.cur_currency VALUES (158, 'C$', 'Córdoba', 'Córdobas', 'Nicaraguan córdoba', '1990-10-31', NULL, NULL, NULL, 'On April 30, 1991 the third córdoba, also called the córdoba oro, was introduced, worth 5,000,000 2nd córdobas.');
INSERT INTO public.cur_currency VALUES (381, NULL, 'Peso', 'Pesos', 'Nicaraguan peso', '1878', '1912-03-20', 382, 12.5, 'The peso was the currency of Nicaragua between 1878 and 1912. It was Nicaragua''s first national currency, replacing the Central American Republic real and that of neighbouring states.
INSERT INTO public.cur_currency VALUES (382, 'C$', 'Cordoba', 'Cordobas', 'Nicaraguan córdoba', '1912-03-20', '1988-02-15', 157, 1000, 'The first córdoba was introduced on March 20, 1912. It replaced the peso moneda corriente at a rate of 12½ pesos m/c = 1 córdoba and the peso fuerte at par. It was initially nearly equal to the US dollar. It was named after the Conquistador Francisco Hernández de Córdoba.
INSERT INTO public.cur_currency VALUES (345, '£', 'Pound', 'Pounds', 'Jamaican pound', '1840', '1969-09-08', 109, 0.5, 'The Jamaican pound was the official currency of Jamaica between 1840 and 1969. It circulated as a mixture of British currency and local issues and was always equal to the British pound. The Jamaican pound was also used by the Cayman Islands and Turks and Caicos Islands.');
INSERT INTO public.cur_currency VALUES (386, 'лв.', 'Lev', 'Leva', 'Bulgarian lev', '1952', '1962', 27, 10, NULL);
INSERT INTO public.cur_currency VALUES (387, 'лв.', 'Lev', 'Leva', 'Bulgarian lev', '1881', '1952', 385, 100, NULL);
INSERT INTO public.cur_currency VALUES (391, '£', 'Pound', 'Pounds', 'Jersey pound', '1834', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (392, '£', 'Pound', 'Pounds', 'Manx pound', '1679', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (393, '£', 'Pound', 'Pounds', 'Guernsey pound', '1827', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (394, 'kr', 'Krona', 'Kronur', 'Faroese krona', '1940', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (395, 'K', 'Krone', 'Kronen', 'Austrian krone', '1919', '1925', 396, 10000, 'The Krone was the currency of Austria (then known as German-Austria) and Liechtenstein after the dissolution of the Austro-Hungarian Empire (1919) until the introduction of the Schilling (1925) and the Franken, respectively.');
INSERT INTO public.cur_currency VALUES (396, 'S', 'Schilling', 'Schilling', 'Austrian schilling', '1925-03-01', '1938', NULL, NULL, 'The schilling was established by the Schilling Act of December 20, 1924, at a rate of one schilling to 10,000 kronen and issued on March 1, 1925. The schilling was abolished in the wake of Germany''s annexation of Austria in 1938, when it was exchanged at a rate of two German reichsmarks to three schillings.');
INSERT INTO public.cur_currency VALUES (17, 'S', 'Schilling', 'Schilling', 'Austrian schilling', '1945', '2002-02-28', 74, 13.7603, 'The schilling was reintroduced after World War II on November 30, 1945, by the Allied Military, who issued paper money (dated 1944) in denominations of 50 groschen, 2, 5, 10, 20, 25, 50, 100, and 1000 schilling. The exchange rate to the reichsmark was 1:1, limited to 150 schilling per person. 
INSERT INTO public.cur_currency VALUES (398, 'Δρ.', 'Drachma', 'Drachma', 'Greek drachma', '1832', '1944', 399, 5e+10, NULL);
INSERT INTO public.cur_currency VALUES (399, 'Δρ.', 'Drachma', 'Drachma', 'Greek drachma', '1944', '1954-05-01', 88, 1000, NULL);
INSERT INTO public.cur_currency VALUES (390, 'руб', 'Ruble', 'Rubles', 'Transnistrian ruble', '2000', NULL, NULL, NULL, 'In 2000, a new ruble was introduced at a rate of 1 new ruble = 1,000,000 old rubles. This new currency consists of both coins and banknotes.');
INSERT INTO public.cur_currency VALUES (171, 'zł', 'Złoty', '2-Złote,Złotych', 'Polish złoty', '1995-01-01', NULL, NULL, NULL, 'On 1 January 1995 a new redenomination took place. 10,000 PLZ became 1 PLN. Unlike previous redenominations, there were no restrictions on where the money was or who owned it.');
INSERT INTO public.cur_currency VALUES (383, 'zł', 'Złoty', '2-Złote,Złotych', 'Polish złoty', '1924', '1950-10-30', 172, 100, 'The word złoty is a masculine form of the Polish adjective ''golden'', which closely relates with its name to the Dutch guilder. It was officially introduced to replace its predecessor, the Polish marka, and began circulation in 1924.
INSERT INTO public.cur_currency VALUES (172, 'zł', 'Złoty', '2-Złote,Złotych', 'Polish złoty', '1950-10-30', '1994-12-31', 171, 10000, 'In 1950, a new złoty (PLZ) was introduced, replacing all notes issued up to 1948 at a rate of one hundred to one.');
INSERT INTO public.cur_currency VALUES (155, '$', 'Dollar', 'Dollars', 'Namibian dollar', '1993-09-05', NULL, NULL, NULL, 'The dollar replaced the South African rand, which had been the country''s currency while it was under South African rule as South-West Africa from 1920 until 1990, at par. The rand is still legal tender, as the Namibian dollar is linked to the South African rand and can be exchanged on a one-to-one basis locally.');
INSERT INTO public.cur_currency VALUES (388, 'руб', 'Ruble', 'Rubles', 'Transnistrian ruble', '1994', '1994-08-01', 389, 1000, 'Soviet banknotes were used in the Pridnestrovian Moldavian Republic after its formation in 1990. When the former Soviet republics began issuing their own currencies, Transnistria was flooded with Soviet rubles. In an attempt to protect its financial system, in July 1993, the Transnistrian government bought used Goznak-printed Soviet and Russian notes dated 1961–1992 which it modified by applying adhesive stamps bearing the image of General Alexander Vasilyevich Suvorov.These stamped notes replaced unstamped Soviet and Russian notes at par. It is thought that most uncirculated notes bearing these stickers were created after 1994 specifically for collectors.');
INSERT INTO public.cur_currency VALUES (389, 'руб', 'Ruble', 'Rubles', 'Transnistrian ruble', '1994-08-01', '2000', 390, 1e+06, 'The first, provisional issues were replaced in August 1994 by a new Transnistrian ruble, equal to 1000 old rubles. This currency consisted solely of banknotes and suffered from high inflation, necessitating the issue of notes overstamped with higher denominations. Although issued in 1994, some notes (50 to 5000 rubles) were issued dated 1993.');
INSERT INTO public.cur_currency VALUES (108, '₤', 'Lira', 'Lire', 'Italian lira', '1861', '2002-02-28', 74, 1936.27, 'The term ''Lira'' originates from the value of a pound weight (Latin: libra) of high purity silver. It was the currency of Italy between 1861 and 2002. Between 1999 and 2002, the Italian lira was officially a national subunit of the euro.');
INSERT INTO public.cur_currency VALUES (404, NULL, 'Real', 'Reis', 'Mozambican real', '1835', '1914', 375, 1000, 'The real was the currency of Portuguese Mozambique until 1914. It was equivalent to and circulated alongside the Portuguese real. The first banknotes appeared in 1877.
INSERT INTO public.cur_currency VALUES (224, '$', 'Peso', 'Pesos', 'Uruguayan peso', '1863-01-01', '1975-07-01', 223, 1000, 'The National Currency Decree of 23 June 1862 (with effect from 1 January 1863) made the gold doblón and the silver peso the national currency (moneda nacional). It defined the doblón de oro (which replaced the onza de oro) as weighing 16·97 g, 0·917 fine (one gold peso equivalent to 1556·149 mg fine gold), and equal to 10 silver pesos, each of 25·48 g, 0·917 fine (23·365 g fine silver), giving a silver:gold ratio of 15:1. The peso was revalued to 100 centésimos, with 1 new centésimo equal to 10 old centésimos de real, the new currency being known as Sistema centesimal (as opposed to the old Sistema real).
INSERT INTO public.cur_currency VALUES (239, '﷼', 'Rial', 'Rials', 'Yemeni rial', '1990', NULL, NULL, NULL, 'After the union between the North (the Yemen Arab Republic) and the South (the People''s Democratic Republic of Yemen) in 1990, both the northern rial and the southern dinar remained legal tender during a transitional period, with 1 dinar exchanged for 26 rials. On 11 June 1996, the dinar was withdrawn from circulation.');
INSERT INTO public.cur_currency VALUES (19, 'ƒ', 'Florin', 'Florin', 'Aruban florin', '1986', NULL, NULL, NULL, 'The florin was introduced in 1986, replacing the Netherlands Antillean guilder at par. The Aruban florin is pegged to the United States dollar at the rate of 1.79 florin per USD.');
INSERT INTO public.cur_currency VALUES (235, '$', 'Dollar', 'Dollars', 'East Caribbean Dollar', '1965', NULL, NULL, NULL, 'The Eastern Caribbean dollar (symbol: $; code: XCD) is the currency of all seven full members and one associate member of the Organisation of Eastern Caribbean States (OECS). 
INSERT INTO public.cur_currency VALUES (373, 'N', 'New shilling', 'New shillings', 'New Somali shillings', '1991', '1991', NULL, NULL, 'In 1990 there was an attempt to reform the currency at 100 to 1, with new banknotes of 20 and 50 new shilling prepared for the redenomination.');
INSERT INTO public.cur_currency VALUES (405, '$', 'Dollar', 'Dollars', 'Malaya and British Borneo dollar', '1953', '1967-06-12', NULL, NULL, 'The Malaya and British Borneo dollar (known as the ringgit in Malay, Jawi: رڠڬيت) was the currency of Malaya, Singapore, Sarawak, North Borneo, Brunei and Riau archipelago from 1953 to 1967 and was the successor of the Malayan dollar and Sarawak dollar, replacing them at par. The currency was issued by the Board of Commissioners of Currency, Malaya and British Borneo.
INSERT INTO public.cur_currency VALUES (406, 'Fr', 'Franc', 'Francs', 'New Hebrides franc', '1969', '1981', 232, 1, 'The Franc was the currency of the Anglo-French Condominium of the Pacific island group of the New Hebrides (which became Vanuatu in 1980). It circulated alongside British and later Australian currency. Between 1945 and 1969, it was part of the CFP franc.');
INSERT INTO public.cur_currency VALUES (407, NULL, 'Escudo', 'Escudos', 'São Tomé and Príncipe escudo', '1914', '1977', 199, 1, 'The escudo was equivalent to the Portuguese escudo and subdivided into 100 centavos. The escudo replaced the real at a rate of 1000 réis = 1 escudo. Initially, only banknotes were issued in the name of São Tomé and Príncipe and the colony used Portuguese coins. Only in 1929 were coins also issued for the colony. The escudo was replaced at par by the dobra following independence.');
INSERT INTO public.cur_currency VALUES (199, 'Db', 'Dobra', 'Dobras', 'São Tomé and Príncipe dobra', '1977', '2018-04-01', 200, 1000, 'The name derives from Portuguese dóbra, meaning "doubloon."
INSERT INTO public.cur_currency VALUES (409, NULL, 'Krone', 'Krone', 'Greenlandic krone', '1875', '1967', NULL, NULL, 'The Greenland krone was not intended to be an independent currency but a version of the Danish krone');
INSERT INTO public.cur_currency VALUES (410, NULL, 'Dollar', 'Dollars', ' Gilbert and Ellice Islands dollar', '1942', '1942', NULL, NULL, 'In 1942, local banknotes were issued under the authority of the Gilbert and Ellice Islands Government and were locally produced with a primitive and austere design. These notes were valued on parity with sterling and issued in denominations of 1, 2, 5, and 10 shillings and 1 pound. After the wartime emergency had passed these notes were discontinued and gradually phased out. ');
INSERT INTO public.cur_currency VALUES (251, 'R$', 'Dollar', 'Dollars', 'Rhodesian dollar', '1970-02-17', '1980', 252, 1, 'The dollar was introduced on 17 February 1970, less than a month before the declaration of a republic on 2 March 1970. It replaced the Rhodesian pound at a rate of 2 dollars to 1 pound. 
INSERT INTO public.cur_currency VALUES (412, '£', 'Pound', 'Pounds', 'Rhodesian pound', '1964', '1970', 251, 0.5, 'The Rhodesian pound was introduced following the break-up of the Federation of Rhodesia and Nyasaland, when Southern Rhodesia changed its name to simply Rhodesia. The Rhodesian pound replaced the Rhodesia and Nyasaland pound at par and the coins and banknotes of this earlier currency continued to circulate.');
INSERT INTO public.cur_currency VALUES (413, '£', 'Pound', 'Pounds', 'Rhodesia and Nyasaland pound', '1955', '1964', 412, 1, 'The Federation was formed in 1953, and the new currency was created in 1955 to replace the Southern Rhodesian pound which had been circulating in all parts of the federation (Southern Rhodesia, Northern Rhodesia, and Nyasaland). The Rhodesia and Nyasaland pound replaced the Southern Rhodesian pound at par and was pegged at par to the British pound.
INSERT INTO public.cur_currency VALUES (414, '£', 'Pound', 'Pounds', 'Southern Rhodesian pound', '1896', '1955', 413, 1, 'From 1896, private banks issued notes denominated in pounds equal to the British pound. In 1932, a distinct coinage was introduced. In 1938, the Southern Rhodesia Currency Board was established and took over the issuance of paper money the following year. Southern Rhodesia, Northern Rhodesia and Nyasaland joined in 1953 to form the Federation of Rhodesia and Nyasaland, which continued to use the Southern Rhodesian pound until 1955 when coins were introduced for the Rhodesia and Nyasaland pound. 1955 also saw the Southern Rhodesia Currency Board renamed the Central Africa Currency Board. In 1956, the first paper money of the Rhodesia and Nyasaland pound was introduced, completing the transition.');
INSERT INTO public.cur_currency VALUES (119, '$', 'Dollar', 'Dollars', 'Cayman Islands dollar', '1972', NULL, NULL, NULL, 'The Cayman Islands dollar was introduced in 1972 ( 10 years after separation from Colony of Jamaica ), replacing the Jamaican dollar at par. Jamaican currency and Cayman Islands dollars both remained legal tender until 1 August 1972, when Jamaican currency ceased to be legal tender.');
INSERT INTO public.cur_currency VALUES (183, '$', 'Dollar', 'Dollars', 'Solomon Islands dollar', '1977', NULL, NULL, NULL, 'Prior to the Solomon Islands Dollar, Solomon Islands used the Australian pound sterling. However, the Solomon Islands had also issued its own banknotes, sometimes called the Solomon Islands pound.
INSERT INTO public.cur_currency VALUES (424, 'GH₵', 'Cedi', 'Cedis', 'Ghanaian cedi', '1965', '1967', 81, 1.2, NULL);
INSERT INTO public.cur_currency VALUES (421, '£', 'Pound', 'Pounds', 'Solomon Islands pound', '1916', '1966', NULL, NULL, 'The pound was the currency of the British Solomon Islands Protectorate between 1899 and 1966. It was divided into 20 shillings, each of 12 pence. Initially, the British pound circulated, supplemented by local banknotes from 1916. In 1920, Australian coins and banknotes were introduced, although local paper money continued to be produced until 1932. ');
INSERT INTO public.cur_currency VALUES (411, '$', 'Dollar', 'Dollars', 'Tuvaluan dollar', '1976', NULL, NULL, NULL, 'The Tuvaluan dollar is the currency of Tuvalu, whose unofficial international currency code is TVD. In 1976, Tuvalu began issuing its own coins, which continue to circulate alongside Australian coins. Tuvalu continues to use Australian banknotes. ');
INSERT INTO public.cur_currency VALUES (64, 'Fdj', 'Franc', 'Francs', 'Djiboutian franc', '1977', NULL, NULL, NULL, 'Starting in 1910, banknotes were issued for the then colony by the Bank of Indochina. Chamber of Commerce paper money and tokens were issued between 1919 and 1922.
INSERT INTO public.cur_currency VALUES (423, NULL, 'Franc', 'Francs', 'Afars and Issas Franc', '1967', '1977', 64, 1, 'Starting in 1910, banknotes were issued for the then colony by the Bank of Indochina. Chamber of Commerce paper money and tokens were issued between 1919 and 1922. In 1948, the first coins were issued specifically for use in Djibouti, in the name of the "Côte Française des Somalis". In 1949, an independent Djiboutian franc came into being when the local currency was pegged to the US dollar at a rate of 214.392 francs = 1 dollar. In 1952, the Public Treasury took over the production of paper money. French Somaliland''s change of name in 1967 to the French Territory of the Afars and the Issas was reflected on both the territory''s coins and notes. A further change in coin and banknote design followed independence in 1977.');
INSERT INTO public.cur_currency VALUES (425, NULL, 'Pound', 'Pounds', 'Gambian pound', '1965', '1971', 84, 5, NULL);
INSERT INTO public.cur_currency VALUES (426, NULL, 'Franc', 'Francs', 'Ruanda-Urundi franc', '1960', '1964', NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (427, '£', 'Pound', 'Pounds', 'Fijian pound', '1873', '1969', 76, 0.5, NULL);
INSERT INTO public.cur_currency VALUES (77, '£', 'Pound', 'Pounds', 'Falkland Islands pound', '1833', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (106, 'kr', 'Krona', 'Kronur', 'Icelandic krona', '1922', '1981-06-30', 107, 100, NULL);
INSERT INTO public.cur_currency VALUES (428, '£', 'Pound', 'Pounds', 'South African pound', '1825', '1961', 246, 0.5, NULL);
INSERT INTO public.cur_currency VALUES (184, '₨', 'Rupee', 'Rupees', 'Seychellois rupee', '1914', NULL, NULL, NULL, 'The British Legislative Council authorized the establishment of a Board of Commissioners of Currency through the Paper Currency Ordinance of 1914. In 1914, the government produced emergency issues of notes for 50 cents, 1, 5 and 10 rupees.
INSERT INTO public.cur_currency VALUES (429, NULL, 'Real', 'Reis', 'Cape Verdean real', '1865', '1914', 59, 1000, 'The real was the currency of Portuguese Cape Verde until 1914. It was equal to the Portuguese real. Portuguese coins were used but banknotes were issued by the Banco Nacional Ultramarino specifically for Cape Verde starting in 1865. The real was replaced by the Cape Verdean escudo, at a rate of 1000 réis = 1 escudo.');
INSERT INTO public.cur_currency VALUES (59, '$', 'Escudo', 'Escudos', 'Cape Verdean escudo', '1914', NULL, NULL, NULL, 'The escudo became the currency of Cape Verde in 1914. It replaced the Cape Verdean real at a rate of 1000 réis = 1 escudo. 
INSERT INTO public.cur_currency VALUES (430, '$', 'Dollar', 'Dollars', 'Cook Islands dollar', '1987', NULL, NULL, NULL, 'In 1987, the Cook Islands dollar was established and pegged at par to the New Zealand dollar, with each Cook Islands dollar backed by a New Zealand dollar held by the Treasury of the Cook Islands Government and freely interchangeable; the New Zealand dollar remained legal tender alongside the new currency');
INSERT INTO public.cur_currency VALUES (18, '$', 'Dollar', 'Dollars', 'Australian dollar', '1966-02-14', NULL, NULL, NULL, 'The Australian dollar was introduced on 14 February 1966 to replace the pre-decimal Australian pound, with the conversion rate of A$2 per = A£1. The Australian dollar was legal tender of Papua New Guinea until 31 December 1975, when the Papua New Guinean kina became sole legal tender, and of the Solomon Islands until 1977, when the Solomon Islands dollar became sole legal tender.');
INSERT INTO public.cur_currency VALUES (431, '£', 'Pound', 'Pounds', 'Australian pound', '1910', '1966', 18, 0.5, 'The Australian pound was the currency of Australia from 1910 until 14 February 1966, when it was replaced by the Australian dollar. As with other £sd currencies, it was subdivided into 20 shillings, each of 12 pence.');
INSERT INTO public.cur_currency VALUES (115, 'CF', 'Franc', 'Francs', 'Comorian franc', '1962', NULL, NULL, NULL, 'The Comorian franc was a continuation of the Madagascar-Comores CFA franc, after Madagascar gained independence from France in 1960. Loi ordinaire 62-873 du 31 juillet 1962, Article 12, allowed the Banque de Madagascar et des Comores to continue issuing notes in Comoros after Madagascar began issuing its own currency but, beginning 1 April 1962, they had "COMORES" overstamped on them. In 1964 coins were introduced specifically for use in the Comoros, replacing the Madagascar coins previously in use.');
INSERT INTO public.cur_currency VALUES (168, 'K', 'Kina', 'Kina', 'Papua New Guinean kina', '1975-05-19', NULL, NULL, NULL, 'The kina was introduced on 19 May 1975, and circulated along with the Australian dollar until 31 December 1975. The next day, the dollar ceased to be legal tender.
INSERT INTO public.cur_currency VALUES (432, '£', 'Pound', 'Pounds', 'New Guinean pound', '1915', '1966', 18, 0.5, 'The New Guinean pound was the currency of the Australian Territory of New Guinea between 1915 and 1966, and replaced the New Guinean mark when Australia occupied the former German colony at the end of World War I. The New Guinean pound was subdivided into 20 shillings, each of 12 pence, and was equal to the Australian pound. No banknotes were ever issued');
INSERT INTO public.cur_currency VALUES (193, 'Le', 'Leone', 'Leones', 'Sierra Leonean leone', '1964-08-04', NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency VALUES (437, '£', 'Pound', 'Pounds', 'Bahamian pound', '1806', '1966', 41, 0.35, 'The Pound was the currency of the Bahamas until 1966. It was equivalent to the pound sterling and was divided into 20 shillings. Ordinary UK coinage circulated. Apart from an old Bahamas penny coin struck in 1806, there were no special sterling coin issues such as were found in Jamaica.
INSERT INTO public.cur_currency VALUES (101, 'IS', 'Shekel', 'Shekels', 'Israeli shekel', '1980-02-24', '1985-12-31', 102, 1000, 'The origin of the name "shekel"  is from the ancient Biblical currency by the same name. An early Biblical reference is Abraham being reported to pay "four hundred shekels of silver" to Ephron the Hittite for the Cave of the Patriarchs in Hebron. Shekel is any of several ancient units of weight or of currency in ancient Israel, from the Hebrew root ''š-q-l'' meaning ''weigh''.
INSERT INTO public.cur_currency VALUES (102, '₪', 'New Shekel', 'New Shekels', 'Israeli new shekel', '1986-01-01', NULL, NULL, NULL, 'The Israeli new shekel, also known as simply the Israeli shekel, is the currency of Israel and is also used as a legal tender in the Palestinian territories of the West Bank and the Gaza Strip. The new shekel has been in use since 1 January 1986, when it replaced the hyperinflated old shekel at a ratio of 1000:1');
INSERT INTO public.cur_currency VALUES (166, 'I/.', 'Inti', 'Intis', 'Peruvian inti', '1985-02-01', '1991-07-01', 167, 1e+06, 'The inti was introduced on 1 February 1985, replacing the sol which had suffered from high inflation. One inti was equivalent to 1,000 soles.
INSERT INTO public.cur_currency VALUES (256, ' ', 'Apsar', 'Apsark', 'Abkhazian apsar', '2008', NULL, NULL, NULL, 'The first apsar coins were introduced in 2008. While the coins are legal tender in the Republic of Abkhazia, their usage is very limited, and the coins are mostly made for collectors. In Abkhazia, the Russian ruble is used in practice.');
INSERT INTO public.cur_currency VALUES (258, ' ', 'Dram', 'Dram', 'Artsakh dram', '2003', NULL, NULL, NULL, 'The Artsakh dram is a monetary unit of the Republic of Artsakh. Although it is legal tender, it is not as widely used as the Armenian dram.');
INSERT INTO public.cur_currency VALUES (206, ' ', 'Ruble', 'Rubles', 'Tajikistani ruble', '1995-05-10', '2000-10-30', 207, 1000, 'Tajikistan continued using the Soviet and Russian rubles for a few years after independence. On 26 July 1993, when the new Russian ruble was issued, old Soviet rubles ceased to be legal tender in Russia. In Tajikistan, pre-1993 Soviet rubles ceased to be legal tender on 8 January 1994. On 10 May 1995, the Tajikistani ruble replaced the Russian ruble at a rate of 1 Tajikistani ruble to 100 Russian rubles.
INSERT INTO public.cur_currency VALUES (438, 'p', 'Piastre', 'Piastres', 'French Indochinese piastre', '1885', '1954', NULL, NULL, 'The "piastre de commerce" was the currency of French Indochina between 1885 and 1952. 
