INSERT INTO public.gra_grade VALUES (1, 'UNC', 'Uncirculated', 'Perfect or nearly perfect');
INSERT INTO public.gra_grade VALUES (2, 'XF', 'Extremely Fine', 'Paper is clean and only 1-2 light folds or creases are visible. Corners are sharp');
INSERT INTO public.gra_grade VALUES (3, 'VF', 'Very Fine', 'Evidence of handling and light wear. Might have several folds. Paper can have some dirt or color lose. Corners are not sharp');
INSERT INTO public.gra_grade VALUES (5, 'VG', 'Very Good', 'Heavily used note. Might have also have some holes in the center due to folding and marks of staples or pinholes');
INSERT INTO public.gra_grade VALUES (6, 'G', 'Good', 'A damaged note. With holes, stains, strong folds and creases or even small missing pieces. ');
INSERT INTO public.gra_grade VALUES (7, 'P', 'Poor', 'Severly damaged note. With stains, holes, missing pieces or tape holding together one or more pieces.');
INSERT INTO public.gra_grade VALUES (8, 'REP', 'Reproduction', 'A copy, photocopy or facsimil');
INSERT INTO public.gra_grade VALUES (4, 'F', 'Fine', 'Used note with clear signs of having been used. Several folds and creases. Paper is soft and can have some stains. Corners are rounded');
