INSERT INTO public.ser_series VALUES (6, 74, 'Second Series (Europa)', 2013, NULL, 2, NULL, 'Same themes as the first series, but redesigned. The 100 € and 200 € notes are slightly smaller and have the same height as the 50€ banknote. The 500 € banknote is not issued.<br>The printer code is not used anymore. The printing facility is indicated by the first character of the serial number, see <a href="/data/euroarea/euro/serial-number-codes.html" target="_blank" style="text-decoration: none"><b>Printer Codes</b></a><br>See <a href="/data/euroarea/euro/the_first_euros_2015en.pdf" target="_blank" style="text-decoration: none"><b>"The first Euros"</b></a><br> ', 0);
