INSERT INTO public.ser_series VALUES (838, 373, ' Regional Mogadishu North Forces Issue', 1991, 1991, 273, NULL, 'Authorized by Decree of September 18, 1990 (thus by the Central Government of President Siad Barré). Delivered in November 1991 by the manufacturer into the turmoil and disturbancies of the Somali Civil War, with Central Government no longer effective and no functioning Central Bank. Seized by United Somali Congress (USC) interim President Ali Mahdi Mohamed, whose Army and supporters were referred to as "Mogadiscio Northern Forces", where these notes continued to circulate in the areas under their control (i.e. north and around Mogadiscio). Later (in 2000), further unauthorized N-Shilin/New Shillings were imported by businessmen.', 0);
