INSERT INTO public.ter_territory VALUES (15, 5, 3, 'AZ', 'AZE', 'Azerbaijan', 'Azerbaijani Republic', 1991, NULL, NULL, NULL, 'The modern Republic of Azerbaijan proclaimed its independence on 30 August 1991, shortly before the dissolution of the USSR in the same year. In September 1991, the Armenian majority of the disputed Nagorno-Karabakh region seceded to form the Republic of Artsakh.');
