INSERT INTO public.ter_territory VALUES (7, 2, 5, 'AI', 'AIA', 'Anguilla', 'Anguilla', 1980, NULL, 224, NULL, 'The island of Anguilla became part of the associated state of Saint Kitts-Nevis-Anguilla with full internal autonomy in 1967.
