INSERT INTO public.ter_territory VALUES (13, 7, 3, 'AU', 'AUS', 'Australia', 'Commonwealth of Australia', 1901, NULL, NULL, NULL, 'Indigenous Australians inhabited the continent for about 65,000 years, prior to the first arrival of Dutch explorers in the early 17th century, who named it New Holland. In 1770, Australia''s eastern half was claimed by Great Britain and initially settled through penal transportation to the colony of New South Wales from 26 January 1788, a date which became Australia''s national day. The population grew steadily in subsequent decades, and by the time of an 1850s gold rush, most of the continent had been explored by European settlers and an additional five self-governing crown colonies established. On 1 January 1901, the six colonies federated, forming the Commonwealth of Australia.');
