INSERT INTO public.ter_territory VALUES (52, 2, 3, 'CR', 'CRI', 'Costa Rica', 'Republic of Costa Rica', 1838, NULL, NULL, NULL, 'Costa Rica was sparsely inhabited by indigenous peoples before coming under Spanish rule in the 16th century. It remained a peripheral colony of the empire until independence as part of the First Mexican Empire, followed by membership in the Federal Republic of Central America, from which it formally declared independence in 1838. A brief Costa Rican Civil War was held in 1948.');
