INSERT INTO public.ter_territory VALUES (54, 6, 3, 'HR', 'HRV', 'Croatia', 'Republic of Croatia', 1991, NULL, NULL, NULL, 'On 25 June 1991, Croatia declared independence. However, the full implementation of declaration only came into effect on 8 October 1991. The Croatian War of Independence was fought for the next four years.');
INSERT INTO public.ter_territory VALUES (89, 2, 3, 'GT', 'GTM', 'Guatemala', 'Republic of Guatemala', 1847, NULL, NULL, NULL, 'In the 16th century, most of this area was conquered by the Spanish and claimed as part of the viceroyalty of New Spain. Guatemala attained independence in 1821 as part of the Federal Republic of Central America, which dissolved by 1841. On 21 March 1847, Guatemala declared itself an independent republic.');
