INSERT INTO public.ter_territory VALUES (37, 4, 3, 'CM', 'CMR', 'Cameroon', 'Republic of Cameroon', 1960, NULL, NULL, NULL, 'Cameroon became a German colony in 1884 known as Kamerun. After World War I, the territory was divided between France and the United Kingdom as League of Nations mandates. In 1960, the French-administered part of Cameroon became independent as the Republic of Cameroun under President Ahmadou Ahidjo. The southern part of British Cameroons federated with it in 1961 to form the Federal Republic of Cameroon. The federation was abandoned in 1972. The country was renamed the United Republic of Cameroon in 1972 and the Republic of Cameroon in 1984.');
