INSERT INTO public.ter_territory VALUES (144, 4, 3, 'MZ', 'MOZ', 'Mozambique', 'Republic of Mozambique', 1975, NULL, NULL, NULL, 'After over four centuries of Portuguese rule, Mozambique gained independence in 1975, becoming the People''s Republic of Mozambique shortly thereafter. After only two years of independence, the country descended into an intense and protracted civil war lasting from 1977 to 1992. In 1994, Mozambique held its first multiparty elections, and has since remained a relatively stable presidential republic.');
