INSERT INTO public.ter_territory VALUES (245, 6, 2, NULL, NULL, 'Euro Area', 'Euro Area', 1999, NULL, NULL, NULL, 'The eurozone, officially called the euro area, is a monetary union of 19 of the 27 European Union (EU) member states which have adopted the euro (€) as their common currency and sole legal tender.<br/>The eurozone consists of Austria, Belgium, Cyprus, Estonia, Finland, France, Germany, Greece, Ireland, Italy, Latvia, Lithuania, Luxembourg, Malta, the Netherlands, Portugal, Slovakia, Slovenia, and Spain.<br/>Andorra, Monaco, San Marino, and Vatican City use the euro as their official currency and issue their own coins.<br/>Kosovo and Montenegro have adopted the euro unilaterally, but these countries do not officially form part of the eurozone and do not have representation in the European Central Bank (ECB).<br/>The ECB, which is governed by a president and a board of the heads of national central banks, sets the monetary policy of the zone.');
