INSERT INTO public.ter_territory VALUES (180, 2, 3, 'KN', 'KNA', 'Saint Kitts and Nevis', 'Federation of Saint Christopher and Nevis', 1983, NULL, NULL, NULL, 'Saint Kitts and Nevis were among the first islands in the Caribbean to be colonized by Europeans. Saint Kitts was home to the first British and French colonies in the Caribbean, and thus has also been titled "The Mother Colony of the West Indies". It is also the most recent British territory in the Caribbean to become independent, gaining independence in 1983.
