INSERT INTO public.ter_territory VALUES (327, 2, 5, NULL, NULL, 'Belize, British', 'Belize / British Honduras (1862–1973)', 1973, 1981, 224, '22', 'British Honduras was a British Crown colony on the east coast of Central America, south of Mexico, from 1862 to 1964, then a self-governing colony, renamed Belize in June 1973, until September 1981, when it gained full independence as Belize.');
INSERT INTO public.ter_territory VALUES (277, 4, 5, 'RH', 'RHO', 'Rhodesia, Southern', 'Colony of Southern Rhodesia', 1979, 1980, 224, '238', 'Southern Rhodesia remained a de jure British colony until 1980. However, the Southern Rhodesia government issued a Unilateral Declaration of Independence (UDI) in 1965 and established Rhodesia, an unrecognised state. In 1979, it reconstituted itself under majority rule as Zimbabwe Rhodesia, which also failed to win it international recognition. After a period of interim British control following the Lancaster House Agreement in December 1979, the country achieved internationally recognised independence as Zimbabwe in April 1980.');
