INSERT INTO public.ter_territory VALUES (330, 5, 3, NULL, NULL, 'Malaya', 'Federation of Malaya', 1957, 1963, NULL, '128', 'The Federation became independent on 31 August 1957, and in 1963, Malaysia was formed when the federation united with the colonies of Singapore, North Borneo, and Sarawak.');
INSERT INTO public.ter_territory VALUES (285, 4, 3, 'ZR', 'ZAR', 'Zaire', 'Republic of Zaire', 1971, 1997, NULL, '288', 'Congo achieved independence from Belgium on 30 June 1960 under the name Republic of the Congo. In 1971, the country was renamed as Zaire, under the rule of self Mobutu Sese Seko, On 17 May 1997, the country''s name was reverted to the Democratic Republic of the Congo');
INSERT INTO public.ter_territory VALUES (332, 5, 5, NULL, NULL, 'North Borneo', 'Crown Colony of North Borneo', 1946, 1963, 224, '128', 'The Crown Colony of Labuan joined the new Crown Colony during its formation. It was succeeded as the state of Sabah through the formation of the Federation of Malaysia on 16 September 1963.');
INSERT INTO public.ter_territory VALUES (333, 5, 5, NULL, NULL, 'Sarawak', 'Crown Colony of Sarawak', 1946, 1963, 224, '128', 'The Crown Colony of Sarawak was a British Crown colony on the island of Borneo, established in 1946, shortly after the dissolution of the British Military Administration. It was succeeded as the state of Sarawak through the formation of the Federation of Malaysia on 16 September 1963.');
INSERT INTO public.ter_territory VALUES (228, 5, 3, 'UZ', 'UZB', 'Uzbekistan', 'Republic of Uzbekistan', 1991, NULL, NULL, NULL, 'At the beginning of 1920, Central Asia was firmly in the hands of Russia and Uzbekistan and the rest of the Central Asia became a part of the Soviet Union. On 27 October 1924 the Uzbek Soviet Socialist Republic was created. 
INSERT INTO public.ter_territory VALUES (335, 5, 2, NULL, NULL, 'Malaya and British Borneo', 'Malaya and British Borneo', 1953, 1967, NULL, NULL, 'The Malaya and British Borneo dollar was the currency of Malaya, Singapore, Sarawak, North Borneo, Brunei and Riau archipelago from 1953 to 1967 and was the successor of the Malayan dollar and Sarawak dollar, replacing them at par. The currency was issued by the Board of Commissioners of Currency, Malaya and British Borneo. Prior to 1952, the board was known as the Board of Commissioners of Currency, Malaya. 
INSERT INTO public.ter_territory VALUES (315, 4, 5, NULL, NULL, 'Congo, Belgian', 'Belgian Congo', 1908, 1960, 21, '50,314,310,313', NULL);
INSERT INTO public.ter_territory VALUES (328, 2, 5, NULL, NULL, 'Honduras, British', 'British Honduras', 1862, 1973, 224, '327', NULL);
INSERT INTO public.ter_territory VALUES (337, 5, 4, NULL, NULL, 'Dadra and Nagar Haveli', 'Free Dadra and Nagar Haveli', 1954, 1961, 172, '100', NULL);
INSERT INTO public.ter_territory VALUES (347, 4, 5, NULL, NULL, 'Sierra Leone, British', 'Sierra Leone Colony and Protectorate', 1808, 1961, 224, '190', NULL);
INSERT INTO public.ter_territory VALUES (339, 5, 5, NULL, NULL, 'Netherlands New Guinea', 'Netherlands New Guinea', 1949, 1962, 149, '101', NULL);
INSERT INTO public.ter_territory VALUES (340, 5, 4, NULL, NULL, 'Iranian Azerbaijan', 'Azerbaijan People''s Government', 1945, 1946, 102, '102', NULL);
INSERT INTO public.ter_territory VALUES (349, 4, 5, NULL, NULL, 'Nigeria, Northern ', 'Northern Nigeria Protectorate', 1900, 1914, 224, '348', NULL);
INSERT INTO public.ter_territory VALUES (350, 4, 5, NULL, NULL, 'Nigeria, Southern ', 'Southern Nigeria Protectorate', 1900, 1914, 224, '348', NULL);
INSERT INTO public.ter_territory VALUES (351, 4, 5, NULL, NULL, 'Gold Coast', 'Colony of the Gold Coast', 1821, 1957, 224, '82', NULL);
INSERT INTO public.ter_territory VALUES (348, 4, 5, NULL, NULL, 'Nigeria, Federation', 'Federation of Nigeria', 1914, 1960, 224, '155', 'Colony and Protectorate of Nigeria
(1914–1954)
INSERT INTO public.ter_territory VALUES (50, 4, 3, NULL, NULL, 'Congo-Kinshasa', 'Democratic Republic of the Congo', 1960, 1971, NULL, '285', 'Between 1960 and 1964 the official name of the country was Republic of the Congo. Therefore, to avoid confusion with the neighboring country with the same name, it was also known as Congo-Kinshasa ');
INSERT INTO public.ter_territory VALUES (110, 5, 3, 'KZ', 'KAZ', 'Kazakhstan', 'Republic of Kazakhstan', 1991, NULL, NULL, NULL, 'In the 18th century the Russians began advancing into the Kazakh steppe and by the mid-19th century, they nominally ruled all of Kazakhstan as part of the Russian Empire. Following the 1917 Russian Revolution, and subsequent civil war, the territory of Kazakhstan was reorganised several times. In 1936, it was made the Kazakh Soviet Socialist Republic, part of the Soviet Union. Kazakhstan was the last of the Soviet republics to declare independence during the dissolution of the Soviet Union in 1991.');
INSERT INTO public.ter_territory VALUES (199, 6, 3, 'ES', 'ESP', 'Spain', 'Kingdom of Spain', 1479, NULL, NULL, NULL, 'Spain was united as a Kingdom in 1479, after Isabella I of Castile  and Ferdinand II of Aragon, who married in 1469, were crowned as Queen of Castile (in 1474) and King of Aragon (on January 29, 1479). Afterwards the Muslim kingdom of Granada as well as the Canary Islands were  conquered in 1492. Finally the Kingdom of Navarre was annexed in 1512, completing the current extent of Spain, except for small changes like the lost of Gibraltar (conquered by the United Kingdom in 1704) , the cession of Ceuta by Portugal (1668) or the annexation of the town of Olivenza (1801).<br>Between 1581 and 1640 Spain and Portugal formed a dynastic union, the so called Iberian Union, but the 2 countries were not formally merged. <br>
INSERT INTO public.ter_territory VALUES (68, 6, 3, 'EE', 'EST', 'Estonia', 'Republic of Estonia', 1991, NULL, NULL, NULL, 'Estonia was an independent state between 1920 and 1940. In 1940 Estonia was occupied by the Soviet Union and incorporated as a SSR. In 1987 the peaceful Singing Revolution began against Soviet rule, resulting in the restoration of de facto independence on 20 August 1991.
INSERT INTO public.ter_territory VALUES (284, 6, 3, 'YU', 'YUG', 'Yugoslavia', 'Socialist Federal Republic of Yugoslavia', 1918, 1992, NULL, '193,54,125,27,275', 'Yugoslavia was founded in 1918 under the name of the <b>Kingdom of Serbs, Croats and Slovenes</b> by the merger of the provisional State of Slovenes, Croats and Serbs 
INSERT INTO public.ter_territory VALUES (369, 5, 3, NULL, NULL, 'Armenia', 'Armenian Soviet Socialist Republic', 1918, 1922, NULL, '370', 'The Armenian National Council declared the independence of Armenia on 28 May 1918, as the Republic of Armenia. The republic lasted for over two years, during which time it was involved in several armed conflicts caused by territorial disputes. By late 1920, the nation was conquered by the Soviet Red Army. The First Republic, along with the Republic of Mountainous Armenia which repelled the Soviet invasion until July 1921, was superseded by the Armenian Soviet Socialist Republic that became part of the Soviet Union in 1922.');
INSERT INTO public.ter_territory VALUES (355, 5, 5, NULL, NULL, 'Philippines, US', 'Commonwealth of the Philippines', 1898, 1946, 225, '169', NULL);
INSERT INTO public.ter_territory VALUES (357, 2, 5, NULL, NULL, 'Cuba, US', 'Protectorate of Cuba', 1898, 1902, 225, '55', NULL);
INSERT INTO public.ter_territory VALUES (394, 4, 2, NULL, NULL, 'Equatorial African States and Cameroon', 'Equatorial African States and Cameroon', 1960, 1993, NULL, '247', 'Monetary area of the CFA Franc for   Cameroon, Central African Republic, Chad, Congo and Gabon');
INSERT INTO public.ter_territory VALUES (23, 4, 3, 'BJ', 'BEN', 'Benin', 'Republic of Benin', 1975, NULL, NULL, NULL, 'The People''s Republic of Benin was established on 30 November 1975, after the 1972 coup d''état in the Republic of Dahomey. It effectively lasted until 1 March 1990, with the adoption of a new constitution, and the abolition of Marxism-Leninism in the nation in 1989. The official name was changed to Republic of Benin.');
INSERT INTO public.ter_territory VALUES (53, 4, 3, 'CI', 'CIV', 'Côte d''Ivoire', 'Republic of Côte d''Ivoire', 1958, NULL, NULL, NULL, ' The area became a protectorate of France in 1843 and was consolidated as a French colony in 1893. It was declared a republic on 4 December 1958 and achieved full independence in 1960.');
INSERT INTO public.ter_territory VALUES (352, 4, 5, NULL, NULL, 'East Africa, British', 'East Africa Protectorate', 1895, 1920, 224, '353', NULL);
INSERT INTO public.ter_territory VALUES (356, 2, 5, NULL, NULL, 'Cuba, Spanish', 'Captaincy General of Cuba', 1607, 1898, 199, '357', NULL);
INSERT INTO public.ter_territory VALUES (87, 2, 5, 'GP', 'GLP', 'Guadeloupe', 'Overseas department of Guadelope', 1946, NULL, 74, NULL, 'In 1946, the colony of Guadeloupe became an overseas department of France. Through a referendum in 2003, Saint-Martin and Saint Barthélemy voted to separate from the administrative jurisdiction of Guadeloupe, this being fully enacted by 2007.');
INSERT INTO public.ter_territory VALUES (254, 2, 5, 'BL', 'BLM', 'Saint Barthélemy', 'Territorial Collectivity of Saint-Barthélemy', 2007, NULL, 74, NULL, 'Through a referendum in 2003, Saint Barthélemy voted to separate from the administrative jurisdiction of Guadeloupe, this being fully enacted by 2007.');
INSERT INTO public.ter_territory VALUES (260, 2, 5, 'MF', 'MAF', 'Saint Martin ', 'Collectivity of Saint Martin', 2007, NULL, 74, NULL, 'Through a referendum in 2003, Saint-Martin  voted to separate from the administrative jurisdiction of Guadeloupe, this being fully enacted by 2007.');
INSERT INTO public.ter_territory VALUES (360, 6, 3, NULL, NULL, 'Serbia, Kingdom', 'Kingdom of Serbia', 1867, 1918, NULL, '284', 'The Kingdom of Serbia was created when the ruler of the Principality of Serbia, Milan I was proclaimed king in 1882.
INSERT INTO public.ter_territory VALUES (62, 5, 3, 'TL', 'TLS', 'Timor-Leste', 'Democratic Republic of Timor-Leste', 2002, NULL, NULL, NULL, 'East Timor was colonised by Portugal in the 16th century and was known as Portuguese Timor until 28 November 1975, when the Revolutionary Front for an Independent East Timor (Fretilin) declared the territory''s independence. Nine days later, it was invaded and occupied by the Indonesian military; it was declared Indonesia''s 27th province the following year. 
INSERT INTO public.ter_territory VALUES (341, 4, 5, NULL, NULL, 'Somaliland, French', 'French Somaliland', 1883, 1967, 74, '266', NULL);
INSERT INTO public.ter_territory VALUES (265, 5, 5, 'TP', NULL, 'East Timor', 'East Timor', 1976, 2002, 101, '62', 'In 1975, Indonesia invaded East Timor and in 1976, it formally annexed the territory, declaring it as its 27th province and renaming it Timor Timur. In 1999, following the United Nations-sponsored act of self-determination, Indonesia relinquished control of the territory. As "Timor-Leste", it became a sovereign state on 20 May 2002 and joined the United Nations.');
INSERT INTO public.ter_territory VALUES (124, 5, 5, 'MO', 'MAC', 'Macao', 'Macao Special Administrative Region of the People''s Republic of China', 1999, NULL, 44, NULL, 'Macao (or Macau) was a former colony of the Portuguese Empire, after Ming China leased the territory as a trading post in 1557. Portugal paid an annual rent and administered the territory under Chinese sovereignty until 1887 when it gained perpetual colonial rights in the Sino-Portuguese Treaty of Peking. The colony remained under Portuguese rule until 1999, when it was transferred to China.');
INSERT INTO public.ter_territory VALUES (9, 2, 3, 'AG', 'ATG', 'Antigua and Barbuda', 'Antigua and Barbuda', 1981, NULL, NULL, NULL, 'The island of Antigua was explored by Christopher Columbus in 1493 and named for the Church of Santa María La Antigua. Antigua was colonized by Britain in 1632; Barbuda island was first colonised in 1678. Having been part of the Federal Colony of the Leeward Islands from 1871, Antigua and Barbuda joined the West Indies Federation in 1958. With the breakup of the federation, it became one of the West Indies Associated States in 1967. Following self-governance in its internal affairs, independence was granted from the United Kingdom on 1 November 1981. Antigua and Barbuda is a member of the Commonwealth and Elizabeth II is the country''s queen and head of state.');
INSERT INTO public.ter_territory VALUES (97, 5, 5, 'HK', 'HKG', 'Hong Kong', 'Hong Kong Special Administrative Region of the People''s Republic of China', 1997, NULL, 44, NULL, 'Hong Kong became a colony of the British Empire after the Qing Empire ceded Hong Kong Island at the end of the First Opium War in 1842. The colony expanded to the Kowloon Peninsula in 1860 after the Second Opium War and was further extended when Britain obtained a 99-year lease of the New Territories in 1898.
INSERT INTO public.ter_territory VALUES (288, 4, 3, 'CD', 'COD', 'Congo, Democratic Republic', 'Democratic Republic of the Congo', 1997, NULL, NULL, NULL, 'The Democratic Republic of the Congo (DRC), also known as DR Congo, Congo-Kinshasa, the DROC, the Congo and historically Zaire, is a country in Central Africa.
INSERT INTO public.ter_territory VALUES (163, 7, 3, 'PW', 'PLW', 'Palau', 'Republic of Palau', 1994, NULL, NULL, NULL, 'Palau (historically Belau, Palaos or Pelew) is an island country located in the western Pacific Ocean. The country contains approximately 340 islands, and together with parts of the Federated States of Micronesia, forms the western chain of the Caroline Islands.
INSERT INTO public.ter_territory VALUES (363, 5, 5, NULL, NULL, 'Hong Kong, British', 'British Dependent Territory of Hong Kong', 1842, 1997, 224, '97', 'British Hong Kong was a colony and dependent territory of the United Kingdom from 1841 to 1997, apart from a brief period under Japanese occupation from 1941 to 1945. The colonial period began with the occupation of Hong Kong Island in 1841 during the First Opium War. The island was ceded by Qing Empire in the aftermath of the war in 1842 and established as a Crown colony in 1843. The colony expanded to the Kowloon Peninsula in 1860 after the Second Opium War and was further extended when the UK obtained a 99-year lease of the New Territories in 1898.');
INSERT INTO public.ter_territory VALUES (189, 4, 3, 'SC', 'SYC', 'Seychelles', 'Republic of Seychelles', 1976, NULL, NULL, NULL, 'Seychelles was uninhabited prior to being encountered by Europeans in the 16th century. It faced competing French and British interests until coming under full British control in the late 18th century. Since proclaiming independence from the United Kingdom in 1976, it has developed from a largely agricultural society to a market-based diversified economy, characterized by rapidly rising service, public sector, and tourism activities');
INSERT INTO public.ter_territory VALUES (414, 4, 5, NULL, NULL, 'Seychelles, British Colony', 'Crown Colony of the Seychelles', 1903, 1976, 224, '189', 'Seychellois officials wanted Seychelles to organized as a separate autonomous colony within the British Empire, and the authorities in the mother colony, Mauritius, supported them. Concessions were made, but Seychelles did not become a Crown Colony in its own right until 1903.');
INSERT INTO public.ter_territory VALUES (263, 6, 3, 'CS', 'CSK', 'Czechoslovakia', 'Czechoslovak Socialist Republic', 1918, 1992, NULL, '57,192', 'Czechoslovakia, or Czecho-Slovakia, was founded in October 1918, when it declared its independence from the Austro-Hungarian Empire. It existed until its peaceful dissolution into the Czech Republic and Slovakia on 1 January 1993.
INSERT INTO public.ter_territory VALUES (57, 6, 3, 'CZ', 'CZE', 'Czech Republic', 'Czech Republic', 1993, NULL, NULL, NULL, 'The Czech Republic, also known by its short-form name, Czechia, was founded on 1 January 1993 when Czechoslovakia was split into its constituent states, the Czech Republic and Slovakia.');
INSERT INTO public.ter_territory VALUES (67, 4, 3, 'ER', 'ERI', 'Eritrea', 'State of Eritrea', 1993, NULL, NULL, NULL, 'The Eritrean War of Independence started in 1962 and went on for 30 years against successive Ethiopian governments until 1991, when the Eritrean People''s Liberation Front (EPLF) defeated the Ethiopian forces in Eritrea.
INSERT INTO public.ter_territory VALUES (298, 2, 2, NULL, NULL, 'Eastern Caribbean States', 'Organisation of Eastern Caribbean States', 1981, NULL, NULL, NULL, 'The Organisation of Eastern Caribbean States is an inter-governmental organisation dedicated to economic harmonisation and integration, protection of human and legal rights, and the encouragement of good governance between countries and territories in the Eastern Caribbean.
INSERT INTO public.ter_territory VALUES (371, 5, 3, NULL, NULL, 'Transcaucasian Federation', 'Transcaucasian Democratic Federative Republic', 1918, 1918, NULL, '369,372,373', 'An independent state was proclaimed on 22 April as the TDFR.
INSERT INTO public.ter_territory VALUES (372, 5, 3, NULL, NULL, 'Azerbaijan ', 'Azerbaijan Soviet Socialist Republic', 1918, 1922, NULL, '370', 'The Azerbaijan Democratic Republic was founded by the Azerbaijani National Council in Tiflis on 28 May 1918 after the collapse of the Russian Empire. The Azerbaijan Democratic Republic was occupied on 28 April 1920 by the Soviet red Army and it became the Azerbaijan Soviet Socialist Republic. In December 1922, the Transcaucasian SFSR became part of the newly established Soviet Union, incorporating the Azerbaijan SSR,  along with the Armenian SSR and the Georgian SSR.');
INSERT INTO public.ter_territory VALUES (275, 6, 3, 'CS', 'CSG', 'Yugoslavia / Serbia and Montenegro', 'Federal Republic of Yugoslavia / State Union of Serbia and Montenegro', 1992, 2006, NULL, '250,248', 'After the disolution of the Socialist Federal Republic of Yugoslavia after its breakup in 1992, the republics of Montenegro and Serbia formed a reduced federative state, known officially until 2003 as the </b>Federal Republic of Yugoslavia</b>.
INSERT INTO public.ter_territory VALUES (27, 6, 3, 'BA', 'BIH', 'Bosnia and Herzegovina', 'Bosnia and Herzegovina', 1992, NULL, NULL, NULL, 'Bosnia and Herzegovina was part of the Kingdom of Yugoslavia and after World War II, it was granted full republic status in the newly formed Socialist Federal Republic of Yugoslavia. Following the dissolution of Yugoslavia, the republic proclaimed independence in 1992, which was followed by the Bosnian War, lasting until late 1995 with the Dayton Agreement');
INSERT INTO public.ter_territory VALUES (125, 6, 3, 'MK', 'MKD', 'Macedonia, North', 'Republic of North Macedonia', 1991, NULL, NULL, NULL, 'It was a constituent state of communist Yugoslavia until its peaceful secession on  8 September 1991. The country became a member of the United Nations in April 1993, but as a result of a dispute with Greece over the name "Macedonia", it was admitted under the provisional description "the former Yugoslav Republic of Macedonia"(abbreviated as "FYR Macedonia" or "FYROM"). In June 2018, Macedonia and Greece resolved the dispute with an agreement that the country should rename itself "Republic of North Macedonia". This renaming came into effect in February 2019.');
INSERT INTO public.ter_territory VALUES (364, 6, 4, NULL, NULL, 'Republic of Srpska', 'Republic of Srpska', 1992, 1995, 27, '27', 'The Republika Srpska was a proto-state  under the control of the Army of Republika Srpska during the Bosnian War. It claimed to be a sovereign state, though this claim was not recognized by the Bosnian government, the United Nations, or any other recognized state. For the first few months of its existence, it was known as the Serbian Republic of Bosnia and Herzegovina.
INSERT INTO public.ter_territory VALUES (365, 6, 4, NULL, NULL, 'Krajina', 'Republic of Serbian Krajina', 1991, 1995, 54, '54', 'The Republic of Serbian Krajina, known as the Serbian Krajina or simply Krajina, was a self-proclaimed Serb proto-state, a territory within the newly independent Croatia (formerly part of Yugoslavia), which it defied, and which was active during the Croatian War (1991–95). It was not recognized internationally. The name Krajina ("Frontier") was adopted from the historical Military Frontier of the Habsburg Monarchy and Austria-Hungary.
INSERT INTO public.ter_territory VALUES (399, 2, 2, NULL, NULL, 'British West Indies', 'British West Indies', 1674, 1965, 224, '298', 'The British West Indies is a collective term for the British territories historically established in the Anglo-Caribbean: Anguilla, the Cayman Islands, Turks and Caicos Islands, Montserrat, the British Virgin Islands, Antigua and Barbuda, The Bahamas, Barbados, Dominica, Grenada, Jamaica, Saint Kitts and Nevis, Saint Lucia, Saint Vincent and the Grenadines, British Guiana (now Guyana) and Trinidad and Tobago. Other territories include Bermuda, and the former British Honduras (now Belize). Before the decolonisation period in the later 1950s and 1960s the term was used to include all British colonies in the region as part of the British Empire.
INSERT INTO public.ter_territory VALUES (238, 4, 3, 'ZW', 'ZWE', 'Zimbabwe', 'Republic of Zimbabwe', 1980, NULL, NULL, NULL, 'Since the 11th century, present-day Zimbabwe has been the site of several organised states and kingdoms such as the Rozvi and Mthwakazi kingdoms, as well as being a major route for migration and trade. The British South Africa Company of Cecil Rhodes first demarcated the present territory during 1890 when they conquered Mashonaland and later in 1893 Matabeleland after a fierce resistance by Matabele people known as the First Matabele War. Company rule ended in 1923 with the establishment of Southern Rhodesia as a self-governing British colony. In 1965, the conservative white minority government unilaterally declared independence as Rhodesia. The state endured international isolation and a 15-year guerrilla war with black nationalist forces; this culminated in a peace agreement that established universal enfranchisement and de jure sovereignty as Zimbabwe in April 1980. Zimbabwe then joined the Commonwealth of Nations, from which it was suspended in 2002 for breaches of international law by its then-government under Robert Mugabe, and from which it withdrew in December 2003.');
INSERT INTO public.ter_territory VALUES (14, 6, 3, 'AT', 'AUT', 'Austria', 'Republic of Austria', 1918, NULL, NULL, NULL, 'After the defeat and the dissolution of the Austria-Hungary Monarchy, the Republic of German-Austria was proclaimed with the intent of the union with Germany, which eventually failed because of the Allied Powers and the state remained unrecognized. In 1919 the First Austrian Republic became the legal successor of Austria. In 1938, the Austrian-born Adolf Hitler, achieved the annexation of Austria by the "Anschluss". Following the defeat of Nazi Germany in 1945 and an extended period of Allied occupation, Austria was re-established as a sovereign and self-governing democratic nation known as the Second Republic.');
INSERT INTO public.ter_territory VALUES (367, 6, 3, NULL, NULL, 'Austria-Hungary', 'Austro-Hungarian Monarchy', 1867, 1918, NULL, '14,98,263,284', 'Austria-Hungary, the Austro-Hungarian Empire or the Dual Monarchy, was a constitutional monarchy and great power in Central Europe between 1867 and 1918. It was formed with the Austro-Hungarian Compromise on 30 March 1867 in the aftermath of the Austro-Prussian War. It consisted of two monarchies (Austria and Hungary), and one autonomous region: the Kingdom of Croatia-Slavonia under the Hungarian crown. After 1878, Bosnia and Herzegovina came under Austro-Hungarian military and civilian rule until it was fully annexed in 1908.
INSERT INTO public.ter_territory VALUES (98, 6, 3, 'HU', 'HUN', 'Hungary', 'Republic of Hungary', 1918, NULL, NULL, NULL, 'The Austro-Hungarian Empire collapsed after World War I, and the subsequent Treaty of Trianon established Hungary''s current borders, resulting in the loss of 71% of its territory, 58% of its population, and 32% of ethnic Hungarians. 
INSERT INTO public.ter_territory VALUES (6, 4, 3, 'AO', 'AGO', 'Angola', 'Republic of Angola', 1975, NULL, NULL, NULL, 'After a anti-colonial struggle, independence was achieved in 1975 as the Marxist–Leninist People''s Republic of Angola, a one-party state supported by the Soviet Union and Cuba. A civil war was started with the support to the opposing movement from the US and South Africa.
INSERT INTO public.ter_territory VALUES (217, 5, 3, 'TR', 'TUR', 'Turkey', 'Republic of Turkey', 1923, NULL, NULL, NULL, 'After the Ottomans and the other Central Powers lost World War I, the territories and peoples that had composed the Ottoman Empire were partitioned into several new states.[The Turkish War of Independence, initiated by Mustafa Kemal Atatürk against the occupying Allied Powers, resulted in the abolition of the sultanate on 1 November 1922, the replacement of the Treaty of Sèvres (1920) with the Treaty of Lausanne (1923), and the establishment of the Republic of Turkey on 29 October 1923, with Atatürk as its first president.');
INSERT INTO public.ter_territory VALUES (373, 5, 3, NULL, NULL, 'Georgia', 'Georgian Soviet Socialist Republic', 1918, 1922, NULL, '370', 'The Democratic Republic of Georgia existed from May 26, 1918 to February 1921 and was the first modern establishment of a republic of Georgia.
INSERT INTO public.ter_territory VALUES (103, 5, 3, 'IQ', 'IRQ', 'Iraq', 'Republic of Iraq', 1932, NULL, NULL, NULL, 'The country today known as Iraq was a region of the Ottoman Empire until the partition of the Ottoman Empire in the 20th century. It was made up of three provinces, called vilayets in the Ottoman Turkish language: Mosul Vilayet, Baghdad Vilayet, and Basra Vilayet. In April 1920 the British Mandate of Mesopotamia was created under the authority of the League of Nations. A British-backed monarchy joining these vilayets into one Kingdom was established in 1921 under Faisal I of Iraq. The Hashemite Kingdom of Iraq gained independence from the UK in 1932. In 1958, the monarchy was overthrown and the Iraqi Republic created. Iraq was controlled by the Arab Socialist Ba''ath Party from 1968 until 2003.');
INSERT INTO public.ter_territory VALUES (1, 5, 3, 'AF', 'AFG', 'Afghanistan', 'Islamic Republic of Afghanistan', 1919, NULL, NULL, NULL, 'In the First Anglo-Afghan War, the British East India Company seized control of Afghanistan briefly, but following the Third Anglo-Afghan War in 1919 the country became a monarchy under Amanullah Khan. Almost 50 years later the last king was overthrown and a republic was established. In 1978, after a second coup, Afghanistan first became a socialist state and then a Soviet protectorate, evoking the Soviet–Afghan War in the 1980s against mujahideen rebels. By 1996, most of the country was captured by the Islamic fundamentalist Taliban, who ruled as a totalitarian regime for over five years; they were removed from power after the US invasion in 2001 but still control a significant portion of the country. ');
INSERT INTO public.ter_territory VALUES (102, 5, 3, 'IR', 'IRN', 'Iran', 'Islamic Republic of Iran', -247, NULL, NULL, NULL, 'Iran, also known as Persia, is home to one of the world''s oldest civilizations, beginning with the formation of the Elamite kingdoms in the fourth millennium BC. It was first unified by the Iranian Medes in the seventh century BC and reached its territorial height in the sixth century BC, when Cyrus the Great founded the Achaemenid Empire, which stretched from Eastern Europe to the Indus River, making it one of the largest empires in history. The empire fell to Alexander the Great in the fourth century BC and was divided into several Hellenistic states. An Iranian rebellion established the Parthian Empire in the third century BC, which was succeeded in the third century AD by the Sasanian Empire, a major world power for the next four centuries. 
INSERT INTO public.ter_territory VALUES (141, 5, 3, 'MN', 'MNG', 'Mongolia', 'Mongolia', 1921, NULL, NULL, NULL, 'After the collapse of the Qing dynasty in 1911, Mongolia declared independence, and achieved actual independence from the Republic of China in 1921. Shortly thereafter, the country came under the control of the Soviet Union, which had aided its independence from China. In 1924, the Mongolian People''s Republic was founded as a socialist state. After the anti-Communist revolutions of 1989, Mongolia conducted its own peaceful democratic revolution in early 1990. This led to a multi-party system, a new constitution of 1992, and transition to a market economy.');
INSERT INTO public.ter_territory VALUES (209, 5, 3, 'TJ', 'TJK', 'Tajikistan', 'Republic of Tajikistan', 1991, NULL, NULL, NULL, 'The region was conquered in the 19th century by the Russian Empire and subsequently by the Soviet Union. Within the Soviet Union, the country''s modern borders were drawn when it was part of Uzbekistan as an autonomous republic before becoming a full-fledged Soviet republic in 1929.
INSERT INTO public.ter_territory VALUES (139, 6, 3, 'MD', 'MDA', 'Moldova', 'Republic of Moldova', 1991, NULL, NULL, NULL, 'In 1812 the Principality of Moldavia was ceded to the Russian Empire by the Ottoman Empire and became known as Bessarabia. In 1856, southern Bessarabia was returned to Moldavia, which three years later united with Wallachia to form Romania, but Russian rule was restored over the whole of the region in 1878. During the 1917 Russian Revolution, Bessarabia briefly became an autonomous state within the Russian Republic, known as the Moldavian Democratic Republic. In February 1918, the Moldavian Democratic Republic declared independence and then integrated into Romania later that year following a vote of its assembly. The decision was disputed by Soviet Russia, which in 1924 established, within the Ukrainian SSR, a Moldavian autonomous republic on partially Moldovan-inhabited territories to the east of Bessarabia.
INSERT INTO public.ter_territory VALUES (25, 5, 3, 'BT', 'BTN', 'Bhutan', 'Kingdom of Bhutan', 1634, NULL, NULL, NULL, 'The historical origins of Bhutan are unclear. Until the early 17th century, Bhutan existed as a patchwork of minor warring fiefdoms, when the area was unified by the Tibetan lama and military leader Ngawang Namgyal.');
INSERT INTO public.ter_territory VALUES (114, 5, 3, 'KG', 'KGZ', 'Kyrgyzstan', 'Kyrgyz Republic', 1991, NULL, NULL, NULL, 'Inhabited by a succession of tribes and clans, Kyrgyzstan has periodically fallen under domination of different kingdoms and empires . In 1876, it became part of the Russian Empire, remaining in the USSR as the Kirghiz Soviet Socialist Republic after the Russian Revolution. Following the democratic reforms in the USSR, in 1990 pro-independence candidate Askar Akayev was elected president. On 31 August 1991, Kyrgyzstan declared independence from Moscow and a democratic government was established. ');
INSERT INTO public.ter_territory VALUES (11, 5, 3, 'AM', 'ARM', 'Armenia', 'Republic of Armenia', 1991, NULL, NULL, NULL, 'In 1918, following the Russian Revolution, all non-Russian countries declared their independence after the Russian Empire ceased to exist, leading to the establishment of the First Republic of Armenia. By 1920, the state was incorporated into the Transcaucasian Socialist Federative Soviet Republic, and in 1922 became a founding member of the Soviet Union. In 1936, the Transcaucasian state was dissolved, transforming its constituent states, including the Armenian Soviet Socialist Republic, into full Union republics. The modern Republic of Armenia became independent in 1991 during the dissolution of the Soviet Union.');
INSERT INTO public.ter_territory VALUES (80, 5, 3, 'GE', 'GEO', 'Georgia', 'Georgia', 1991, NULL, NULL, NULL, 'During the Civil War following the Russian Revolution in 1917, Georgia briefly became part of the Transcaucasian Federation and then emerged as an independent republic before the Russian army invasion in 1921. Soviet Georgia was incorporated into a new Transcaucasian Federation and became a founding republic of the Soviet Union in 1922. In 1936, the Transcaucasian Federation was dissolved and Georgia emerged as a Union Republic.
INSERT INTO public.ter_territory VALUES (237, 4, 3, 'ZM', 'ZMB', 'Zambia', 'Republic of Zambia', 1964, NULL, NULL, NULL, 'Originally inhabited by Khoisan peoples, the region was affected by the Bantu expansion of the thirteenth century. The British colonised the region into the British protectorates of Barotziland-North-Western Rhodesia and North-Eastern Rhodesia towards the end of the nineteenth century. These were merged in 1911 to form Northern Rhodesia. 
INSERT INTO public.ter_territory VALUES (96, 2, 3, 'HN', 'HND', 'Honduras', 'Republic of Honduras', 1838, NULL, NULL, NULL, 'Honduras was colonized by Spain in the 16th century. It became independent in 1821 and has since been a republic. It has endured much social strife and political instability, and remains one of the poorest countries in the Western Hemisphere. In 1960, the northern part of what was the Mosquito Coast was transferred from Nicaragua to Honduras by the International Court of Justice.');
INSERT INTO public.ter_territory VALUES (158, 5, 3, 'KP', 'PRK', 'Korea, North', 'Democratic People''s Republic of Korea', 1948, NULL, NULL, NULL, 'In 1910, Korea was annexed by Imperial Japan. At the Japanese surrender at the end of World War II in 1945, Korea was divided into two zones, with the north occupied by the Soviet Union and the south occupied by the United States. Negotiations on reunification failed, and in 1948, separate governments were formed: the socialist Democratic People''s Republic of Korea in the north, and the capitalist Republic of Korea in the south.
INSERT INTO public.ter_territory VALUES (38, 2, 3, 'CA', 'CAN', 'Canada', 'Canada', 1867, NULL, NULL, NULL, 'Beginning in the 16th century, British and French expeditions explored and later settled along the Atlantic coast. As a consequence of various armed conflicts, France ceded nearly all of its colonies in North America in 1763. In 1867, with the union of three British North American colonies through Confederation, Canada was formed as a federal dominion of four provinces. This began an accretion of provinces and territories and a process of increasing autonomy from the United Kingdom. This widening autonomy was highlighted by the Statute of Westminster 1931 and culminated in the Canada Act 1982, which severed the vestiges of legal dependence on the British Parliament.');
INSERT INTO public.ter_territory VALUES (10, 3, 3, 'AR', 'ARG', 'Argentina', 'Argentine Republic', 1816, NULL, NULL, NULL, 'The country has its roots in Spanish colonization of the region during the 16th century. Argentina rose as the successor state of the Viceroyalty of the Río de la Plata, a Spanish overseas viceroyalty founded in 1776. The declaration for independence (9 July 1816) was followed by an extended civil war that lasted until 1861, culminating in the country''s reorganization as a federation of provinces with Buenos Aires as its capital city.');
INSERT INTO public.ter_territory VALUES (291, 5, 4, NULL, NULL, 'Artsakh', 'Republic of Artsakh / Nagorno-Karabakh Republic', 1991, NULL, 15, NULL, 'The predominantly Armenian-populated region of Nagorno-Karabakh was claimed by both the Azerbaijan Democratic Republic and the First Republic of Armenia when both countries became independent in 1918 after the fall of the Russian Empire, and a brief war over the region broke out in 1920. The dispute was largely shelved after the Soviet Union established control over the area, and created the Nagorno-Karabakh Autonomous Oblast (NKAO) within the Azerbaijan SSR in 1923. During the fall of the Soviet Union, the region re-emerged as a source of dispute between Armenia and Azerbaijan. In 1991, a referendum held in the NKAO and the neighbouring Shahumian region resulted in a declaration of independence. Ethnic conflict led to the 1991–1994 Nagorno-Karabakh War. Conflict has sporadically broken out since then.');
INSERT INTO public.ter_territory VALUES (370, 5, 5, NULL, NULL, 'Transcaucasian Soviet Republic', 'Transcaucasian Socialist Federative Soviet Republic', 1922, 1936, 280, '280', 'The TSFSR comprised Armenia, Azerbaijan and Georgia, traditionally known as the "Transcaucasian Republics" as they were separated from Russia by the Caucasus Mountains. It was a republic of the Soviet Union  from 1922 to 1936. The TSFSR was dissolved upon the adoption of the 1936 Soviet Constitution and its constituent republics were elevated individually to republics of the Soviet Union.');
INSERT INTO public.ter_territory VALUES (116, 6, 3, 'LV', 'LVA', 'Latvia', 'Republic of Latvia', 1990, NULL, NULL, NULL, 'Latvia had been an independent state between 1918 and 1940, when it was incorporated into the Soviet Union. 
INSERT INTO public.ter_territory VALUES (377, 6, 3, NULL, NULL, 'Ukraine', 'Ukrainian National Republic', 1918, 1922, NULL, '280', 'The Ukrainian People''s Republic (UPR), or Ukrainian National Republic (UNR), was declared in Ukraine following the February Revolution in Russia in 1917. It initially formed part of the Russian Republic, and proclaimed its independence from the Russian Soviet Republic on 25 January 1918.
INSERT INTO public.ter_territory VALUES (374, 6, 3, NULL, NULL, 'Estonia', 'Estonia', 1920, 1939, NULL, '280', 'After centuries of successive rule by Germans, Danes, Swedes, Poles and Russians, a distinct Estonian national identity began to emerge in the 19th and early 20th centuries. This culminated in independence from Russia in 1920 after a brief War of Independence at the end of World War I. Initially democratic prior to the Great Depression, Estonia experienced authoritarian rule from 1934 during the Era of Silence. During World War II (1939–1945), Estonia was repeatedly contested and occupied by the Soviet Union and Germany, ultimately being incorporated into the former. On 6 August 1940, Estonia was annexed by the Soviet Union as the Estonian SSR.');
INSERT INTO public.ter_territory VALUES (375, 6, 3, NULL, NULL, 'Latvia', 'Republic of Latvia', 1918, 1940, NULL, '280', 'After centuries of Swedish, Polish-Lithuanian and Russian rule, a rule mainly executed by the Baltic German aristocracy, the Republic of Latvia was established on 18 November 1918 when it broke away from the Russian Empire and declared independence in the aftermath of World War I.
INSERT INTO public.ter_territory VALUES (344, 4, 5, NULL, NULL, 'West Africa, French', 'French West Africa', 1895, 1958, 74, '53,90,395,134,154,188,264,279', 'French West Africa was a federation of eight French colonial territories in Africa: Mauritania, Senegal, French Sudan (now Mali), French Guinea (now Guinea), Ivory Coast, Upper Volta (now Burkina Faso), Dahomey (now Benin) and Niger. The federation existed from 1895 until 1958. Its capital was Saint-Louis, Senegal until 1902, and then Dakar until the federation''s collapse in 1958.');
INSERT INTO public.ter_territory VALUES (376, 6, 3, NULL, NULL, 'Lithuania', 'Republic of Lithuania', 1918, 1940, NULL, '280', 'In 1569, Lithuania and Poland formed a voluntary two-state personal union, the Polish–Lithuanian Commonwealth. The Commonwealth lasted more than two centuries, until neighbouring countries dismantled it between 1772 and 1795, with the Russian Empire annexing most of Lithuania''s territory.
INSERT INTO public.ter_territory VALUES (215, 2, 3, 'TT', 'TTO', 'Trinidad and Tobago', 'Republic of Trinidad and Tobago', 1962, NULL, NULL, NULL, 'The island of Trinidad became a colony in the Spanish Empire, following the arrival of Christopher Columbus in 1498. In 1797 it was surrendered to a British fleet. During the same period, the island of Tobago changed hands among Spanish, British, French, Dutch and Courlander colonisers. Trinidad and Tobago were ceded to Britain in 1802 under the Treaty of Amiens as separate states and unified in 1889. Trinidad and Tobago obtained independence on August 31, 1962, becoming a republic in 1976.');
INSERT INTO public.ter_territory VALUES (20, 6, 3, 'BY', 'BLR', 'Belarus', 'Republic of Belarus', 1991, NULL, NULL, NULL, 'Until the 20th century, different states at various times controlled the lands of modern-day Belarus, including Kievan Rus'', the Principality of Polotsk, the Grand Duchy of Lithuania, the Polish–Lithuanian Commonwealth, and the Russian Empire. After the Russian Revolution in 1917, different states arose competing for legitimacy amidst the Civil War, ultimately ending in the rise of the Byelorussian SSR, which became a founding constituent republic of the Soviet Union in 1922. After the Polish-Soviet War, Belarus lost almost half of its territory to Poland. Much of the borders of Belarus took their modern shape in 1939, when some lands of the Second Polish Republic were reintegrated into it after the Soviet invasion of Poland. 
INSERT INTO public.ter_territory VALUES (186, 4, 3, 'ST', 'STP', 'Sao Tome and Principe', 'Democratic Republic of Sao Tome and Principe', 1975, NULL, NULL, NULL, 'The islands were uninhabited until their discovery by Portuguese explorers in the 15th century. Gradually colonized and settled by the Portuguese throughout the 16th century, they collectively served as a vital commercial and trade center for the Atlantic slave trade. Cycles of social unrest and economic instability throughout the 19th and 20th centuries culminated in peaceful independence in 1975. São Tomé and Príncipe has since remained one of Africa''s most stable and democratic countries.');
INSERT INTO public.ter_territory VALUES (222, 6, 3, 'UA', 'UKR', 'Ukraine', 'Ukraine', 1991, NULL, NULL, NULL, 'On 16 July 1990, the Ukrainian parliament adopted the Declaration of State Sovereignty of Ukraine. This established the principles of the self-determination, democracy, independence, and the priority of Ukrainian law over Soviet law. In August 1991, a faction among the Communist leaders of the Soviet Union attempted a coup to remove Mikhail Gorbachev and to restore the Communist party''s power. After it failed, on 24 August 1991 the Ukrainian parliament adopted the Act of Independence.');
INSERT INTO public.ter_territory VALUES (304, 6, 4, NULL, NULL, 'Tatarstan', 'Republic of Tatarstan', 1990, 1994, 177, NULL, 'The Republic of Tatarstan is a federal subject (a republic) of the Russian Federation, located in the Volga Federal District. 
INSERT INTO public.ter_territory VALUES (177, 6, 3, 'RU', 'RUS', 'Russia', 'Russian Federation', 1991, NULL, NULL, NULL, 'Following the dissolution of the Soviet Union in 1991, the Russian SFSR reconstituted itself as the Russian Federation and is recognised as the continuing legal personality and a successor of the Soviet Union. Following the constitutional crisis of 1993, a new constitution was adopted, and Russia has since been governed as a federal semi-presidential republic');
INSERT INTO public.ter_territory VALUES (379, 5, 5, NULL, NULL, 'Khakassia', 'Republic of Khakassia', 1991, NULL, 177, NULL, 'Until 1991, Khakas Autonomous Oblast was administratively subordinated to Krasnoyarsk Krai. In July 1991, it was elevated in status to that of a Soviet socialist republic, and in February 1992 it became the Republic of Khakassia.');
INSERT INTO public.ter_territory VALUES (43, 3, 3, 'CL', 'CHL', 'Chile', 'Republic of Chile', 1818, NULL, NULL, NULL, 'Spain conquered and colonized the region in the mid-16th century, replacing Inca rule, but failing to conquer the independent Mapuche who inhabited what is now south-central Chile. After declaring independence from Spain in 1818, Chile emerged in the 1830s as a relatively stable authoritarian republic. In the 19th century, Chile saw significant economic and territorial growth, ending Mapuche resistance in the 1880s and gaining its current northern territory in the War of the Pacific (1879–83) after defeating Peru and Bolivia. In 1973 a coup overthrew Salvador Allende''s democratically elected left-wing government and instituted a 16-year right-wing military dictatorship led by Augusto Pinochet. The regime ended in 1990 after a referendum in 1988.');
INSERT INTO public.ter_territory VALUES (92, 3, 3, 'GY', 'GUY', 'Guyana', 'Co-operative Republic of Guyana', 1966, NULL, NULL, NULL, 'Historically dominated by the Lokono and Kalina tribes, Guyana was colonised by the Dutch before coming under British control in the late 18th century. It was governed as British Guiana, with a mostly plantation-style economy until the 1950s. It gained independence in 1966, and officially became a republic within the Commonwealth of Nations in 1970');
INSERT INTO public.ter_territory VALUES (47, 3, 3, 'CO', 'COL', 'Colombia', 'Republic of Colombia', 1810, NULL, NULL, NULL, 'The Spanish landed first in La Guajira in 1499 and by the mid-16th century annexed part of the region, establishing the New Kingdom of Granada, with Santa Fé de Bogotá as its capital. Independence from Spain was achieved in 1810, with what is now Colombia emerging as the United Provinces of New Granada. The new nation experimented with federalism as the Granadine Confederation (1858), and then the United States of Colombia (1863), before the Republic of Colombia was finally declared in 1886. Panama seceded in 1903, leading to Colombia''s present borders.');
INSERT INTO public.ter_territory VALUES (346, 4, 5, NULL, NULL, 'Gambia, British', 'Gambia Colony and Protectorate', 1821, 1965, 224, '79', NULL);
INSERT INTO public.ter_territory VALUES (326, 7, 5, NULL, NULL, 'Samoa, German', 'German Samoa', 1900, 1914, 81, '325', NULL);
INSERT INTO public.ter_territory VALUES (323, 5, 5, NULL, NULL, 'Korea, Japanese ', 'Japanese Korea', 1910, 1945, 108, '158,198', NULL);
INSERT INTO public.ter_territory VALUES (353, 4, 5, NULL, NULL, 'Kenya, British', 'Colony and Protectorate of Kenya', 1920, 1963, 224, '111', NULL);
INSERT INTO public.ter_territory VALUES (380, 5, 3, NULL, NULL, 'Ottoman Empire', 'The Sublime Ottoman State', 1299, 1922, NULL, '217', 'The Ottoman Empire was a state that controlled much of Southeastern Europe, Western Asia, and Northern Africa between the 14th and early 20th centuries.
INSERT INTO public.ter_territory VALUES (227, 3, 3, 'UY', 'URY', 'Uruguay', 'Oriental Republic of Uruguay', 1825, NULL, NULL, NULL, ' Uruguay was colonized by Europeans relatively late compared with neighbouring countries. The name of the namesake river comes from the Spanish pronunciation of the regional Guarani word for it. Montevideo was founded as a military stronghold by the Spanish in the early 18th century. Uruguay won its independence between 1811 and 1828, following a four-way struggle between Portugal and Spain, and later Argentina and Brazil. The independence from the Empire of Brazil was declared on declared independence on 25 August 1825.');
INSERT INTO public.ter_territory VALUES (167, 3, 3, 'PY', 'PRY', 'Paraguay', 'Republic of Paraguay', 1811, NULL, NULL, NULL, 'Spanish conquistadores arrived in 1524, and in 1537 established the city of Asunción, the first capital of the Governorate of the Río de la Plata. Following independence from Spain in the early 19th century, Paraguay was ruled by a series of authoritarian governments characterized by nationalist, isolationist and protectionist policies. This period ended with the disastrous Paraguayan War (1864–70), during which the country lost half its prewar population and around 25–33% of its territory to the Triple Alliance of Argentina, Brazil and Uruguay. In the 20th century, Paraguay faced another major international conflict—the Chaco War (1932–35) against Bolivia—in which it prevailed. Afterwards, the country came under a succession of military dictatorships, culminating with the 35-year regime of Alfredo Stroessner, which lasted until his overthrow in 1989 by an internal military coup. This marked the beginning of Paraguay''s democratic era.');
INSERT INTO public.ter_territory VALUES (107, 2, 3, 'JM', 'JAM', 'Jamaica', 'Jamaica', 1962, NULL, NULL, NULL, 'Originally inhabited by the indigenous Arawak and Taíno peoples, the island came under Spanish rule following the arrival of Christopher Columbus in 1494. The island remained a possession of Spain until 1655, when England (later Great Britain) conquered it, renaming it Jamaica. The island achieved independence from the United Kingdom on 6 August 1962.');
INSERT INTO public.ter_territory VALUES (230, 3, 3, 'VE', 'VEN', 'Venezuela', 'Bolivarian Republic of Venezuela', 1830, NULL, NULL, NULL, 'The territory of Venezuela was colonized by Spain in 1522 amid resistance from indigenous peoples. In 1811, it became one of the first Spanish-American territories to declare independence from the Spanish, and to form part, as a department, of the first federal Republic of Colombia (historiographically known as Gran Colombia). It separated as a full sovereign country in 1830.
INSERT INTO public.ter_territory VALUES (176, 6, 3, 'RO', 'ROU', 'Romania', 'Romania', 1877, NULL, NULL, NULL, 'Modern Romania was formed in 1859 through a personal union of the Danubian Principalities of Moldavia and Wallachia. The new state, officially named Romania since 1866, gained independence from the Ottoman Empire in 1877. Following the outbreak of World War I, after declaring its neutrality in 1914, Romania fought on the side of the Allied Powers beginning in 1916. Afterwards Bukovina, Bessarabia, Transylvania as well as parts of Banat, Crișana, and Maramureș became part of the sovereign Kingdom of Romania. In June–August 1940, as a consequence of the Molotov–Ribbentrop Pact and Second Vienna Award, Romania was compelled to cede Bessarabia and Northern Bukovina to the Soviet Union, and Northern Transylvania to Hungary. In November 1940, Romania signed the Tripartite Pact and, consequently, in June 1941 entered World War II on the Axis side, fighting against the Soviet Union until August 1944, when it joined the Allies and recovered Northern Transylvania. Following the war, under the occupation of the Red Army''s forces, Romania became a socialist republic and a member of the Warsaw Pact. After the 1989 Revolution, Romania began a transition towards democracy and a market economy.');
INSERT INTO public.ter_territory VALUES (126, 4, 3, 'MG', 'MDG', 'Madagascar', 'Republic of Madagascar', 1960, NULL, NULL, NULL, 'Beginning in the early 19th century, most of the island was united and ruled as the Kingdom of Madagascar by a series of Merina nobles. The monarchy ended in 1897 when the island was absorbed into the French colonial empire, from which the island gained independence in 1960.');
INSERT INTO public.ter_territory VALUES (91, 4, 3, 'GW', 'GNB', 'Guinea-Bissau', 'Republic of Guinea-Bissau', 1974, NULL, NULL, NULL, 'Guinea-Bissau was once part of the kingdom of Kaabu, as well as part of the Mali Empire. Parts of this kingdom persisted until the 18th century, while a few others were under some rule by the Portuguese Empire since the 16th century. In the 19th century, it was colonised as Portuguese Guinea. Upon independence, declared in 1973 and recognised in 1974, the name of its capital, Bissau, was added to the country''s name to prevent confusion with Guinea (formerly French Guinea)');
INSERT INTO public.ter_territory VALUES (221, 4, 3, 'UG', 'UGA', 'Uganda', 'Republic of Uganda', 1962, NULL, NULL, NULL, 'Uganda is named after the Buganda kingdom, which encompasses a large portion of the south of the country, including the capital Kampala. Beginning in 1894, the area was ruled as a protectorate by the UK, which established administrative law across the territory. Uganda gained independence from the UK on 9 October 1962. The period since then has been marked by violent conflicts, including an eight-year-long military dictatorship led by Idi Amin.');
INSERT INTO public.ter_territory VALUES (293, 4, 4, NULL, NULL, 'Somaliland ', 'Republic of Somaliland', 1991, NULL, 195, NULL, 'Somaliland is a self-declared country, internationally considered to be part of Somalia. The government of the de facto state of Somaliland regards itself as the successor state to the former British Somaliland protectorate, which, in the form of the briefly independent State of Somaliland, united as scheduled on 1 July 1960 with the Trust Territory of Somaliland (the former Italian Somaliland) to form the Somali Republic.
INSERT INTO public.ter_territory VALUES (381, 2, 5, NULL, NULL, 'Jamaica, British', 'Colony of Jamaica and Dependencies', 1655, 1958, 224, '408', 'Jamaica was an English colony from 1655 (when it was captured by the English from Spain), and a British Colony from 1707 until 1962, when it became independent. Jamaica became a Crown colony in 1866.');
INSERT INTO public.ter_territory VALUES (48, 4, 3, 'KM', 'COM', 'Comoros', 'Union of the Comoros', 1975, NULL, NULL, NULL, 'Comoros was first settled by Bantu speakers from East Africa, Arabs, and Austronesians. It then became part of the French colonial empire during the 19th century, before its independence in 1975. Since then, it has experienced more than 20 coups or attempted coups, with various heads of state assassinated. It was named Federal Islamic Republic of Comoros
INSERT INTO public.ter_territory VALUES (69, 4, 3, 'ET', 'ETH', 'Ethiopia', 'Federal Democratic Republic of Ethiopia', 1270, NULL, NULL, NULL, 'The Ethiopian Empire was founded in 1270 and lasted until 1974. It was also knows as Abyssinia.
INSERT INTO public.ter_territory VALUES (201, 4, 3, 'SD', 'SDN', 'Sudan', 'Republic of the Sudan', 1956, NULL, NULL, NULL, 'From the 19th century, the entirety of Sudan was conquered by the Muhammad Ali dynasty, which was then eventually met with a successful revolt led by the self-proclaimed Mahdi Muhammad Ahmad, resulting in the establishment of the Caliphate of Omdurman. This state was eventually toppled in 1898 by the British, who would then govern Sudan together with Egypt. In 1953 Britain granted Sudan self-government. Independence was proclaimed on 1 January 1956.
INSERT INTO public.ter_territory VALUES (55, 2, 3, 'CU', 'CUB', 'Cuba', 'Republic of Cuba', 1902, NULL, NULL, NULL, 'From the 15th century, Cuba was a colony of Spain until the Spanish–American War of 1898, when Cuba was occupied by the United States and gained nominal independence as a de facto United States protectorate in 1902. As a fragile republic, in 1940 Cuba attempted to strengthen its democratic system, but mounting political radicalization and social strife culminated in a coup and subsequent dictatorship under Fulgencio Batista in 1952. Open corruption and oppression under Batista''s rule led to his ousting in January 1959 by the 26th of July Movement, which afterwards established communist rule under the leadership of Fidel Castro. Since 1965, the state has been governed by the Communist Party of Cuba.');
INSERT INTO public.ter_territory VALUES (30, 3, 3, 'BR', 'BRA', 'Brazil', 'Federative Republic of Brazil', 1822, NULL, NULL, NULL, 'Brazil was claimed by Portugal after the landing in 1500 of explorer Pedro Álvares Cabral. Brazil remained a Portuguese colony until 1808 when the capital of the empire was transferred from Lisbon to Rio de Janeiro. In 1815, the colony was elevated to the rank of kingdom upon the formation of the United Kingdom of Portugal, Brazil and the Algarves. Independence was achieved in 1822 with the creation of the Empire of Brazil, a unitary state governed under a constitutional monarchy and a parliamentary system. The country became a presidential republic in 1889 following a military coup. An authoritarian military junta came to power in 1964 and ruled until 1985, after which civilian governance resumed. Brazil''s current constitution, formulated in 1988, defines it as a democratic federal republic.');
INSERT INTO public.ter_territory VALUES (202, 3, 3, 'SR', 'SUR', 'Suriname', 'Republic of Suriname', 1975, NULL, NULL, NULL, 'The Dutch established control over much of the country''s current territory by the late 17th century. In 1954, Suriname became one of the constituent countries of the Kingdom of the Netherlands. On 25 November 1975, Suriname left the Kingdom to become an independent state, nonetheless maintaining close economic, diplomatic, and cultural ties to its former colonizer.');
INSERT INTO public.ter_territory VALUES (26, 3, 3, 'BO', 'BOL', 'Bolivia', 'Republic of Bolivia', 1825, NULL, NULL, NULL, 'Spanish conquistadors took control of the region in the 16th century. Spain built its empire in large part upon the silver that was extracted from Bolivia''s mines. After the first call for independence in 1809, 16 years of war followed before the establishment of the Republic, named after Simón Bolívar. Over the course of the 19th and early 20th century Bolivia lost control of several peripheral territories to neighboring countries including the seizure of its coastline by Chile in 1879. Bolivia remained relatively politically stable until 1971, when Hugo Banzer led a CIA-supported coup which replaced the socialist government of Juan José Torres with a military dictatorship headed by Banzer. Banzer was ousted in 1978 and later returned as the democratically elected president of Bolivia from 1997 to 2001.');
INSERT INTO public.ter_territory VALUES (389, 4, 5, NULL, NULL, 'Kamerun', 'Kamerun', 1884, 1916, 280, '387,388', 'Kamerun was an African colony of the German Empire from 1884 to 1916 in the region of today''s Republic of Cameroon. Kamerun also included northern parts of Gabon and the Congo with western parts of the Central African Republic, southwestern parts of Chad and far eastern parts of Nigeria.');
INSERT INTO public.ter_territory VALUES (60, 2, 3, 'DM', 'DMA', 'Dominica', 'Commonwealth of Dominica', 1978, NULL, NULL, NULL, 'The island was settled by the Arawak arriving from South America in the 5th century. The Kalinago displaced the Arawak by the 15th century. Columbus is said to have passed the island on Sunday, 3 November 1493. It was later colonised by Europeans, predominantly by the French from the 1690s to 1763. The French imported enslaved people from West Africa to Dominica to work on coffee plantations. Great Britain took possession in 1763 after the Seven Years'' War, and it gradually established English as its official language. The island gained independence as a republic in 1978.');
INSERT INTO public.ter_territory VALUES (407, 2, 5, NULL, NULL, 'Dominica, British', 'Associated State of Dominica', 1962, 1978, 224, '60', 'Until 1958, Dominica was governed as part of the British Windward Islands. Caribbean islands sought independence from 1958 to 1962, and Dominica became a province of the short-lived West Indies Federation in 1958.[17][19] After the federation dissolved in 1962, Dominica became an associated state of the United Kingdom in 1967, and formally took responsibility for its internal affairs. On 3 November 1978, the Commonwealth of Dominica was granted independence as a republic');
INSERT INTO public.ter_territory VALUES (416, 4, 5, NULL, NULL, 'Comoros, French', 'State of Comoros', 1946, 1975, 74, '48', 'The Comoro islands were a dependency of the Colony of Madagascar from 9 April 1908 until 27 October 1946, when it became a French Overseas Territory. It was renamed as State of Comoros on 22 December 1961 and it achieved independence from France on 6 July 1975.');
INSERT INTO public.ter_territory VALUES (249, 5, 4, 'PS', 'PSE', 'Palestine', 'State of Palestine', 1988, NULL, 105, NULL, 'On 15 November 1988 in Algiers, Yasser Arafat, Chairman of the Palestine Liberation Organization (PLO), proclaimed the establishment of the State of Palestine. A year after the signing of the Oslo Accords in 1993, the Palestinian National Authority was formed to govern the areas A and B in the West Bank, comprising 165 "islands", and the Gaza Strip. Gaza would later be governed by Hamas in 2007, two years after the Israeli disengagement from Gaza.
INSERT INTO public.ter_territory VALUES (93, 2, 3, 'HT', 'HTI', 'Haiti', 'Republic of Haiti', 1804, NULL, NULL, NULL, 'The first Europeans arrived on 5 December 1492 during the first voyage of Christopher Columbus. Columbus subsequently founded the first European settlement in the Americas, La Navidad, on what is now the northeastern coast of Haiti. The island was claimed by Spain and named La Española, forming part of the Spanish Empire until the early 17th century. However, competing claims and settlements by the French led to the western portion of the island being ceded to France in 1697, which was subsequently named Saint-Domingue.
INSERT INTO public.ter_territory VALUES (16, 2, 3, 'BS', 'BHS', 'Bahamas', 'Commonwealth of The Bahamas', 1973, NULL, NULL, NULL, 'Columbus was the first European to see the islands, making his first landfall in the ''New World'' in 1492. The Spanish enslaved and shipped the native Lucayans to Hispaniola, after which the Bahama islands were mostly deserted from 1513 until 1648, when English colonists from Bermuda settled on the island of Eleuthera.
INSERT INTO public.ter_territory VALUES (22, 2, 3, 'BZ', 'BLZ', 'Belize', 'Belize', 1981, NULL, NULL, NULL, 'European contact began in 1492 when Christopher Columbus sailed along the Gulf of Honduras. European exploration was begun by English settlers in 1638. This period was also marked by Spain and Britain both laying claim to the land until Britain defeated the Spanish in the Battle of St. George''s Caye (1798). It became a British colony in 1840, known as British Honduras, and a Crown colony in 1862. Independence was achieved from the United Kingdom on 21 September 1981.');
INSERT INTO public.ter_territory VALUES (19, 2, 3, 'BB', 'BRB', 'Barbados', 'Barbados', 1966, NULL, NULL, NULL, 'Barbados was visited by Spanish navigators in the late 15th century and claimed for the Spanish Crown. The Portuguese Empire claimed the island between 1532 and 1536, but later abandoned it in 1620. An English ship, the Olive Blossom, arrived in Barbados on 14 May 1625; its men took possession of it in the name of King James I. In 1627, the first permanent settlers arrived from England, and it became an English and later British colony. 
INSERT INTO public.ter_territory VALUES (400, 4, 5, NULL, NULL, 'Sao Tome and Principe, Portuguese', 'Portuguese São Tomé and Príncipe', 1485, 1975, 172, '186', 'The Portuguese explorers João de Santarém and Pêro Escobar discovered the islands around 1470, which they found uninhabited. The São Tomé island was named by the Portuguese in honor of Saint Thomas, as they discovered the island on his feast day, while the Príncipe island (Prince''s island) was named in honor of Afonso, Prince of Portugal.
INSERT INTO public.ter_territory VALUES (220, 7, 3, 'TV', 'TUV', 'Tuvalu', 'Tuvalu', 1978, NULL, NULL, NULL, 'In 1568, Spanish navigator Álvaro de Mendaña became the first European to sail through the archipelago, sighting the island of Nui during an expedition he was making in search of Terra Australis. The island of Funafuti was named Ellice''s Island in 1819. Later, after the work of English hydrographer Alexander George Findlay, the name Ellice began to be applied to the whole nine-island group. In the late 19th century, Great Britain claimed control over the Ellice Islands, designating them as within their sphere of influence as the result of a treaty between Great Britain and Germany that demarcated their respective spheres of influence in the Pacific Ocean. Britain assigned a resident commissioner to administer the Ellice Islands as part of the British Western Pacific Territories (BWPT). From 1916 to 1975, they were managed as part of the Gilbert and Ellice Islands colony.
INSERT INTO public.ter_territory VALUES (385, 5, 3, NULL, NULL, 'Yemen, North', 'Yemen Arab Republic', 1962, 1990, NULL, '236', NULL);
INSERT INTO public.ter_territory VALUES (41, 4, 3, 'CF', 'CAF', 'Central African Republic', 'Central African Republic', 1960, NULL, NULL, NULL, 'The country''s current borders were established by France, which ruled the country as a colony starting in the late 19th century. After gaining independence from France in 1960, the Central African Republic was ruled by a series of autocratic leaders. Between 1976 and 1979 the country was renamed as  Central African Empire.');
INSERT INTO public.ter_territory VALUES (247, 4, 2, NULL, NULL, 'Central Africa Community', 'Economic and Monetary Community of Central Africa', 1993, NULL, NULL, NULL, 'The Economic and Monetary Community of Central Africa (or CEMAC from its name in French: Communauté Économique et Monétaire de l''Afrique Centrale) is an organization of states of Central Africa established by Cameroon, Central African Republic, Chad, Republic of Congo, Equatorial Guinea and Gabon to promote economic integration among countries that share a common currency, the CFA franc.');
INSERT INTO public.ter_territory VALUES (383, 5, 4, NULL, NULL, 'Burma, Japanese', 'State of Burma', 1942, 1945, 384, NULL, NULL);
INSERT INTO public.ter_territory VALUES (384, 5, 5, NULL, NULL, 'Burma, British', 'Colony of Burma', 1824, 1948, 224, '145', NULL);
INSERT INTO public.ter_territory VALUES (244, 4, 2, NULL, NULL, 'West African Union', 'West African Economic and Monetary Union', 1958, NULL, NULL, NULL, 'It was formerly a currency union established at the end of the French colonial period, in 1958, commonly known as <b>West African States</b>. The constituent territories were Mauritania, Senegal, Dahomey (Benin), French Sudan (Mali), Ivory Coast, Upper Volta (Burkina Faso), Niger and French Guinea (Guinea, which became independent in 1958 and decided to have its own currency). <br/>
INSERT INTO public.ter_territory VALUES (34, 4, 3, 'BF', 'BFA', 'Burkina Faso', 'Burkina Faso', 1984, NULL, NULL, NULL, 'Upper Volta was renamed "Burkina Faso" on 4 August 1984. The words "Burkina" and "Faso" both stem from different languages spoken in the country.');
INSERT INTO public.ter_territory VALUES (279, 4, 3, 'HV', 'HVO', 'Upper Volta', 'Republic of Upper Volta', 1960, 1984, NULL, '34', 'The Republic of Upper Volta was established on 11 December 1958 as a self-governing colony within the French Community and on 5 August 1960 it gained full independence. The country was renamed "Burkina Faso" on 4 August 1984 .');
INSERT INTO public.ter_territory VALUES (181, 2, 3, 'LC', 'LCA', 'Saint Lucia', 'Saint Lucia', 1979, NULL, NULL, NULL, 'The French were the first Europeans to settle on the island. They signed a treaty with the native Island Caribs in 1660. England took control of the island from 1663 to 1667. In ensuing years, it was at war with France fourteen times, and the rule of the island changed frequently (it was ruled seven times each by the French and British). In 1814, the British took definitive control of the island. 
INSERT INTO public.ter_territory VALUES (134, 4, 3, 'MR', 'MRT', 'Mauritania', 'Islamic Republic of Mauritania', 1958, NULL, NULL, NULL, 'The country derives its name from the ancient Berber kingdom of Mauretania. Mauritania became a French colony in the late 19th century. On  
INSERT INTO public.ter_territory VALUES (154, 4, 3, 'NE', 'NER', 'Niger', 'Republic of Niger', 1958, NULL, NULL, NULL, 'The country''s name comes from the Niger River; the origin of the river''s name is uncertain, though a popular theory is that it comes from the Tuareg n''eghirren, meaning ''flowing water''.
INSERT INTO public.ter_territory VALUES (264, 4, 3, 'DY', 'DHY', 'Dahomey', 'Republic of Dahomey', 1958, 1975, NULL, '23', 'The Republic of Dahomey was established on December 11, 1958, as a self-governing colony within the French Community. It became fully independent of France on 1 August 1960.
INSERT INTO public.ter_territory VALUES (90, 4, 3, 'GN', 'GIN', 'Guinea', 'Republic of Guinea', 1958, NULL, NULL, NULL, 'Formerly known as French Guinea, the modern country is sometimes referred to as Guinea-Conakry to distinguish it from other countries with "Guinea" in the name.
INSERT INTO public.ter_territory VALUES (130, 4, 3, 'ML', 'MLI', 'Mali', 'Republic of Mali', 1960, NULL, NULL, NULL, 'In the late 19th century, during the Scramble for Africa, France seized control of Mali, making it a part of French Sudan. French Sudan (then known as the Sudanese Republic) joined with Senegal in 1959, achieving independence in 1960 as the Mali Federation. Shortly thereafter, following Senegal''s withdrawal from the federation, the Sudanese Republic declared itself the independent Republic of Mali.');
INSERT INTO public.ter_territory VALUES (395, 4, 5, NULL, NULL, 'Sudanese Republic', 'Sudanese Republic', 1958, 1960, 74, '130', 'French Sudan was a French colonial territory in the Federation of French West Africa until 1958.  On 24 November 1958
INSERT INTO public.ter_territory VALUES (188, 4, 3, 'SN', 'SEN', 'Senegal', 'Republic of Senegal', 1958, NULL, NULL, NULL, 'It owes its name to the Senegal River, which probably derives from a Portuguese transliteration of the name of the Zenaga, also known as the Sanhaja.
INSERT INTO public.ter_territory VALUES (208, 5, 4, 'TW', 'TWN', 'Taiwan', 'Taiwan, Republic of China', 1945, NULL, 44, NULL, 'The island was annexed in 1683 by the Qing dynasty of China, and ceded to the Empire of Japan in 1895. The Republic of China, which had overthrown the Qing in 1911, took control of Taiwan on behalf of the World War II Allies following the surrender of Japan in 1945. The resumption of the Chinese Civil War resulted in the ROC''s loss of mainland China to forces of the Chinese Communist Party (CCP) and retreat to Taiwan in 1949. Its effective jurisdiction has since been limited to Taiwan and numerous smaller islands.');
INSERT INTO public.ter_territory VALUES (153, 2, 3, 'NI', 'NIC', 'Nicaragua', 'Republic of Nicaragua', 1838, NULL, NULL, NULL, 'The region was conquered by the Spanish Empire in the 16th century. Nicaragua gained independence from Spain in 1821, as part of the First Mexican Empire. After the monarchy of the First Mexican Empire was overthrown in 1823, Nicaragua joined the newly formed United Provinces of Central America, which was later renamed as the Federal Republic of Central America. Nicaragua finally became an independent republic in 1838. The Mosquito Coast followed a different historical path, being colonized by the English in the 17th century and later coming under British rule. It became an autonomous territory of Nicaragua in 1860 and its northernmost part was transferred to Honduras in 1960. Since its independence, Nicaragua has undergone periods of political unrest, dictatorship, occupation and fiscal crisis, including the Nicaraguan Revolution of the 1960s and 1970s and the Contra War of the 1980s.');
INSERT INTO public.ter_territory VALUES (12, 2, 5, 'AW', 'ABW', 'Aruba', 'Aruba', 1986, NULL, 149, NULL, 'Aruba is one of the four countries that form the Kingdom of the Netherlands, along with the Netherlands, Curaçao, and Sint Maarten.
INSERT INTO public.ter_territory VALUES (280, 6, 3, 'SU', 'SUN', 'Soviet Union', 'Union of Soviet Socialist Republics', 1922, 1991, NULL, '177,228,222,218,110,68,116,122,209,139,80,20,11,15,114,292', 'The Soviet Union was the union of multiple national Soviet republics. It was a one-party state (until 1990) governed by the Communist Party, with Moscow as its capital in its largest republic, the Russian SFSR.
INSERT INTO public.ter_territory VALUES (229, 7, 3, 'VU', 'VUT', 'Vanuatu', 'Republic of Vanuatu', 1980, NULL, NULL, NULL, 'North and South Vietnam were reunified as a communist state under a unitary socialist government in 1976. The country became economically and politically isolated until 1986, when the Communist Party initiated a series of economic and political reforms that facilitated Vietnamese integration into world politics and the global economy.');
INSERT INTO public.ter_territory VALUES (171, 6, 3, 'PL', 'POL', 'Poland', 'Republic of Poland', 1918, NULL, NULL, NULL, 'The country was partitioned by neighbouring states at the end of the 18th century, and regained independence in 1918 with the Treaty of Versailles. After a series of territorial conflicts, the new multi-ethnic Poland restored its position as a key player in European politics. In September 1939, World War II began with the invasion of Poland by Germany, followed by the Soviets invading Poland in accordance with the Molotov–Ribbentrop Pact. As a member of the Eastern Bloc, the Polish People''s Republic proclaimed forthwith was a chief signatory of the Warsaw Treaty amidst global Cold War tensions. In the wake of the 1989 events, notably through the emergence and contributions of the Solidarity movement, the communist government was dissolved and Poland re-established itself as a semi-presidential democratic republic.');
INSERT INTO public.ter_territory VALUES (290, 5, 4, NULL, NULL, 'South Ossetia', 'Republic of South Ossetia', 1991, NULL, 80, NULL, 'South Ossetia (or the State of Alania, or the Tskhinvali Region), is a de facto state in the South Caucasus recognised by most countries as part of Georgia. It is recognized as a state by Russia, Venezuela, Nicaragua, Nauru, and Syria.
INSERT INTO public.ter_territory VALUES (132, 7, 3, 'MH', 'MHL', 'Marshall Islands', 'Republic of the Marshall Islands', 1986, NULL, NULL, NULL, 'The Marshall Islands is an island country and an associated state of the United States near the Equator in the Pacific Ocean.
INSERT INTO public.ter_territory VALUES (146, 4, 3, 'NA', 'NAM', 'Namibia', 'Republic of Namibia', 1990, NULL, NULL, NULL, ' In 1884 the German Empire established rule over most of the territory, forming a colony known as German South West Africa. German rule ended in 1915 with a defeat by South African forces. In 1920, after the end of World War I, the League of Nations mandated administration of the colony to South Africa. From 1948, with the National Party elected to power, this included South Africa applying apartheid to what was then known as South West Africa.
INSERT INTO public.ter_territory VALUES (292, 6, 4, NULL, NULL, 'Transnistria ', 'Pridnestrovian Moldavian Republic', 1990, NULL, 139, NULL, 'After the dissolution of the Soviet Union, tensions between Moldova and the breakaway Transnistrian territory escalated into a military conflict that started in March 1992 and was concluded by a ceasefire in July of the same year. As part of that agreement, a three-party (Russia, Moldova, Transnistria) Joint Control Commission supervises the security arrangements in the demilitarised zone, comprising twenty localities on both sides of the river. Although the ceasefire has held, the territory''s political status remains unresolved: Transnistria is an unrecognised but de facto independent semi-presidential republic with its own government, parliament, military, police, postal system, currency and vehicle registration.
INSERT INTO public.ter_territory VALUES (106, 6, 3, 'IT', 'ITA', 'Italy', 'Italian Republic', 1861, NULL, NULL, NULL, 'By the mid-19th century, rising Italian nationalism and calls for independence from foreign control led to a period of revolutionary political upheaval. After centuries of foreign domination and political division, Italy was almost entirely unified in 1861, establishing the Kingdom of Italy as a great power. From the late 19th century to the early 20th century, Italy rapidly industrialised, mainly in the north, and acquired a colonial empire, while the south remained largely impoverished and excluded from industrialisation, fuelling a large and influential diaspora. Despite being one of the four main allied powers in World War I, Italy entered a period of economic crisis and social turmoil, leading to the rise of the Italian fascist dictatorship in 1922. Participation in World War II on the Axis side ended in military defeat, economic destruction and the Italian Civil War. Following the liberation of Italy and the rise of the Italian Resistance, the country abolished their monarchy, established a democratic Republic (1946), enjoyed a prolonged economic boom, and became a highly developed country.');
INSERT INTO public.ter_territory VALUES (159, 7, 5, 'MP', 'MNP', 'Northern Mariana Islands', 'Commonwealth of the Northern Mariana Islands', 1986, NULL, 225, NULL, 'The people of the Northern Mariana Islands decided in the 1970s not to seek independence, but instead to forge closer links with the United States. Negotiations for commonwealth status began in 1972 and a covenant to establish a commonwealth in political union with the United States was approved in a 1975 referendum. A new government and constitution partially came into effect in on January 9, 1978, after being approved in a 1977 referendum. The Northern Mariana Islands came under U.S. sovereignty on November 4, 1986 and the islanders became US citizens. Also on November 4, 1986, the Northern Mariana Islands constitution became fully effective under the Covenant.');
INSERT INTO public.ter_territory VALUES (85, 2, 5, 'GL', 'GRL', 'Greenland', 'Greenland', 1814, NULL, 58, NULL, 'In the early 17th century, Danish explorers reached Greenland. To strengthen trading and power, Denmark–Norway affirmed sovereignty over the island. Because of Norway''s weak status, it lost sovereignty over Greenland in 1814 when the union was dissolved. Greenland became Danish in 1814 and was fully integrated in Denmark in 1953 organised in the Danish constitution. With the Constitution of 1953, the people in Greenland became citizens of Denmark. In 1979, Denmark granted home rule to Greenland; in 2008, Greenlanders voted in favour of the Self-Government Act, which transferred more power from the Danish government to the local Greenlandic government.');
INSERT INTO public.ter_territory VALUES (388, 4, 5, NULL, NULL, 'Cameroon, British', 'British Cameroon', 1916, 1961, 224, '37,155', 'The area of present-day Cameroon was claimed by Germany as a protectorate during the "Scramble for Africa" at the end of the 19th century. 
INSERT INTO public.ter_territory VALUES (77, 3, 5, NULL, NULL, 'Guiana, British', 'British Guiana', 1831, 1966, 224, '92', 'The first European to encounter Guiana was Sir Walter Raleigh, an English explorer. The Dutch were the first Europeans to settle there, starting in the early 17th century. In 1796, Great Britain took over these territories during hostilities with the French, who had occupied the Netherlands. Britain returned control to the Batavian Republic in 1802 but captured the colonies a year later during the Napoleonic Wars. The colonies were officially ceded to the United Kingdom in 1814 and consolidated into a single colony in 1831. Guyana became independent of the United Kingdom on 26 May 1966.');
INSERT INTO public.ter_territory VALUES (345, 4, 2, NULL, NULL, 'West Africa, British', 'British West Africa', 1907, 1965, 224, NULL, 'British West Africa as a colonial entity was originally known as Colony of Sierra Leone and its Dependencies, then British West African Territories and finally British West African Settlements. It constituted during two periods (17 October 1821, until its first dissolution on 13 January 1850, and again 19 February 1866, until its final demise on 28 November 1888.
INSERT INTO public.ter_territory VALUES (329, 5, 5, NULL, NULL, 'Brunei, British', 'British protectorate of Brunei', 1888, 1984, 224, '32', 'During the 19th century, the Bruneian Empire began to decline. The Sultanate ceded Sarawak (Kuching) to James Brooke and installed him as the White Rajah, and it ceded Sabah to the British North Borneo Chartered Company. In 1888, Brunei became a British protectorate and was assigned a British resident as colonial manager in 1906. After the Japanese occupation during World War II, in 1959 a new constitution was written. In 1962, a small armed rebellion against the monarchy was ended with the help of the British. Brunei gained its independence from the United Kingdom on 1 January 1984');
INSERT INTO public.ter_territory VALUES (361, 6, 4, NULL, NULL, 'Croatia, German', 'Independent State of Croatia', 1941, 1945, 284, '284', 'The Independent State of Croatia was a World War II-era puppet state of Nazi Germany and Fascist Italy');
INSERT INTO public.ter_territory VALUES (338, 5, 5, NULL, NULL, 'East Indies, Dutch', 'Dutch East Indies', 1800, 1949, 149, '101', NULL);
INSERT INTO public.ter_territory VALUES (387, 4, 5, NULL, NULL, 'Cameroon, French', 'Territory of Cameroon', 1916, 1960, 74, '37', 'The area of present-day Cameroon was claimed by Germany as a protectorate during the "Scramble for Africa" at the end of the 19th century. During World War I, it was occupied by French and Belgian troops.
INSERT INTO public.ter_territory VALUES (343, 4, 5, NULL, NULL, 'Equatorial Africa, French', 'French Equatorial Africa', 1910, 1959, 74, '41,42,49,78', 'Established in 1910, the Federation contained four colonial possessions: French Gabon, French Congo, Ubangi-Shari and French Chad. The Governor-General was based in Brazzaville with deputies in each territory.
INSERT INTO public.ter_territory VALUES (393, 4, 2, NULL, NULL, 'Equatorial Africa and Cameroon, French', 'French Equatorial Africa and Cameroon', 1945, 1959, 74, '394', 'Monetary area of the CFA Franc for the French  colonies of Equatorial Africa and Cameroon');
INSERT INTO public.ter_territory VALUES (321, 5, 5, NULL, NULL, 'Indochina, French', 'Indochinese Union', 1887, 1954, 74, '320,115,36', NULL);
INSERT INTO public.ter_territory VALUES (397, 2, 5, NULL, NULL, 'Saint Christopher-Nevis-Anguilla', 'Saint Christopher-Nevis-Anguilla', 1962, 1983, 224, '7,180', 'It was a British colony in the West Indies from 1882 to 1983, consisting of the islands of Anguilla (until 1980), Nevis, and Saint Christopher (or Saint Kitts). From 1882 to 1951, and again from 1980, the colony was known simply as Saint Christopher and Nevis. In 1951, the name of the colony was changed to include Anguilla. The Leeward Islands Colony was disbanded in 1958, due to frequent tension between its members. From 1958 to 1962, Saint Christopher-Nevis-Anguilla formed a province of the West Indies Federation.
INSERT INTO public.ter_territory VALUES (331, 5, 5, NULL, NULL, 'Malaya, British', 'Federation of Malaya', 1948, 1957, 224, '330', 'Federation of British Malaya, comprising eleven states (nine Malay states and two of the British Straits Settlements, Penang and Malacca) that existed from 1 February 1948 until 16 September 1963. The Federation became independent on 31 August 1957.');
INSERT INTO public.ter_territory VALUES (354, 5, 5, NULL, NULL, 'Philippines, Spanish', 'Captaincy General of the Philippines', 1565, 1898, 199, '355', 'The Captaincy General encompassed the Spanish East Indies,  which besides the Philippine islands included the Marianas, Carolines, Palaos and Guam, as well as parts of Formosa (Taiwan), Sulawesi (Celebes) and the Moluccas (Maluku)');
INSERT INTO public.ter_territory VALUES (368, 4, 5, NULL, NULL, 'Angola, Portuguese', 'Province of Angola / State of Angola', 1648, 1975, 172, '6', 'In 1575, the settlement of Luanda was established on the coast south of the Kongo Kingdom, and in the 17th century the settlement of Benguela, even farther to the south. During the Portuguese war of independence against the Spanish, the Dutch ruled Luanda from 1640 to 1648.
INSERT INTO public.ter_territory VALUES (307, 4, 5, NULL, NULL, 'Guinea, Portuguese', 'Overseas Province of Guinea', 1474, 1974, 172, '91', NULL);
INSERT INTO public.ter_territory VALUES (336, 5, 5, NULL, NULL, 'India, Portuguese', 'State of India', 1505, 1961, 172, '100', NULL);
INSERT INTO public.ter_territory VALUES (362, 5, 5, NULL, NULL, 'Macao, Portuguese', 'Overseas Province of Macao', 1557, 1999, 172, '124', 'In 1557, Portugal had established a permanent settlement in Macao, paying an annual ground rent of 500 taels. By 1583, the enclave had a municipal government with a Senate Council.
INSERT INTO public.ter_territory VALUES (386, 4, 5, NULL, NULL, 'Mozambique, Portuguese', 'Province of Mozambique', 1505, 1975, 172, '144', 'The voyage of Vasco da Gama in 1498 marked the arrival of the Portuguese, who began a gradual process of colonisation and settlement in 1505. After over four centuries of Portuguese rule, Mozambique gained independence in 1975.');
INSERT INTO public.ter_territory VALUES (297, 5, 5, 'TP', 'TMP', 'Timor, Portuguese', 'East Timor', 1702, 1975, 172, '265', 'From 1702 to 1975, East Timor was an overseas territory of Portugal named "Portuguese Timor". In 1974, Portugal initiated a gradual decolonization process of its remaining overseas territories, including Portuguese Timor. During the process, a civil conflict between the different Timorese parties erupted. In 1975, Indonesia invaded East Timor and in 1976, it formally annexed the territory.');
INSERT INTO public.ter_territory VALUES (358, 2, 5, NULL, NULL, 'Puerto Rico, Spanish', 'Captaincy General of Puerto Rico', 1580, 1898, 199, '173', NULL);
INSERT INTO public.ter_territory VALUES (308, 5, 5, NULL, NULL, 'Qatar, British', 'Protectorate of Qatar', 1916, 1971, 224, '174', NULL);
INSERT INTO public.ter_territory VALUES (366, 6, 4, NULL, NULL, 'Serbia, German', 'Territory of the Military Commander in Serbia', 1941, 1944, 284, '284', 'This was the area of the Kingdom of Yugoslavia that was placed under a military government of occupation by the Wehrmacht following the invasion, occupation and dismantling of Yugoslavia in April 1941. The territory included only central Serbia, with the addition of the northern part of Kosovo (around Kosovska Mitrovica), and the Banat.
INSERT INTO public.ter_territory VALUES (334, 5, 5, NULL, NULL, 'Singapore, British', 'Colony of Singapore', 1946, 1963, 224, '128', 'The Colony of Singapore was a British Crown colony that existed from 1946 until 1963. In 1946, the Straits Settlements were dissolved and Singapore together with the Cocos-Keeling and Christmas Island became a separate Crown colony. The colony was governed by the United Kingdom until it gained partial internal self-governance in 1955. The Crown colony was dissolved on 16 September 1963 when Singapore became a state of Malaysia. On 9 August 1965, Singapore officially left Malaysia to become the independent Republic of Singapore');
INSERT INTO public.ter_territory VALUES (359, 4, 5, NULL, NULL, 'Guinea, Spanish', 'Province of the Gulf of Guinea', 1778, 1968, 199, '66', NULL);
INSERT INTO public.ter_territory VALUES (378, 6, 4, NULL, NULL, 'Ukraine, German', 'Reichskommissariat Ukraine', 1941, 1944, 280, '280', 'During World War II, Reichskommissariat Ukraine (abbreviated as RKU) was the civilian occupation regime of much of Nazi German-occupied Ukraine (which included adjacent areas of modern-day Belarus and pre-war Second Polish Republic). It lasted from September 1941 until November1944.');
INSERT INTO public.ter_territory VALUES (401, 7, 5, NULL, NULL, 'Gilbert Islands', 'Colony of Gilbert Islands', 1976, 1979, 224, '112', 'From 1976 to 1979,  the “British colony of the Gilbert Islands”, and before that, from 1916 to 1975, the “Gilbert and Ellice Islands colony”. They constitute the main part of the nation of Kiribati (the name of which is a rendering of “Gilberts” in the phonology of the indigenous Gilbertese)');
INSERT INTO public.ter_territory VALUES (402, 7, 5, NULL, NULL, 'Tuvalu, British', 'Colony of Tuvalu', 1976, 1978, 224, '220', 'A referendum was held in 1974 to determine whether the Gilbert Islands and Ellice Islands should each have their own administration. As a consequence of the referendum, separation occurred in two stages. The Tuvaluan Order 1975, which took effect on 1 October 1975, recognised Tuvalu as a separate British dependency with its own government. The second stage occurred on 1 January 1976, when separate administrations were created out of the civil service of the Gilbert and Ellice Islands Colony. On 1 October 1978, Tuvalu became an independent nation.');
INSERT INTO public.ter_territory VALUES (286, 7, 5, 'GE', 'GEL', 'Gilbert and Ellice Islands', 'Gilbert and Ellice Islands', 1892, 1976, 224, '401,402', 'The Gilbert and Ellice Islands (GEIC as a colony) in the Pacific Ocean were part of the British Empire from 1892 to 1976. They were a protectorate from 1892 to 12 January 1916, and then a colony until 1 January 1976. The history of the colony was mainly characterized by phosphate mining on Ocean Island. In October 1975, these islands were divided by force of law into two separate colonies, and they became independent nations shortly thereafter: The Ellice Islands became Tuvalu in 1978, and the Gilbert Islands became part of Kiribati in 1979.');
INSERT INTO public.ter_territory VALUES (251, 4, 3, 'SS', 'SSD', 'South Sudan', 'Republic of South Sudan', 2011, NULL, NULL, NULL, 'Sudan was occupied by Egypt under the Muhammad Ali dynasty and was governed as an Anglo-Egyptian condominium until Sudanese independence in 1956. Following the First Sudanese Civil War, the Southern Sudan Autonomous Region was formed in 1972 and lasted until 1983. A second Sudanese civil war soon broke out, ending in 2005 with the Comprehensive Peace Agreement. Later that year, southern autonomy was restored when an Autonomous Government of Southern Sudan was formed. South Sudan became an independent state on 9 July 2011, following 98.83% support for independence in a January 2011 referendum.');
INSERT INTO public.ter_territory VALUES (183, 2, 3, 'VC', 'VCT', 'Saint Vincent and the Grenadines', 'Saint Vincent and Grenadines', 1979, NULL, NULL, NULL, 'Christopher Columbus, the first European to reach the island, named it after St. Vincent of Saragossa, whose feast day it was on the day Columbus first saw it (22 January 1498). The name of the Grenadines refers to the Spanish city of Granada, but to differentiate it from the island of the same name, the diminutive was used.
INSERT INTO public.ter_territory VALUES (302, 4, 5, NULL, NULL, 'Rhodesia and Nyasaland', 'Federation of Rhodesia and Nyasaland', 1953, 1963, 224, '301,127,237', 'The Federation of Rhodesia and Nyasaland (also known as the Central African Federation, CAF) was a colonial federation that consisted of three southern African territories—the self-governing British colony of Southern Rhodesia and the British protectorates of Northern Rhodesia and Nyasaland—between 1953 and 1963.
INSERT INTO public.ter_territory VALUES (300, 4, 4, 'RH', 'RHO', 'Rhodesia', 'Republic of Rhodesia', 1965, 1979, 224, '277', 'Rhodesia, officially from 1970 the Republic of Rhodesia, was an unrecognised state in Southern Africa from 1965 to 1979, equivalent in territory to modern Zimbabwe.
INSERT INTO public.ter_territory VALUES (301, 4, 5, NULL, NULL, 'Rhodesia, Southern', 'Colony of Southern Rhodesia', 1923, 1965, 224, '300', 'Initially, the territory was referred to as "South Zambezia", a reference to the River Zambezi, until the name "Rhodesia" came into use in 1895. This was in honour of Cecil Rhodes, the British empire-builder and key figure during the British expansion into southern Africa. In 1888 Rhodes obtained mineral rights from the most powerful local traditional leaders through treaties such as the Rudd Concession and the Moffat Treaty, which was signed by King Lobengula of the Ndebele people. "Southern" was first used in 1898 and dropped from normal usage in 1964, on the break-up of the Federation of Rhodesia and Nyasaland. "Rhodesia" then remained the name of the country until the creation of Zimbabwe Rhodesia in 1979. Legally, from the British perspective, the name Southern Rhodesia continued to be used until 18 April 1980, when the Republic of Zimbabwe was promulgated.
INSERT INTO public.ter_territory VALUES (405, 4, 5, NULL, NULL, 'Rhodesia, Northern', 'Northern Rhodesia Protectorate', 1911, 1964, 224, '237', 'Northern Rhodesia was a protectorate in south central Africa, formed in 1911 by amalgamating the two earlier protectorates of Barotziland-North-Western Rhodesia and North-Eastern Rhodesia.[2][3][4][5] It was initially administered, as were the two earlier protectorates, by the British South Africa Company (BSAC), a chartered company, on behalf of the British Government. From 1924, it was administered by the British Government as a protectorate, under similar conditions to other British-administered protectorates. 
INSERT INTO public.ter_territory VALUES (406, 4, 5, NULL, NULL, 'Nyasaland', 'Nyasaland Protectorate', 1907, 1964, 224, '127', 'Nyasaland was a British protectorate located in Africa that was established in 1907 when the former British Central Africa Protectorate changed its name. Between 1953 and 1963, Nyasaland was part of the Federation of Rhodesia and Nyasaland. After the Federation was dissolved, Nyasaland became independent from Britain on 6 July 1964 and was renamed Malawi.');
INSERT INTO public.ter_territory VALUES (398, 2, 5, NULL, NULL, 'Antigua', 'Associated State of Antigua', 1962, 1981, 224, '9', 'The island of Antigua was explored by Christopher Columbus in 1493 and named for the Church of Santa María La Antigua. Antigua was colonized by Britain in 1632; Barbuda island was first colonised in 1678. Having been part of the Federal Colony of the Leeward Islands from 1871, Antigua and Barbuda joined the West Indies Federation in 1958. With the breakup of the federation, it became one of the West Indies Associated States in 1967. Following self-governance in its internal affairs, independence was granted from the United Kingdom on 1 November 1981.');
INSERT INTO public.ter_territory VALUES (86, 2, 3, 'GD', 'GRD', 'Grenada', 'Grenada', 1974, NULL, NULL, NULL, 'Before the arrival of Europeans in the Americas, Grenada was inhabited by the indigenous Arawaks and later by the Island Caribs. Christopher Columbus sighted Grenada in 1498 during his third voyage to the Americas. Following several unsuccessful attempts by Europeans to colonise the island due to resistance from the Island Caribs, French settlement and colonisation began in 1650 and continued for the next century. On 10 February 1763, Grenada was ceded to the British under the Treaty of Paris. British rule continued until 1974 (except for a period of French rule between 1779 and 1783). From 1958 to 1962 Grenada was part of the Federation of the West Indies, a short-lived federation of British West Indian colonies. On 3 March 1967, it was granted full autonomy over its internal affairs as an associated state.
INSERT INTO public.ter_territory VALUES (409, 2, 5, NULL, NULL, 'Barbados, British', 'Colony of Barbados', 1962, 1966, 224, '19', 'Barbados joined the short-lived West Indies Federation from 1958 to 1962, later gaining full independence on 30 November 1966');
INSERT INTO public.ter_territory VALUES (410, 2, 5, NULL, NULL, 'Grenada, British', 'Associated State of Grenada', 1962, 1974, 224, '86', 'From 1958 to 1962 Grenada was part of the Federation of the West Indies, a short-lived federation of British West Indian colonies. On 3 March 1967, it was granted full autonomy over its internal affairs as an associated state.
INSERT INTO public.ter_territory VALUES (40, 2, 5, 'KY', 'CYM', 'Cayman Islands', 'Cayman Islands', 1962, NULL, 224, NULL, 'It is believed that they were discovered by Christopher Columbus on 10 May 1503 during his final voyage to the Americas. He named them ''Las Tortugas'' due to the large number of turtles found on the islands (which were soon hunted to near-extinction); however, in the succeeding decades the islands began to be referred to as the Caymans, after the caimans present there.
INSERT INTO public.ter_territory VALUES (403, 2, 5, NULL, NULL, 'Saint Lucia, British', 'Colony of Saint Lucia', 1962, 1979, 224, '181', 'The French were the first Europeans to settle on the island. They signed a treaty with the native Island Caribs in 1660. England took control of the island from 1663 to 1667. In ensuing years, it was at war with France fourteen times, and the rule of the island changed frequently (it was ruled seven times each by the French and British). In 1814, the British took definitive control of the island. From 1958 to 1962, the island was a member of the West Indies Federation. On 22 February 1979, Saint Lucia became an independent state and a member of the Commonwealth of Nations.');
INSERT INTO public.ter_territory VALUES (404, 2, 5, NULL, NULL, 'Saint Vincent and the Grenadines, British', 'Colony of Saint Vincent and the Grenadines', 1962, 1979, 224, '183', 'In the 1960s, the British again tried to unify all of its regional islands, including Saint Vincent, into a single politically unified entity under British control. The unification was to be called the West Indies Federation and was driven by a desire to gain independence from British government. However, the attempt collapsed in 1962. Saint Vincent was granted "associate statehood" status by Britain on 27 October 1969. This gave Saint Vincent complete control over its own internal affairs but fell short of full independence in law. On 27 October 1979, Saint Vincent and the Grenadines became the last of the Windward Islands to gain full independence.');
INSERT INTO public.ter_territory VALUES (408, 2, 5, NULL, NULL, 'West Indies', 'West Indies Federation', 1958, 1962, 224, '40,107,398,407,409,410,142,397,403,404,215,219', 'The West Indies Federation, also known as the West Indies, was a short-lived political union that existed from 3 January 1958 to 31 May 1962. Various islands in the Caribbean that were colonies of the United Kingdom, including Trinidad and Tobago, Barbados, Jamaica, and those on the Leeward and Windward Islands, came together to form the Federation, with its capital in Port of Spain, Trinidad and Tobago. The expressed intention of the Federation was to create a political unit that would become independent from Britain as a single state—possibly similar to the Canadian Confederation, Australian Commonwealth, or Central African Federation; however, before that could happen, the Federation collapsed due to internal political conflicts over how the Federation itself would be governed or how it would viably function.');
INSERT INTO public.ter_territory VALUES (411, 2, 5, NULL, NULL, 'Windward Islands, British', 'Territory of the Windward Islands', 1833, 1960, 224, '408', 'The British Windward Islands was a British colony in the Windward Islands of the West Indies, existing between 1833 and 1960 and consisting of the islands of Grenada, St Lucia, Saint Vincent, the Grenadines, Barbados (the seat of the governor until 1885, when it returned to its former status of a completely separate colony), Tobago (until 1889, when it was joined to Trinidad), and (from 1940) Dominica, previously included in the British Leeward Islands.
INSERT INTO public.ter_territory VALUES (412, 2, 5, NULL, NULL, 'Leeward Islands, British', 'Federal Colony of the Leeward Islands', 1833, 1958, 224, '408,232', 'The Leeward Islands was established as an English colony in 1671. In 1816, the islands were divided in two regions: Antigua, Barbuda, and Montserrat in one colony, and Saint Christopher, Nevis, Anguilla, and the Virgin Islands in the other.
INSERT INTO public.ter_territory VALUES (232, 2, 5, 'VG', 'VGB', 'Virgin Islands, British', 'Virgin Islands', 1960, NULL, 224, NULL, 'The islands were named "Santa Úrsula y las Once Mil Vírgenes" by Christopher Columbus in 1493 after the legend of Saint Ursula and the 11,000 virgins. The name was later shortened to "the Virgin Islands".
INSERT INTO public.ter_territory VALUES (194, 7, 3, 'SB', 'SLB', 'Solomon Islands', 'Solomon Islands', 1978, NULL, NULL, NULL, 'The islands have been settled since at least some time between 30,000 and 28,800 BC, with later waves of migrants, notably the Lapita people, mixing and producing the modern indigenous Solomon Islanders population. In 1568, the Spanish navigator Álvaro de Mendaña was the first European to visit them, naming them the Islas Salomón.[11] Mendaña returned decades later, in 1595, and another Spanish expedition, led by Portuguese navigator Pedro Fernandes de Queirós, visited the Solomons in 1606. Britain defined its area of interest in the Solomon Islands archipelago in June 1893, when Captain Gibson R.N., of HMS Curacoa, declared the southern Solomon Islands a British protectorate.
INSERT INTO public.ter_territory VALUES (413, 7, 5, NULL, NULL, 'Solomon Islands, British', 'Solomon Islands Protectorate', 1893, 1978, 224, '194', 'The British Solomon Islands Protectorate was first declared over the southern Solomons in 1893, when Captain Gibson R.N., of HMS Curacoa, declared the southern islands a British protectorate. Other islands were subsequently declared to form part of the Protectorate.
INSERT INTO public.ter_territory VALUES (59, 4, 3, 'DJ', 'DJI', 'Djibouti', 'Republic of Djibouti', 1977, NULL, NULL, NULL, 'In antiquity, the territory together with Ethiopia, Eritrea and Somaliland was part of the Land of Punt. Nearby Zeila, now in Somaliland, was the seat of the medieval Adal and Ifat Sultanates. In the late 19th century, the colony of French Somaliland was established following treaties signed by the ruling Dir Somali sultans with the French and its railroad to Dire Dawa (and later Addis Ababa) allowed it to quickly supersede Zeila as the port for southern Ethiopia and the Ogaden. It was subsequently renamed to the French Territory of the Afars and the Issas in 1967. A decade later, the Djiboutian people voted for independence. This officially marked the establishment of the Republic of Djibouti, named after its capital city. The new state joined the United Nations the same year, on 20 September 1977. In the early 1990s, tensions over government representation led to armed conflict, which ended in a power-sharing agreement in 2000 between the ruling party and the opposition.');
INSERT INTO public.ter_territory VALUES (39, 4, 3, 'CV', 'CPV', 'Cabo Verde', 'Republic of Cabo Verde', 1975, NULL, NULL, NULL, 'The Cape Verde archipelago was uninhabited until the 15th century, when Portuguese explorers discovered and colonized the islands, thus establishing the first European settlement in the tropics. Because the Cape Verde islands were located in a convenient location to play a role in the Atlantic slave trade, Cape Verde became economically prosperous during the 16th and 17th centuries, attracting merchants, privateers, and pirates. It declined economically in the 19th century due to the suppression of the Atlantic slave-trade, and many of its inhabitants emigrated during that period. However, Cape Verde gradually recovered economically by becoming an important commercial center and useful stopover point along major shipping routes. In 1951, Cape Verde was incorporated as an overseas department of Portugal, but its inhabitants continued to campaign for independence, which they achieved in 1975.');
INSERT INTO public.ter_territory VALUES (415, 4, 5, NULL, NULL, 'Cabo Verde, Portuguese', 'Overseas Province of Cabo Verde', 1462, 1975, 172, '39', 'Cape Verde was a colony of the Portuguese Empire from the initial settlement of the Cape Verde Islands in 1462 until the independence of Cape Verde in 1975.');
INSERT INTO public.ter_territory VALUES (419, 3, 5, NULL, NULL, 'Suriname, Dutch', 'Suriname', 1667, 1975, 149, '202', 'Surinam was a Dutch colony from 26 February 1667, when Dutch forces captured Francis Willoughby''s English colony during the Second Anglo-Dutch War, until 15 December 1954, when Surinam became a constituent country of the Kingdom of the Netherlands.
INSERT INTO public.ter_territory VALUES (156, 7, 5, 'NU', 'NIU', 'Niue', 'Niue', 1974, NULL, 152, NULL, 'Niue is a self-governing state in free association with New Zealand, and New Zealand conducts most diplomatic relations on its behalf. As part of the Realm of New Zealand, Niueans are citizens of New Zealand and Queen Elizabeth II is Niue''s head of state in her capacity as Queen of New Zealand. Between 90% and 95% of Niuean people live in New Zealand, along with about 70% of the speakers of the Niuean language.
INSERT INTO public.ter_territory VALUES (422, 2, 5, NULL, NULL, 'Bahamas, British', ' Crown Colony of the Bahama Islands', 1718, 1973, 224, '16', 'The Bahamas became a British crown colony in 1718, when the British clamped down on piracy. The country gained governmental independence in 1973');
INSERT INTO public.ter_territory VALUES (51, 7, 5, 'CK', 'COK', 'Cook Islands', 'Cook Islands', 1965, NULL, 152, NULL, 'The first European contact with the islands took place in 1595 when the Spanish navigator Álvaro de Mendaña de Neira sighted the island of Pukapuka. 
INSERT INTO public.ter_territory VALUES (418, 7, 5, NULL, NULL, 'Papua New Guinea, Australian', 'Papua New Guinea', 1949, 1975, 13, '166', 'The Territory of Papua and New Guinea was established by an administrative union between the Australian-administered territories of Papua and New Guinea in 1949. In December 1971, the name of the Territory changed to "Papua New Guinea" and in 1975 it became the Independent State of Papua New Guinea.');
INSERT INTO public.ter_territory VALUES (235, 4, 4, 'EH', 'ESH', 'Western Sahara', 'Sahrawi Arab Democratic Republic', 1976, NULL, 143, NULL, 'The Sahrawi Arab Democratic Republic, SADR, also known as Western Sahara, is a partially recognized de facto sovereign state located in the western Maghreb, which claims the non-self-governing territory of Western Sahara, but controls only the easternmost one-fifth of that territory. Between 1884 and 1975, Western Sahara was known as Spanish Sahara, a Spanish colony (later an overseas province). The SADR is one of the two African states in which Spanish is a significant language, the other being Equatorial Guinea.
INSERT INTO public.ter_territory VALUES (105, 5, 3, 'IL', 'ISR', 'Israel', 'State of Israel', 1948, NULL, NULL, NULL, 'The land was controlled as a mandate of the British Empire from 1920 to 1948, having been ceded by the Ottomans at the end of the First World War. The Second World War saw the mandate bombed heavily. Once the British agreed to supply arms and form a Jewish Brigade in 1944, Yishuv Jews officially entered the conflict on the side of the allies. At the end of the war the United Nations (UN), eager to appease both Arab and Jewish factions, adopted a Partition Plan for Palestine in 1947 recommending the creation of independent Arab and Jewish states, and an internationalized Jerusalem. The plan was accepted by the Jewish Agency but rejected by Arab leaders. The following year, the Jewish Agency declared the independence of the State of Israel, and the subsequent 1948 Arab–Israeli War saw Israel establishment over most of the former Mandate territory, while the West Bank and Gaza were held by neighboring Arab states. Israel has since fought several wars with Arab countries, and since the Six-Day War in June 1967 held occupied territories including the West Bank, Golan Heights and the Gaza Strip');
INSERT INTO public.ter_territory VALUES (250, 6, 3, 'RS', 'SRB', 'Serbia', 'Republic of Serbia', 2006, NULL, NULL, NULL, 'During the breakup of Yugoslavia, Serbia formed a union with Montenegro, which was peacefully dissolved in 2006, restoring Serbia''s independence as a sovereign state for the first time since 1918. In 2008, representatives of the Assembly of Kosovo unilaterally declared independence, with mixed responses from the international community and Serbia continuing to claim it as part of its own sovereign territory.');
INSERT INTO public.ter_territory VALUES (166, 7, 3, 'PG', 'PNG', 'Papua New Guinea', 'Independent State of Papua New Guinea', 1975, NULL, NULL, NULL, 'After being ruled by three external powers since 1884, Papua New Guinea established its sovereignty in 1975. This followed nearly 60 years of Australian administration, which started during World War I. It became an independent Commonwealth realm in 1975 with Elizabeth II as its queen. It also became a member of the Commonwealth of Nations in its own right.
INSERT INTO public.ter_territory VALUES (36, 5, 3, 'KH', 'KHM', 'Cambodia', 'Kingdom of Cambodia', 1953, NULL, NULL, NULL, 'The region now known as Cambodia has been inhabited since prehistoric times. In 802 AD, Jayavarman II declared himself king, uniting the warring Khmer princes of Chenla under the name "Kambuja". This marked the beginning of the Khmer Empire, which flourished for over 600 years. In the fifteenth century, after the rebellion of Ayutthaya, which was formerly ruled by the Khmer Empire, Cambodia experienced a decline of power, while its neighbours Vietnam and Thailand grew stronger. In 1863, Cambodia became a protectorate of France, and later was incorporated into French Indochina. The country was under Japanese occupation during the Second World War before French control was restored.
