The pengo lost value after World War II, suffering the highest rate of hyperinflation ever recorded. The denominations milpengő (one million pengő) and b.-pengő (one trillion pengő) were used to alleviate calculations, cut down the number of zeros and enable the reuse of banknote designs with only the colour and denomination name changed.');
