The currency remained in use when these colonies gained their independence. Equatorial Guinea adopted the CFA franc in 1984, replacing the Equatorial Guinean ekwele at a rate of 1 franc = 4 bipkwele.
Currently the Central African CFA franc is the currency of six independent states in Central Africa: Cameroon, Central African Republic, Chad, Republic of the Congo, Equatorial Guinea and Gabon. It is issued by the BEAC (Banque des États de l''Afrique Centrale, "Bank of the Central African States"), located in Yaoundé, Cameroon, for the members of the CEMAC (Communauté Économique et Monétaire de l''Afrique Centrale, "Economic and Monetary Community of Central Africa"). 
CFA stood for "Colonies françaises d''Afrique" ("French colonies of Africa"); then for "Communauté française d''Afrique" ("French Community of Africa") between 1958 and the independence of these African countries at the beginning of the 1960s. Since independence, CFA is taken to mean "Communauté Financière Africaine" (African Financial Community).
Starting in 1993 the banknotes have been issued with only a letter prominently displayed to distinguish between the issues of the different states. The country letter codes are as follows:
