The paper currency was reformed in 1875. Old paper money was withdrawn from circulation and new, convertible government notes were released. This new paper peso was known as peso moneda national (peso national currency).
In 1896 Uruguay adopted the gold standard based on a peso oro. Bank notes were denominated in legal tender currency (en moneda legal). The gold standard was suspended in August 1914.');
In 1965, the British West Indies dollar of the now defunct West Indies Federation was replaced at par by the Eastern Caribbean dollar and the BCCB was replaced by the Eastern Caribbean Currency Authority or ECCA (established by the Eastern Caribbean Currency Agreement 1965). British Guiana withdrew from the currency union the following year. Grenada, which had used the Trinidad and Tobago dollar from 1964, rejoined the common currency arrangement in 1968.');
The Malaya and British Borneo dollar was used in Malaya after independence in 1957, and in Malaysia after its formation in 1963, as well as in Singapore after its independence in 1965. After 1967, the two countries and Brunei ended the common currency arrangement and began issuing their own currencies. However, the Malaya and British Borneo dollar continued to be legal tender until 16 January 1969. The currency was also being used in the Riau Archipelago in Indonesia prior to 1963.');
The first dobra was introduced in 1977, replacing the escudo at par. Due to inflation, on 1 January 2018 the dobra was redenominated at a rate of 1000 to 1.');
In adopting the Rhodesian dollar, Rhodesia followed the pattern of South Africa, Australia, and New Zealand in that when it adopted the decimal system, it decided to use the half pound unit as opposed to the pound unit of account.
The dollar proved to be a strong currency, at parity with the pound sterling right up to the very end of Rhodesia in 1980, when it was replaced by the Zimbabwean dollar at par. 
However, the Rhodesian dollar was never a fully convertible currency and its exchange rate was therefore not an indication of the underlying economics.');
The Federation broke up at the end of 1963 and the three territories reverted to being separate British colonies. In the second half of 1964, Nyasaland became independent as Malawi, Northern Rhodesia became independent as Zambia, and Southern Rhodesia declared a name change to Rhodesia. Each issued their own pounds, at par with the Rhodesia and Nyasaland pound.');
In 1966 the Australian dollar replaced the pound and was circulated in the Solomon Islands until 1976, shortly before independence.
The Solomon Islands dollar was introduced in 1977, replacing the Australian dollar at par, following independence.');
In 1948, the first coins were issued specifically for use in Djibouti, in the name of the "Côte Française des Somalis". In 1949, an independent Djiboutian franc came into being when the local currency was pegged to the US dollar at a rate of 214.392 francs = 1 dollar. In 1952, the Public Treasury took over the production of paper money. French Somaliland''s change of name in 1967 to the French Territory of the Afars and the Issas was reflected on both the territory''s coins and notes. A further change in coin and banknote design followed independence in 1977.');
Standard issue notes began to be issued in 1918.
