Until independence in 1975, the Cape Verde escudo was equal to the Portuguese escudo. Subsequently it depreciated.
In mid-1998 an agreement with Portugal established a pegged rate of 1 Portuguese escudo = 0.55 Cape Verdean escudo. Since the replacement of the Portuguese escudo with the euro, the Cape Verdean escudo has been pegged to the euro at a rate of 1 EUR = 110.265 CVE.');
The name kina is derived from Kuanua language of the Tolai region, referring to a callable pearl shell used widely for trading in both the Coastal and Highlands areas of the country.');
The pound was replaced by the dollar in 1966, at a rate of 7 shillings = 1 dollar (1 pound = 2.86 dollars).');
The shekel, now known as the old shekel, was the currency of the State of Israel between 24 February 1980 and 31 December 1985. Both it and its predecessor the Israeli pound experienced frequent devaluations against foreign currencies during the 1960s and ''70s. This trend culminated in the old shekel experiencing hyperinflation in the early 1980s. After inflation was contained as a result of the 1985 Economic Stabilization Plan, the new shekel was introduced, replacing the old shekel on 1 January 1986.');
The new currency was named after Inti, the Inca sun god.
The nuevo sol ("new sol") was adopted on 1 July 1991, replacing the inti at an exchange rate of a million to one.');
Among the republics of the former Soviet Union, Tajikistan was the last to issue its own currency.');
The name piastre derives from the Spanish pieces of eight (pesos) and has been used as the name of many different historical units of currency.
In 1946, the North Vietnamese đồng was introduced, which replaced the piastre at par. In 1952/1953, the Lao kip (1952), Cambodian riel (1953), and South Vietnamese đồng (1953) were introduced at par with the piastre.');


