The Turks and Caicos Islands were inhabited for centuries by native Amerindian peoples. The first recorded European sighting of the islands occurred in 1512.[10] In the subsequent centuries, the islands were claimed by several European powers, with the British Empire eventually gaining control. For many years the islands were governed indirectly through Bermuda, the Bahamas, and Jamaica. When the Bahamas gained independence in 1973, the islands received their own governor, and have remained a separate autonomous British Overseas Territory.');
