In 1912, the British government divided their territories into different colonies: The Bahamas, Barbados, British Guiana, British Honduras, Jamaica (with its dependencies the Turks and Caicos Islands and the Cayman Islands), Trinidad and Tobago, the Windward Islands, and the Leeward Islands. Between 1958 and 1962, all of the island territories except the British Virgin Islands and the Bahamas were organised into the West Indies Federation. It was hoped that the Federation would become independent as a single nation, but it had limited powers and faced many practical problems. Consequently, the West Indies Federation was dissolved in 1962.');
The Empire was dissolved following its defeat in the First World War. The following successor states were formed (entirely or in part) on the territory of the former Austria-Hungary:
* German Austria and the First Austrian Republic
* Hungarian Democratic Republic, Hungarian Soviet Republic, Hungarian Republic and Kingdom of Hungary
* First Czechoslovak Republic ("Czechoslovakia" from 1920 to 1938)
* Second Polish Republic
* State of Slovenes, Croats and Serbs (joined on 1 December 1918 with the Kingdom of Serbia to form the Kingdom of Serbs, Croats and Slovenes, later Kingdom of Yugoslavia)
* West Ukrainian People''s Republic (united with the Ukrainian People''s Republic through Act Zluky, while its territory was fully overran by the Second Polish Republic)
* Duchy of Bukovina, Transylvania and two-thirds of the Banat were joined to the Kingdom of Romania
Austro-Hungarian lands were also ceded to the Kingdom of Italy. The Principality of Liechtenstein, which had formerly looked to Vienna for protection, formed a customs and defence union with Switzerland, and adopted the Swiss currency instead of the Austrian.');
A republic was established in the wake of the dissolution of Austria-Hungary. The First Hungarian Republic, until 21 March 1919 the Hungarian People''s Republic was a short-lived unrecognized people''s republic that existed – apart from a 133-day interruption in the form of the Hungarian Soviet Republic – from 16 November 1918 until 8 August 1919. The First Hungarian Republic replaced the Kingdom of Hungary, and was in turn replaced by the Hungarian Republic, another short-lived state from August 1919 to February 1920. 
Finally a Kingdom was established between 1920 and  February 1946.
After WW II Hungary became a satellite state of the Soviet Union, which contributed to the establishment of a socialist republic spanning four decades, from 1949 until 1989. The opening of the previously-restricted border with Austria in 1989 accelerated the collapse of the Eastern Bloc, and subsequently the Soviet Union. On 23 October 1989, Hungary became a democratic parliamentary republic.');
In 1992, the People''s Republic of Angola was constitutionally succeeded by the Republic of Angola and elections were held. However the election results were not recognized and fighting resumed across the country until 2002.');
The Georgian SSR was formed in March 1921, after the invasion by Russia''s Red Army, and subsequently incorporated in the Soviet Union in 1922.');
In the 18th century, Iran once again became a major world power, though by the 19th century a series of conflicts with the Russian Empire led to significant territorial losses. However, Iran would remain one of the few non-European states to avoid colonization by Europe.');
On 9 September 1991, Tajikistan became an independent sovereign nation when the Soviet Union disintegrated. A civil war was fought almost immediately after independence, lasting from 1992 to 1997.');
In 1940, Romania was compelled to cede Bessarabia and Northern Bukovina to the Soviet Union, leading to the creation of the Moldavian Soviet Socialist Republic (Moldavian SSR). On 27 August 1991, as the dissolution of the Soviet Union was underway, the Moldavian SSR declared independence and took the name Moldova. The constitution of Moldova was adopted in 1994. The strip of the Moldovan territory on the east bank of the Dniester has been under the de facto control of the breakaway government of Transnistria since 1990.');
By the 1980s, an independence movement was established and grew, leading to Georgia''s secession from the Soviet Union in April 1991. For most of the following decade, post-Soviet Georgia suffered from civil conflicts, secessionist wars in Abkhazia and South Ossetia, and economic crisis.');
On 24 October 1964, Zambia became independent of the United Kingdom and prime minister Kenneth Kaunda became the inaugural president. From 1972 to 1991 Zambia was a one-party state with the UNIP as the sole legal political party under the motto "One Zambia, One Nation". Kaunda was succeeded by Frederick Chiluba of the social-democratic Movement for Multi-Party Democracy in 1991, beginning a period of social-economic growth and government decentralisation. ');
