Latvia joined the European Union on May 1, 2004.');
As part of the wider Russian Civil War of 1917–23, Ukraine went through its own Civil war between 1917 and 1921. The Bolsheviks would (after the 1921 Treaty of Riga) extend control over what would ultimately become the Ukrainian Soviet Socialist Republic and (in 1922) a founding member of the Soviet Union.');
In 1934 a coup established an authoritarian regime under Kārlis Ulmanis. The country''s independence was interrupted at the outset of World War II, when the Soviet Union incorporated Latvia on 5 August 1940, as the Latvian Soviet Socialist Republic, followed by the invasion and occupation by Nazi Germany in 1941, and the re-occupation by the Soviets in 1944 as the Latvian SSR for the next 46 years.');
At the end of World War I, Lithuania''s Act of Independence was signed on 16 February 1918, declaring the founding of the modern Republic of Lithuania.
