The parliament of the republic proclaimed the sovereignty of Belarus on 27 July 1990, and during the dissolution of the Soviet Union, Belarus declared independence on 25 August 1991.');
On August 30, 1990, Tatarstan announced its sovereignty with the Declaration on the State Sovereignty of the Tatar Soviet Socialist Republic. In the 1992 Tatarstan Constitution, approved in a referendum, Tatarstan is defined as a Sovereign State. However, the referendum and constitution were declared unconstitutional by the Russian Constitutional Court. 
On February 15, 1994, treaties between the  Russian Federation and the Republic of Tatarstan were signed. The power-sharing agreement was renewed on July 11, 2007, though with much of the power delegated to Tatarstan reduced.');
