During the late–19th-century, Ethiopia and Liberia were the only two nations that preserved their sovereignty from long-term colonisation by a European colonial power. Ethiopia defeated the Italian force at the battle of Adwa under Emperor Menelik II. Many newly independent nations on the continent adopted its flag colours. During this period, Ethiopia established its modern borders through extensive conquest of territories to its east, west and south. The country was occupied by Italy in 1936 and became Italian Ethiopia as part of Italian East Africa, until it was liberated during World War II. The Italians, never managed to rule Ethiopia completely. In 1974, the long standing Ethiopian monarchy under Haile Selassie was overthrown by the Derg, a communist military government backed by the Soviet Union. In 1987, the Derg established the People''s Democratic Republic of Ethiopia, which was overthrown in 1991 by the Ethiopian People''s Revolutionary Democratic Front. In 1993 Eritrea achieved independence from Ethiopia and in1997 the current constitution was declared.');
Since independence, Sudan has been ruled by a series of unstable parliamentary governments and military regimes. Differences in language, religion, and political power erupted in a civil war between government forces and the southern rebels, eventually concluding in the independence of South Sudan in 2011.');
The State of Palestine is recognized by 138 UN members and since 2012 has a status of a non-member observer state in the United Nations');
In the midst of the French Revolution (1789–99), slaves and free people of color launched the Haitian Revolution (1791–1804), led by a former slave and the first black general of the French Army, Toussaint Louverture. After 12 years of conflict, Napoleon Bonaparte''s forces were defeated by Louverture''s successor, Jean-Jacques Dessalines (later Emperor Jacques I), who declared Haiti''s sovereignty on 1 January 1804—the first independent nation of Latin America and the Caribbean, the second republic in the Americas, the first country to abolish slavery, and the only state in history established by a successful slave revolt.  After a brief period in which the country was split in two, President Jean-Pierre Boyer united the country and then attempted to bring the whole of Hispaniola under Haitian control, precipitating a long series of wars that ended in the 1870s when Haiti formally recognized the independence of the Dominican Republic.  Political volatility and foreign economic influence in the country prompted the U.S. to occupy the country from 1915 to 1934. Following a series of short-lived presidencies, François ''Papa Doc'' Duvalier took power in 1956, ushering in a long period of autocratic rule that was continued by his son Jean-Claude ''Baby Doc'' Duvalier that lasted until 1986. Since 1986 Haiti has been attempting to establish a more democratic political system.');
The Bahamas became a British crown colony in 1718, when the British clamped down on piracy. After the American Revolutionary War, the Crown resettled thousands of American Loyalists to The Bahamas; they took enslaved people with them and established plantations on land grants. African enslaved people and their descendants constituted the majority of the population from this period on. Slavery in The Bahamas was abolished in 1834.
The country gained governmental independence in 1973. ');
On 30 November 1966, Barbados became an independent state and Commonwealth realm with Elizabeth II as its queen, though the country is set to remove her as its head of state and become a republic by 30 November 2021.');
In 1972, a nationalist political party of Marxist ideology, the Movement for the Liberation of São Tomé and Príncipe (MLSTP), was created by exiles in Equatorial Guinea with the intent of creating an independent nation. The Carnation Revolution in 1974 ended the Estado Novo dictatorship in Portugal and initiated a process of decolonization of the Portuguese colonies in Africa. On 12 July 1975, the new Portuguese regime granted independence to São Tomé and Príncipe.');
A referendum was held in 1974 to determine whether the Gilbert Islands and Ellice Islands should each have their own administration. Due to the results of the referendum, the Gilbert and Ellice Islands colony legally ceased to exist on 1 October 1975, and on 1 January 1976, the old administration was officially separated, and two separate British colonies, Kiribati and Tuvalu, were formed. On 1 October 1978, Tuvalu became fully independent as a sovereign state within the Commonwealth.');
The West African Economic and Monetary Union (also known as UEMOA from its name in French, Union économique et monétaire ouest-africaine) is an organisation of eight, mainly francophone West African states within the ECOWAS. It was established to promote economic integration among countries that share the CFA franc as a common currency. UEMOA was created by a Treaty signed at Dakar, Senegal, on 10 January 1994, by the governments of Benin, Burkina Faso, Côte d''Ivoire, Mali, Niger, Senegal, and Togo. On 2 May 1997, Guinea-Bissau, a former Portuguese colony, became the organisation''s eighth (and only non-francophone) member state.');
From 1958 to 1962, the island was a member of the West Indies Federation. On 22 February 1979, Saint Lucia became an independent state and a member of the Commonwealth of Nations.');
28 November 1958 the republic was established and full independence from France was declared on 28 November 1960.');
After several French military expeditions, Niger  became a colony within Frenc West Africa in 1922. The Republic of Niger was proclaimed on 18 December 1958 and the independence from France achieved on
