In 1975, the country was renamed Benin after the Bight of Benin (which was in turn named after the Benin Empire which had its seat of power in Benin City, modern-day Nigeria), since "Benin" was deemed politically neutral for all ethnic groups in the state, whereas "Dahomey" recalled the Fon-dominated Kingdom of Dahomey.');
The land that is now Guinea belonged to a series of African empires until France colonized it in the 1890s, and made it part of French West Africa. Guinea declared its independence from France on 2 October 1958.');
French Sudan became the Sudanese Republic. Initially retained close connections with France and joined in a short-lived federation with Senegal in 1959, but ties to both countries quickly weakened. In 1960 it formally became the Republic of Mali. ');
In 1904, when French West Africa was formally established, Senegal was a part  of it.
On 25 November 1958, Senegal became an autonomous republic within the French Community. On 4 April 1959 Senegal and the French Sudan merged to form the Mali Federation, which became fully independent on 20 June 1960. Due to internal political difficulties, the Federation broke up on 20 August, when Senegal and French Sudan (renamed the Republic of Mali) each proclaimed independence.');
On 1 January 1986, after elections were held for its first parliament, Aruba seceded from the Netherlands Antilles.
At a convention in The Hague in 1990, the governments of Aruba, the Netherlands, and the Netherlands Antilles postponed indefinitely Aruba''s transition to full independence.');
The Soviet Union had its roots in the October Revolution of 1917 when the Bolsheviks and their Red Army, headed by Vladimir Lenin, overthrew the Provisional Government that had earlier replaced the monarchy of the Russian Empire. They established the Russian Soviet Republic, beginning a civil war between the Bolshevik Red Army and many anti-Bolshevik forces, the largest being the White Guard. By 1922, the Bolsheviks had emerged victorious, forming the Soviet Union with the unification of the Russian, Transcaucasian, Ukrainian and Byelorussian republics.
In the mid-1980s, the last Soviet leader, Mikhail Gorbachev, sought to reform and liberalize the economy through his policies of glasnost and perestroika. In August 1991, a coup d''état was attempted by Communist Party hardliners. It failed, and the Communist Party was banned. On 25 December 1991, Gorbachev resigned and the remaining constituent republics emerged from the dissolution of the Soviet Union as independent states. The Russian Federation (formerly the Russian SFSR) assumed the Soviet Union''s rights and obligations and is recognized as its continued legal personality.');
The South Ossetian Autonomous Oblast, created in 1922, declared independence from the Georgian Soviet Socialist Republic in 1991. The Georgian government responded by abolishing South Ossetia''s autonomy and trying to re-establish its control over the region by force.[13] The crisis escalation led to the 1991–92 South Ossetia War.[14] Georgians fighting against those controlling South Ossetia occurred on two other occasions, in 2004 and 2008.');
They had been part of the Spanish East Indies formally since 1528. Later, Spain sold some of the islands to the German Empire in 1885, and they became part of German New Guinea. In World War I, the Empire of Japan occupied the Marshall Islands, which, in 1920, the League of Nations combined with other former German territories to form the South Seas Mandate. During World War II, the United States took control of the islands. The U.S. government formed the Congress of Micronesia in 1965, a plan for increased self-governance of Pacific islands. The Trust Territory of the Pacific Islands in May 1979 provided independence to the Marshall Islands, formally recognized by the US. Full sovereignty or self-government was achieved in a Compact of Free Association with the United States on October 21, 1986.');
In the later 20th century, uprisings and demands for political representation by native African political activists seeking independence resulted in the UN assuming direct responsibility over the territory in 1966, but South Africa maintained de facto rule. In 1973 the UN recognised the South West Africa People''s Organisation (SWAPO) as the official representative of the Namibian people. Following continued guerrilla warfare, South Africa installed an interim administration in Namibia in 1985. Namibia obtained full independence from South Africa in 1990. However, Walvis Bay and the Penguin Islands remained under South African control until 1994.');
Transnistria is designated by the Republic of Moldova as the Transnistria autonomous territorial unit with special legal status.');
During the First World War, it was occupied by British, French and Belgian troops, and a later League of Nations Mandate to Great Britain and France by the League of Nations in 1922. The French mandate was known as Cameroun and the British territory was administered as two areas, Northern Cameroons and Southern Cameroons. Northern Cameroons consisted of two non-contiguous sections, divided by a point where the Nigerian and Cameroun borders met.
A plebiscite was agreed to and held on 11 February 1961. The Muslim-majority Northern area opted for union with Nigeria, and the Southern area voted to join Cameroon. Northern Cameroons became the Sardauna Province of Northern Nigeria on 31 May 1961, while Southern Cameroons became West Cameroon, a constituent state of the Federal Republic of Cameroon, later that year on 1 October 1961.');
Even after its final dissolution, a single currency, the British West African pound, was in effect throughout the region—including Nigeria—from 1907 to 1962.');
