Saint Christopher and Nevis gained independence in 1983 as the Federation of Saint Kitts and Nevis, while Anguilla would remain a British overseas territory.');
In 1951, the Portuguese Colony of Angola became an overseas province of Portugal. 
Renaming Angola (like Mozambique) in November 1972 (in effect 1 January 1973) as "Estado" (state) was part of an apparent effort to give the Portuguese Empire a federal structure. Angola became a sovereign state on 11 November 1975 as  the People''s Republic of Angola');
The Kingdom of Portugal declared a right of sovereignty over Macau in 1783. The 1822 constitution included Macau as an integral part of its territory. A Portuguese royal decree on 20 November 1845 declared Macau a free port. On 26 March 1887, the Lisbon Protocol was signed, in which China recognised the "perpetual occupation and government of Macao" by Portugal who in turn, agreed never to surrender Macau to a third party without Chinese agreement.');
The territory was liberated on 20 October 1944, and eventually reintegrated into the Democratic Federal Yugoslavia.');
Saint Vincent and the Grenadines passed through various stages of colonial status under the British. A representative assembly was authorised in 1776, Crown Colony government was installed in 1877, a legislative council was created in 1925 with a limited franchise. During the period of its control of Saint Vincent and the Grenadines, Britain made several attempts to unify the island with other Windward Islands as a single entity, with the aim of simplifying British control in the sub-region through a single unified administration. In the 1960s, the British again tried to unify all of its regional islands, including Saint Vincent, into a single politically unified entity under British control. The unification was to be called the West Indies Federation and was driven by a desire to gain independence from British government. However, the attempt collapsed in 1962. Saint Vincent was granted "associate statehood" status by Britain on 27 October 1969. This gave Saint Vincent complete control over its own internal affairs but fell short of full independence in law. 
On 27 October 1979, Saint Vincent and the Grenadines became the last of the Windward Islands to gain full independence.');
The Federation was established on 1 August 1953.  The constitutional status of the three territories – a self-governing Colony and two Protectorates – was not affected, though certain enactments applied to the Federation as a whole as if it were part of Her Majesty''s dominions and a Colony.The economic advantages to the Federation were never seriously called into question, and the causes of the Federation''s failure were purely political: the strong and growing opposition of the African inhabitants. The federation officially ended on 31 December 1963. In 1964, shortly after the dissolution, Northern Rhodesia and Nyasaland became independent under the names Zambia and Malawi, respectively. In 1965, Southern Rhodesia unilaterally declared independence from the United Kingdom as the state of Rhodesia.');
The rapid decolonisation of Africa in the late 1950s and early 1960s alarmed a significant proportion of Southern Rhodesia''s white population. In an effort to delay the transition to black majority rule, its predominantly white government issued its own Unilateral Declaration of Independence (UDI) from the United Kingdom on 11 November 1965. The new nation, identified simply as Rhodesia, initially sought recognition as an autonomous realm within the Commonwealth of Nations, but reconstituted itself as a republic in 1970. Two African nationalist parties, the Zimbabwe African People''s Union (ZAPU) and Zimbabwe African National Union (ZANU), launched an armed insurgency against the Rhodesian government upon UDI, sparking the Rhodesian Bush War. Growing war weariness, diplomatic pressure, and an extensive trade embargo imposed by the United Nations prompted Rhodesian prime minister Ian Smith to concede to majority rule in 1978. However, a multiracial provisional government headed by Smith and his moderate successor, Abel Muzorewa, failed to appease international critics or halt the war. By December 1979, Muzorewa had replaced Smith as Prime Minister and secured an agreement with ZAPU and ZANU, allowing Rhodesia to briefly revert to colonial status pending elections under a universal franchise. ZANU secured an electoral victory at the polls, and the country achieved internationally recognised independence in April 1980 as Zimbabwe.');
The British colony was established de jure in 1923, having earlier been occupied, constructed and administered by the British South Africa Company and its sub-concessionaires who were mostly British subjects. In 1953, it was merged into the Federation of Rhodesia and Nyasaland, which lasted until 1963. Southern Rhodesia then remained a de jure British colony until 1980. However, the Southern Rhodesia government issued a Unilateral Declaration of Independence (UDI) in 1965 and established Rhodesia, an unrecognised state. In 1979, it reconstituted itself under majority rule as Zimbabwe Rhodesia, which also failed to win it international recognition. After a period of interim British control following the Lancaster House Agreement in December 1979, the country achieved internationally recognised independence as Zimbabwe in April 1980.');
The Federation of Rhodesia and Nyasaland formed in 1953 was intensely unpopular among the vast African majority and its formation hastened calls for majority rule. As a result of this pressure, the country became independent in 1964 as Zambia. ');
