England took formal control of the Cayman Islands, along with Jamaica, as a result of the Treaty of Madrid of 1670. On 22 June 1863, the Cayman Islands became officially declared and administered as a dependency of the Crown Colony of Jamaica. The islands continued to be governed as part of the Colony of Jamaica until 1962, when they became a separate Crown colony while Jamaica became an independent Commonwealth realm.');

The colony was known as the Federal Colony of the Windward Islands from 1871 to June 1956, and then as the Territory of the Windward Islands until its dissolution in 1960.');
The Leeward Islands were united again as a semi-federal entity in 1833, coming together until 1871 under the administration of the Governor of Antigua. The islands then became known as the Federal Colony of the Leeward Islands from 1871 to 1956. From 1833 to 1940, Dominica was part of the colony.
On 3 January 1958 all islands except the Virgin Islands were absorbed into the West Indies Federation.');
The official name of the territory is still simply the "Virgin Islands", but the prefix "British" is often used. This is commonly believed to distinguish it from the neighbouring American territory which changed its name from the "Danish West Indies" to "Virgin Islands of the United States" in 1917. Economic linkages with the US islands prompted the British Virgin Islands to adopt the US dollar as its currency in 1959. 
The British Virgin Islands were administered variously as part of the British Leeward Islands or with St. Kitts and Nevis, with an administrator representing the British Government on the islands. The islands gained separate colony status in 1960 and became autonomous in 1967.');
The official name of the then-British administration was changed from the British Solomon Islands Protectorate to the Solomon Islands in 1975, and self-government was achieved the following year. Independence was obtained, and the name changed to just "Solomon Islands" (without the definite article), in 1978. At independence, Solomon Islands became a constitutional monarchy. The Queen of Solomon Islands is Elizabeth II.');
