The country had full autonomy, except in areas of defence, foreign policy, and nationality, and participated on a basis of equality with the Netherlands Antilles and the Netherlands itself in the Kingdom of the Netherlands. The country became fully independent as the Republic of Suriname on 25 November 1975.');
Niue was brought within the boundaries of New Zealand on 11 June 1901 by the same Order and Proclamation as the Cook Islands.
The New Zealand Parliament restored self-government in Niue with the 1974 constitution, following a referendum in 1974 in which Niueans had three options: independence, self-government or continuation as a New Zealand territory. The majority selected self-government.');
The British navigator Captain James Cook arrived in 1773 and again in 1777 giving the island of Manuae the name Hervey Island. The name "Cook Islands", in honour of Cook, first appeared on a Russian naval chart published by Adam Johann von Krusenstern in the 1820s. The Cook Islands became a British protectorate in 1888.  In 1901 the islands were included within the boundaries of the Colony of New Zealand and the Cook Islands have had a formal relationship with New Zealand since that time. The islands remained a New Zealand dependent territory until the New Zealand Government decided to grant them self-governing status, on 4 August 1965.
New Zealand is responsible for the Cook Islands'' defence and foreign affairs, but these responsibilities are exercised in consultation with the Cook Islands. In recent times, the Cook Islands have adopted an increasingly independent foreign policy. Cook Islanders are citizens of New Zealand, but they also have the status of Cook Islands nationals, which is not given to other New Zealand citizens.');
The SADR was proclaimed by the Polisario Front (a former socialist liberation force which has since reformed its ideological and political views) on February 27, 1976,');
Papua New Guinea is one of the most culturally diverse countries in the world. As of 2019, it is also the most rural, as only 13.25% of its people live in urban centres. There are 851 known languages in the country, of which 11 now have no known speakers. Most of the population of more than 8,000,000 people live in customary communities, which are as diverse as the languages');
Cambodia gained independence from France in 1953 and was led by King-turned politician Norodom Sihanouk. The Vietnam War extended into the country in 1965 with the expansion of the Ho Chi Minh Trail and establishment of the Sihanouk Trail. Following the 1970 coup which installed the right-wing pro-US Khmer Republic, the deposed King Sihanouk gave his support to his former enemies, the Khmer Rouge led by Pol Pot. With the support of the monarchy and North Vietnam, the Khmer Rouge emerged as a major power, taking Phnom Penh in 1975. The Khmer Rouge ruled the country and carried out the Cambodian genocide from 1975 until 1979, when they were ousted in the Cambodian–Vietnamese War. The Vietnamese-occupied People''s Republic of Kampuchea became the de-facto government, with attempts to rebuild the country after the genocide mired by limited international recognition and ongoing conflict.
Following the 1991 Paris Peace Accords which formally ended the war with Vietnam, Cambodia was governed briefly by a United Nations mission (1992–93). The UN withdrew after holding elections in which around 90 percent of the registered voters cast ballots. The 1997 coup d''état consolidated power under Prime Minister Hun Sen and the Cambodian People''s Party, who remain in power.');


